INSERT INTO `company` VALUES (53,'ІТ-Академія','info@intita.com',6,NULL,'2016-04-16 14:04:10','2017-08-14 14:17:57','','ІТ-Академія','https://intita.com/','067-431-74-24','<p>&nbsp;</p>\r\n\r\n<p><img src=\"https://intita.com/images/aboutus/key.png\" />Ми&nbsp;гарантуємо&nbsp;тобі стажування і&nbsp;100%отримання пропозиції працевлаштування протягом 4-6-ти місяців після успішного завершення навчання. Так впевнено стверджувати нам дозволяє той факт, що усі наші випускники працюють тими на кого навчались -&nbsp;програмістами.</p>\r\n',2,1),(54,'Тестова компанія','',1,NULL,'2016-04-18 19:07:15','2016-04-18 19:07:15','','','','','',0,0),(55,'http://www.robotamolodi.org/','http://www.robotamolodi.org/',2762,NULL,'2016-07-05 09:45:37','2016-07-05 09:45:37','','','','','',0,0),(56,')(*?:%;№;%:?*()','https://hh.com',3289,NULL,'2016-08-22 20:06:01','2016-08-22 20:06:01','','','','','',0,0),(57,'Осадчук А.В., ФОП','',4253,NULL,'2016-11-21 12:15:58','2016-11-21 12:15:58','','','','','',0,0),(58,'Test','',4911,NULL,'2017-01-31 09:05:53','2017-01-31 09:05:53','','','','','',0,0),(59,'Test Company','',4911,NULL,'2017-03-22 20:01:08','2017-03-22 20:01:08','','','','','',0,0),(60,'Молодіжний центр працевлаштування','http://www.robotamolodi.org/',5338,NULL,'2017-03-23 16:22:30','2017-03-23 16:22:30','','','','','',0,0),(61,'Vinnytsia IT Academy','ita.in.ua@gmail.com',5582,NULL,'2017-04-20 09:07:58','2017-08-17 11:44:10','','ITA','http://ita.in.ua/','067-431-19-21','<p><strong>Наша мета</strong> &ndash; готувати програмістів відповідно до реальних сучасних вимог ІТ-ринку. Програма навчання в I.T.A. передбачає максимальне поєднання теоретичних знань з практичною підготовкою. До викладання базових та профільних предметів залучаються досвідчені викладачі. Практикуючі програмісти партнерських ІТ-компаній і коучери поєднують отримані теоретичні знання із практичним досвідом.</p>\r\n',2,1),(62,'Людмила','',5613,NULL,'2017-04-24 09:29:57','2017-04-24 09:29:57','','','','','',0,0),(63,'ТОВ \"Подільський Моноліт\"','',5805,NULL,'2017-05-13 10:12:13','2017-05-13 10:12:13','NULL','','','','',0,0),(64,'Test Company','',5404,NULL,'2017-05-15 17:24:10','2017-05-15 17:24:10','NULL','','','','',0,0),(65,'ТОВ \"Клевер Сторс\" мережа магазинів \"7-23\"','https://www.facebook.com/sim23.market/?fref=ts',5895,NULL,'2017-05-30 12:01:06','2017-05-30 12:01:06','Оголошення А4.jpg','','','','',0,0),(67,'KAVAdrive','kavadrive@gmail.com',6,NULL,'2017-06-23 10:23:40','2017-06-29 16:29:56','NULL','KAVAdrive','http://kavadrive.com/','+380732099743','<p><img src=\"https://kavadrive.itatests.com/images/coffee-machine-logo.png\" /></p>\r\n\r\n<p>КАВАДРАЙВ - ЗАМОВЛЯЙ ОНЛАЙН!</p>\r\n\r\n<p>КАВАДРАЙВ&nbsp;- це сервіс олайн передзамовлень напоїв та їжі в перевірених закладах харчування. Якісні напої та їжа, вчасне, швидке та не нав&#39;язливе обслуговування, прогнозовані та помірковані витрари - це те, що Вам варто очікувати при здійснені замовлень в закладах-учасниках&nbsp;КАВАДРАЙВу.</p>\r\n\r\n<p>Ми гарантуємо:</p>\r\n\r\n<ul>\r\n	<li>ЯКІСТЬ&nbsp;- кожен заклад харчування обов&#39;язково нами перевіряється перед тим, як включити його в мережу&nbsp;КАВАДРАЙВ. І надалі наші експерти постійно перевіряють якість напоїв та їжі, які входять до менюКАВАДРАЙВ. Кожний замовник знає напевно, що буде смачно.</li>\r\n	<li>ВЧАСНІСТЬ&nbsp;та&nbsp;ШВИДКІСТЬ&nbsp;- кожен користувач сервісу впевнений, що завітавши на вказаний час до кав&#39;ярні, ресторану, фастфуду, він не чикатиме у черзі, а відразу протягом кількох хвилин отримає своє замовлення, яке зможе забрати із собою чи пригоститись безпосередньо там (якщо зарезервує столик).</li>\r\n	<li>ПРОГНОЗОВАНІСТЬ&nbsp;- крім того, що Ви очікувано отримаєте якісні напої та їжу, швидке обслуговування,Ви точно знатимете скільки коштів витратите на замовлення.</li>\r\n	<li>ЄДИНА ЦІНА&nbsp;- якщо якість напоїв і їжі та рівень обслуговування в закладах-учасниках&nbsp;КАВАДРАЙВу високі і контролюються нами, то і ціни в усіх закладах теж однакові.</li>\r\n	<li>ЗРУЧНІСТЬ- здійснити замовлення Ви зможете будь-де, в будь-який час, в будь-якому закладі, який входить до мережі&nbsp;КАВАДРАЙВ&nbsp;і з будь-якого пристрою - смартфона, планшета, комп&#39;ютера.</li>\r\n</ul>\r\n\r\n<p>МІСЦЕ ЗУСТРІЧІ - КАВАДРАЙВ - ЗАМОВЛЯЙ ОНЛАЙН!</p>\r\n',2,1),(68,'Miratech','ita.in.ua@gmail.com',5582,NULL,'2017-07-12 12:10:27','2017-09-13 12:15:11','1505301311-qB-oQjHZ_400x400.jpg','Miratech','http://www.miratech.ua/ru/vacancies','+380442064090','<p><strong>About Miratech</strong></p>\r\n\r\n<p>Miratech is&nbsp;an&nbsp;IT services and outsourcing company that provides managed&nbsp;IT services to&nbsp;large and midsize multinational organizations. Founded in&nbsp;1989, Miratech has its headquarters in&nbsp;Stockholm and Washington, DC; and R&amp;D centers in&nbsp;Poland, Slovakia, and Ukraine. Miratech serves its customers internationally, covering 560 locations.</p>\r\n\r\n<p>Miratech has been ranked highly in&nbsp;major industrial ratings, including the Global Services 100; the Software 500&reg;; the NOA&rsquo;s Outsourcing Professional Award; The Global Outsourcing 100&reg; and Best Five Companies in&nbsp;Eastern Europe, by&nbsp;IAOP&reg;.</p>\r\n\r\n<p>Miratech is&nbsp;ISO 9001, CMM Level 3, and ISO 27001 certified.</p>\r\n\r\n<p>For additional information about Miratech, please visit http://www.miratechgroup.com.</p>\r\n\r\n<p><strong>Miratech Facts</strong></p>\r\n\r\n<ul>\r\n	<li>Founded in&nbsp;1989</li>\r\n	<li>Corporate headquarters in&nbsp;Stockholm and Washington, DC</li>\r\n	<li>R&amp;D centers in&nbsp;Poland, Slovakia, and Ukraine</li>\r\n	<li>Named in&nbsp;FORTUNE magazine as&nbsp;one of&nbsp;the best 100 outsourcing service providers</li>\r\n	<li>Listed in&nbsp;key industrial ratings: Global Outsourcing 100&reg;, Global Services 100, Software 500&reg;, and NOA&rsquo;s Outsourcing Professional Awards; Best Five Companies in&nbsp;Eastern Europe by&nbsp;the IAOP&reg;</li>\r\n	<li>Software CMM Level 3, ISO 9001:2008, and ISO 27001:2005 certified</li>\r\n	<li>830 employees and growing</li>\r\n	<li>Previously a&nbsp;subsidiary of&nbsp;Telenor Group (OSE: TEL), went private in&nbsp;2011</li>\r\n	<li>Audit firm is&nbsp;Ernst &amp; Young</li>\r\n	<li>Annual sales growth over 30 percent since 2007</li>\r\n	<li>Trusted service provider to&nbsp;Forbes Global 2000 companies</li>\r\n	<li>Typical customer engagement exceeds five years</li>\r\n	<li>Track record of&nbsp;the highest customer satisfaction</li>\r\n</ul>\r\n',2,1),(69,'RIA','ita.in.ua@gmail.com',5582,NULL,'2017-07-21 10:26:05','2017-07-21 10:26:05','71378_company_logo_1.png','RIA','https://www.ria.com/','0432 555-206','<p>Наша компания объединяет группу проектов, которыми пользуются более 9 миллионов украинцев. Это лидер автомобильной интернет-торговли Украины AUTO.RIA, сайт проверенной недвижимости DOM.RIA, онлайн-классифайд RIA.com и&nbsp;интернет-магазин авто-товаров MARKET.RIA.</p>\r\n\r\n<p>Мы&nbsp;&mdash; молоды (средний возраст сотрудников&nbsp;&mdash; 25 лет), но&nbsp;достаточно зрелые, чтобы быть лидерами в&nbsp;Украине. С&nbsp;нами знаком каждый третий украинский пользователь.</p>\r\n\r\n<p>Средний опыт работы нашего сотрудника&nbsp;&mdash; 3,5 года и&nbsp;мы&nbsp;очень ценим лояльность и&nbsp;вовлеченность наших сотрудников в&nbsp;продукт.</p>\r\n\r\n<p>У&nbsp;нас легко, непринужденно и&nbsp;интересно.</p>\r\n\r\n<p>Мы&nbsp;все видим результаты нашей работы каждый день на&nbsp;наших сайтах.</p>\r\n\r\n<p>Люди благодарят нас.</p>\r\n\r\n<p>Люди любят нас.</p>\r\n\r\n<p>И&nbsp;именно вы&nbsp;можете вскоре стать частью нашей команды!</p>\r\n',2,1),(70,'Gemicle','sales@gemicle.com',5582,NULL,'2017-07-22 10:09:04','2017-07-22 10:09:04','Gemicle.jpg','Gemicle','http://gemicle.com/','0731337703','<p>Gemicle&nbsp;&mdash; an&nbsp;innovative, highly technological company with a&nbsp;broad range of&nbsp;expertise in&nbsp;spheres of&nbsp;the development of&nbsp;apps, complex e-commerce projects, and B2B solutions. Qualified teams of&nbsp;developers, designers, engineers, QAs, and animators deliver excellent products and solutions to&nbsp;branded and well-known companies. Knowledge and experience of&nbsp;specialists in&nbsp;Enterprise Java technologies, Flash, C++, JavaScript, and PHP allow the company to&nbsp;be&nbsp;at the top level of&nbsp;IT-industry. Gemicle is&nbsp;a&nbsp;fusion of&nbsp;team spirit, professionalism, and dedication. Gemicle is&nbsp;not just a&nbsp;company, it&rsquo;s a&nbsp;lifestyle.</p>\r\n',2,1),(71,'Delphi Software','info@udelphi.com',5582,NULL,'2017-07-24 07:42:09','2017-07-24 07:42:09','478830_company_logo_1.png','Delphi','http://www.udelphi.com/',' 380432550399','<p>Delphi helps their partners to bring meaningful products and services to the reality.&nbsp;<br />\r\n<br />\r\nWe are the company of professionals who have outstanding IT expertise and enjoy working together for more than 15 years.&nbsp;<br />\r\n<br />\r\nThe solutions we created vary from home-oriented educational software to huge multi-tiered distributed systems; from low-level embedded apps to fancy Web sites; from intelligent speech processing to advanced real-time analytics. For today, our technology focus is Enterprise Solutions, Mobile / Embedded Development and Web Design.&nbsp;<br />\r\n<br />\r\nWe guarantee personal attention and professional people to any of our clients regardless of the scope of work.</p>\r\n',2,1),(72,'ElifTech','info@eliftech.com',5582,NULL,'2017-07-25 13:57:12','2017-07-25 13:57:12','images.jpg','ElifTech','https://www.eliftech.com/','0933636569 ','<p>ElifTech&nbsp;&mdash; is&nbsp;a&nbsp;young software development company providing services for&nbsp;US and European customers with a&nbsp;cozy office in&nbsp;Lviv.</p>\r\n\r\n<p>Our mission is&nbsp;ambitious&nbsp;&mdash; we&nbsp;aspire to&nbsp;create a&nbsp;community of&nbsp;educated self-driven world-class engineers and to&nbsp;grow into a&nbsp;highly technical customer-centric company delivering prime-quality services to&nbsp;our clients.</p>\r\n\r\n<p>At&nbsp;the same time, we&nbsp;are an&nbsp;engineer-driven community with supreme software specialists involved, who leverage scientific approach in&nbsp;computer science and mathematics.</p>\r\n\r\n<p>We&nbsp;are focused on&nbsp;involving only top engineers who strive to&nbsp;research, study and implement the cutting-edge technological solutions to&nbsp;the real customer problems.</p>\r\n\r\n<p>Novices and smart students are also invited into the company. We&nbsp;are showing them what they can achieve and guiding them on&nbsp;how to&nbsp;become true professionals in&nbsp;software development and thus a&nbsp;part of&nbsp;our company.</p>\r\n\r\n<p>Our approach to&nbsp;managing resources is&nbsp;concentrated on&nbsp;the needs of&nbsp;our developers because we&nbsp;understand that the main idea of&nbsp;management and operations is&nbsp;to&nbsp;help engineers in&nbsp;doing their job.</p>\r\n\r\n<p>Our small team is&nbsp;free of&nbsp;bureaucracy and unnecessary management processes, which makes it&nbsp;truly engineer-oriented.</p>\r\n\r\n<p>Come and see on&nbsp;your own!</p>\r\n',2,1),(73,'Web Design Sun','contact@webdesignsun.com',5582,NULL,'2017-07-26 09:51:55','2017-07-26 09:51:55','1.jpg','Web Design Sun','http://www.webdesignsun.com/','442081446481','<p><strong>Web Design Sun&reg;</strong>&nbsp;is&nbsp;a&nbsp;friendly and joyful team in&nbsp;deed and not just in&nbsp;words. Got tired from all this empty show-off? We&rsquo;re not an&nbsp;open space with buzzing here and there managers, wonky useless HRs, nonsense daily meetings and endless coffee lines. What unites our team is&nbsp;our shared vision, consolidated, cozy workflow and the full understanding of&nbsp;what we&nbsp;do. We&nbsp;don&rsquo;t spread office gossips and don&rsquo;t show token smiles. When we&nbsp;laugh, we&nbsp;laugh all together; when there&rsquo;s a&nbsp;problem to&nbsp;fix, we&nbsp;fix it&nbsp;together with zeal. We&nbsp;don&rsquo;t leave our people face to&nbsp;face with their issues, shrugging shoulders and giving silly advice. Do&nbsp;you want something&nbsp;<strong>REAL</strong>? Welcome onboard!</p>\r\n',2,1),(74,'IncoreSoft','hr@incoresoft.com.ua',5582,NULL,'2017-07-27 09:58:24','2017-07-27 09:58:24','NULL','IncoreSoft','http://www.incoresoft.com.ua/',' 380686765428','<h3>ДОБРО ПОЖАЛОВАТЬ В&nbsp;INCORESOFT</h3>\r\n\r\n<p>Компания&nbsp;<strong>IncoreSoft</strong>&nbsp;долгие годы занимается разработкой проектов для наших европейских партнеров, а&nbsp;также имеет несколько собственных разработок. В&nbsp;процессе работы, для нас стало приоритетным направлением&nbsp;&mdash; IT&nbsp;АУТСТАФФИНГ. Мы&nbsp;помогаем нашим европейским партнерам найти качественных специалистов для решения интересных задач.</p>\r\n\r\n<p><strong>Что мы&nbsp;можем предложить:</strong></p>\r\n\r\n<ul>\r\n	<li>Работу над интересными проектами от&nbsp;иностранных заказчиков;</li>\r\n	<li>Комфортабельный и&nbsp;современный офис со&nbsp;всеми удобствами;</li>\r\n	<li>Семинары, тренинги, лекции;</li>\r\n	<li>Зависимость оплаты от&nbsp;Вашего желания и&nbsp;достижения конкретных результатов;</li>\r\n</ul>\r\n',2,1),(75,'SteelKiwi dev.','kulish@steelkiwi.com',5582,NULL,'2017-07-28 07:43:55','2017-07-28 07:43:55','AAEAAQAAAAAAAAagAAAAJGIxNjhiMTc0LWRlZDMtNDMyYS1iOTU1LWFlNjA0ZWQzNDdhMg.png','SteelKiwi','http://steelkiwi.com/','14154498696','<p>Who we&nbsp;are?</p>\r\n\r\n<p>We&nbsp;are SteelKiwi. Our focus is&nbsp;on&nbsp;Python/Django and we&nbsp;like what we&nbsp;do. Also, we&nbsp;like to&nbsp;build exceptional web and mobile applications.</p>\r\n\r\n<p>Today, SteelKiwi is&nbsp;a&nbsp;thriving company with two locations in&nbsp;Odessa and Vinnytsia, Ukraine. We&nbsp;have 6 departments: web development, mobile development, graphic design, DevOps, quality assurance (QA), and sales and marketing.</p>\r\n\r\n<p>We&nbsp;are the family type company and we&nbsp;like to&nbsp;celebrate different events together: either it&rsquo;s a&nbsp;birthday or&nbsp;just a&nbsp;Friday evening. Employees are a&nbsp;basis of&nbsp;our company, they are moreover our reason to&nbsp;pride. Your progress is&nbsp;very important for us&nbsp;and we&nbsp;are ready to&nbsp;help: books, sponsored events, sharing of&nbsp;knowledge, free English courses in&nbsp;the office. We&nbsp;also have a&nbsp;system of&nbsp;bonuses: did you make a&nbsp;coffee to&nbsp;colleagues, help to&nbsp;solve the problem, borrow the battery charger? You can choose an&nbsp;interesting prize for bonuses received from colleagues.</p>\r\n',2,1),(76,'Addeesoft','az@addeesoft.com',5582,NULL,'2017-07-31 10:52:16','2017-07-31 10:52:16','acb787c4bf52ae164f1a4ebf57d7a19f.jpg','Addeesoft','https://addeesoft.com/','0938128668','<p><strong>Addeesoft LLC</strong>&nbsp;&mdash; ІТ компанія, що&nbsp;спеціалізується на&nbsp;консалтингу та&nbsp;розробці рішень різної складності, переважно у&nbsp;сфері фінансових, агротехнологій та&nbsp;Smart city (Rocket Finance, Beyond Broke, Windim, etc.).</p>\r\n\r\n<p>Addeesoft є одним з ініціаторів та&nbsp;засновників Vinnytsia IT-cluster.</p>\r\n\r\n<p>На&nbsp;даний момент у Вінниці планується відкриття першого R&amp;D центру, тому ми&nbsp;запрошуємо до&nbsp;співпраці всіх розробників різних технологій та&nbsp;мов програмування, з&nbsp;досвідом і без.</p>\r\n\r\n<p><strong>Ми&nbsp;швидко розвиваємося, і прагнемо бачити у&nbsp;своїй команді таких самих людей!</strong></p>\r\n',2,1),(77,'Mijndev.com','contact@mijndev.com',5582,NULL,'2017-08-02 09:35:13','2017-08-02 09:35:13','profile_logo_.png','Mijndev','http://mijndev.com/',' 380938793823','<p>Outsourcing web development to&nbsp;Ukraine is&nbsp;growing fast and this is&nbsp;not without good reasons. Ukraine boasts one of&nbsp;the worlds biggest trained&nbsp;IT workforce, good quality tertiary education and low labour costs. For the average European business, there are a&nbsp;few pitfalls to&nbsp;outsourcing to&nbsp;Ukraine namely the language barrier and cultural differences.</p>\r\n\r\n<p>Working with various clients from Netherlands, Germany, Belgium, Mauritius and Canada.</p>\r\n\r\n<p>Providing a&nbsp;European work style in&nbsp;Ukraine.</p>\r\n',2,1),(78,'Fozzy group','personal@fozzy.ua',5582,NULL,'2017-08-03 07:20:55','2017-08-03 07:20:55','Fozzy_Group_logo.png','Fozzy group','http://www.fozzy.ua/','380504198485 ','<p><strong>Fozzy Group</strong>&nbsp;&mdash; одна из&nbsp;крупнейших торгово-промышленных групп Украины. Торговля продуктами и&nbsp;товарами для дома&nbsp;&mdash; супермаркеты &laquo;Сільпо&raquo;, оптовые гипермаркеты Fozzy, &laquo;магазины у&nbsp;дома&raquo; &laquo;Фора&raquo; и &laquo;Буми&raquo;. В&nbsp;сетях Fozzy Group представлены товары под собственной торговой маркой &laquo;Премія&raquo; и &laquo;Повна Чаша&raquo;. Торговля непродовольственными товарами&nbsp;&mdash; аптеки &laquo;Будь Здоровий&raquo;, фармацевтические супермаркеты &laquo;Біла ромашка&raquo;, персональная электроника &laquo;Ringoo&raquo;. Основные предприятия промышленного направления Fozzy Group&nbsp;&mdash; Нежинский консервный завод, птицефабрика &laquo;Варто&raquo;. Ресторанный бизнес&nbsp;&mdash; чешские ресторации &laquo;У Хромого Пола&raquo;, &laquo;Старомак&raquo;, рестораны &laquo;Prad-A-Caf&eacute;&raquo;, &laquo;Liquor&raquo; и &laquo;La Bodeguita del Medio&raquo;. В&nbsp;прошлом году у&nbsp;Fozzy Group появился новый бизнес&nbsp;&mdash; сеть туристических агентств &laquo;Сильпо&nbsp;&mdash; Вояж&raquo;.</p>\r\n',2,1),(79,'MemCrab studio','office@memcrab.com',5582,NULL,'2017-08-07 06:49:05','2017-08-07 06:51:04','222a84f14d207cba70213ab0d53de083.jpg','MemCrab','http://memcrab.com/','380939037655','<p>Сфера деятельности: разработка под веб.</p>\r\n\r\n<p>О компании:</p>\r\n\r\n<ul>\r\n	<li>Agile команда с постоянным ростом.</li>\r\n	<li>Никаких сложных иерархий - горизонтальная&nbsp;система управления</li>\r\n	<li>Прозрачные бонусы</li>\r\n	<li>Непрерывно повышение квалификации всех членов команды</li>\r\n	<li>Работа с Европой и США</li>\r\n</ul>\r\n',2,1),(80,'Premium Call','contact@premiumcall.com.ua',5582,NULL,'2017-08-08 08:08:09','2017-08-08 08:08:09','avatar_feysbuk_3.jpg','Premium Call','https://premiumcall.com.ua/','380930765921','<p><strong>Контакт-центр Premium call&nbsp;</strong>&mdash;&nbsp;молодая и&nbsp;перспективная команда профессионалов, которых объединяет желание создавать новый вид сервиса телефонных продаж. Мы&nbsp;разрываем устоявшиеся шаблоны подхода к&nbsp;клиентам и&nbsp;сотрудникам&nbsp;&mdash; это делает&nbsp;<strong>Premium call&nbsp;</strong>привлекательным и&nbsp;перспективным работодателем.</p>\r\n\r\n<p>Мы&nbsp;приветствуем инициативу, целеустремленность и&nbsp;коммуникабельность, поощряем и&nbsp;способствуем развитию активных сотрудников.</p>\r\n\r\n<p>Вакансии контакт-центра&nbsp;<strong>Premium call&nbsp;</strong>&mdash;&nbsp;это прекрасная возможность получить уникальные знания, опыт, построить карьеру, стать профессионалом, найти новых друзей.</p>\r\n\r\n<p><strong>КОМАНДА</strong>&nbsp;<strong>Premium call&nbsp;</strong>&mdash;&nbsp;это дружный коллектив. Мы&nbsp;всегда помогаем друг другу и&nbsp;делимся опытом. Мы&nbsp;объединены корпоративной культурой, которая создает атмосферу комфорта для сотрудников, где каждый из&nbsp;нас может стать инициатором и&nbsp;активным организатором любого мероприятия компании.</p>\r\n',2,1),(81,'Web Soft Group','info@websoftgroup.net',5582,NULL,'2017-08-10 07:23:59','2017-08-10 07:23:59','WEB.png','WSG','http://websoftgroup.net/','380676401740','<p>Websoftgroup&nbsp;&mdash; мы&nbsp;создаем качественные Веб-сайты и&nbsp;Веб-сервисы.</p>\r\n\r\n<p>Создавая сайты, помним об&nbsp;основной цели&nbsp;&mdash; клиент должен получить рабочий продукт, который отвечает требованиям клиента в&nbsp;указанные сроки, с&nbsp;достаточным качеством и, в&nbsp;рамках установленного бюджета.</p>\r\n\r\n<p>Наша миссия&nbsp;&mdash; создание и&nbsp;поддержка ценностей в&nbsp;которых нуждаются наши клиенты.</p>\r\n\r\n<p>Наша основная работа&nbsp;&mdash; создание качественных, красивых и&nbsp;удобных, функциональных веб-сайтов и&nbsp;веб-сервисов.</p>\r\n\r\n<p>В&nbsp;работе используем: HTML / Twig / CSS / SCSS / Bootstrap / Foundation / HAML, PHP / Yii1 / Yii2 / PHPunit, JavaScript / CoffeeScript / JQuery / NodeJS / JSON / AJAX, Gulp.js / Brunch.js / Bower, MySQL / PosgreSQL / SQLite / Sphinx / Redis, Codeception / Gitlab CI, Git / Gitlab / Redmine, Docker / Vargrant, Scrum, Ubuntu / CentOS, PHP-FPM / Nginx / Hipache.</p>\r\n',2,1),(82,'Astound Commerce','jobs@astoundcommerce.com',5582,NULL,'2017-08-11 09:53:02','2017-08-11 09:53:02','1cf747c95619d694b5dcb47442c6ba6b.png','Astound Commerce','https://astoundcommerce.com/us/home/','380445852887','<p>Давай знайомитися, ми&nbsp;&mdash; Astound Commerce, глобальна команда експертів електронної комерції.</p>\r\n\r\n<p>Ми&nbsp;забезпечуємо повний цикл послуг: від планування, дизайну, розробки та підтримки рішення до&nbsp;його просування й&nbsp;операційної аналітики. Результат нашої роботи&nbsp;&mdash; рішення, яке надає можливість здійснити покупку товару всесвітньо відомих брендів, не відходячи від комп&rsquo;ютера або з&nbsp;мобільного телефону та&nbsp;планшету.</p>\r\n\r\n<p>В&nbsp;Україні наша компанія представлена у&nbsp;чотирьох містах&nbsp;&mdash; Київ, Чернігів, Вінниця та&nbsp;Ужгород, також наші експерти працюють в&nbsp;офісах у&nbsp;Словаччині, Болгарії, Німеччині, Колумбії та&nbsp;США. Головний офіс компанії розташований в&nbsp;Сан-Франциско, США.</p>\r\n\r\n<p>Astound Commerce&nbsp;&mdash; це</p>\r\n\r\n<ul>\r\n	<li>Команда професіоналів-однодумців.Ми знаємо, тобі буде комфортно працювати з&nbsp;нами. У&nbsp;нас в&nbsp;компанії завжди &laquo;відкриті двері&raquo;, це&nbsp;означає, що&nbsp;всі члени команди на&nbsp;всіх рівнях відкрито спілкуються між собою. Маєш запитання? Задай його засновнику на&nbsp;щотижневій зустрічі.</li>\r\n	<li>Один з лідерів світового ринку в&nbsp;області розробки ecommerce сайтів. Ти&nbsp;завжди будеш у&nbsp;курсі останніх тенденцій ecommerce. Ми&nbsp;реалізуємо проекти за&nbsp;SDLC.</li>\r\n	<li>Понад 16 років професійної експертизи. Ми&nbsp;співпрацюємо зі всесвітньо відомими брендами, що&nbsp;гарантує застосування новітніх технологій.</li>\r\n	<li>Понад 600 ecommerce професіоналів по&nbsp;всьому світу. З&nbsp;першого дня в&nbsp;компанії ти&nbsp;будеш відчувати себе &laquo;на своєму місці&raquo;, у&nbsp;нас розроблена детальна програма он-бордінгу.</li>\r\n	<li>Понад 1000 реалізованих проектів. Ти&nbsp;завжди матимеш можливість висловити думку, ідею та&nbsp;зробити свій внесок у&nbsp;реалізацію масштабних й&nbsp;комплексних проектів для таких культових брендів, як&nbsp;Adidas, Versace, Belstaff, Jimmy Choo, Mothercare, Tommy Hilfiger, Hugo Boss, Crocs та інших.</li>\r\n</ul>\r\n\r\n<p>Ми&nbsp;захоплюємося технологіями, які змінюють світ електронної комерції, та&nbsp;пишаємося, що&nbsp;нас визнали Salesforce Commerce Cloud і Magento Professional Solutions Partner.</p>\r\n\r\n<p>Наші рішення електронної комерції розробляються на&nbsp;кращих ecommerce платформах: Salesforce Commerce Cloud (Demandware), Magento, Hybris, IBM, INTERSHOP, Kibo (MarketLive), NetSuite.</p>\r\n\r\n<p>Astound Commerce&nbsp;&mdash; команда блискучих ecommerce фахівців.</p>\r\n\r\n<p>Ми&nbsp;пишаємося нашою командою та&nbsp;щиро запрошуємо тебе долучитися до&nbsp;нас!</p>\r\n',2,1),(83,'Infopulse','info@infopulse.com.ua',5582,NULL,'2017-08-17 19:28:57','2017-09-11 11:13:23','1505124803-12728819_963007953783050_3751031805035429441_n.jpg','Infopulse','https://www.infopulse.com/','+380980835474','<h2>Infopulse &ndash; a Trusted International Vendor of First-Class IT Solutions</h2>\r\n\r\n<p>With offices in 8 countries across Europe and the Middle East, Infopulse is one of the largest IT outsourcing companies in Ukraine. Delivering excellence in Software Engineering, Infrastructure Management, and Information Security, Infopulse has built a reputation of a trusted full-service solution provider.</p>\r\n\r\n<h3>Growth and stability</h3>\r\n\r\n<p><a href=\"https://www.infopulse.com/company/company-evolution/\">Founded over 25 years ago</a>, Infopulse has been sustainably growing during the past decade. As of 2017, with a team of 1,500+ best-in-class IT specialists, Infopulse continuously enjoys top ranks in<a href=\"https://www.infopulse.com/news/infopulse-makes-it-to-the-top-3-best-ukrainian-it-employers/\">Best Employer Ratings</a>, consequently showing the lowest attrition rates on our market.</p>\r\n\r\n<p>Being part of EVRY, one of the largest IT companies in Scandinavia, Infopulse shares&nbsp;<a href=\"https://www.infopulse.com/company/international-strength-local-excellence/\">European Values</a>of business culture and quality standards. The company pays special attention to creation and maintenance of solid business continuity plans, ensuring the steadiness of all processes and teams. We support our clients in long-term partnerships to empower new flexible business capabilities, to drive continuous technological and service improvements, and to reduce costs.</p>\r\n\r\n<h3>Industry Focus</h3>\r\n\r\n<p>Efficiently combining in-depth industry knowledge and technological expertise, Infopulse delivers enhanced business value to its customers by providing reliable IT services and solutions for both SMEs and Fortune 100 corporations from all across the globe.</p>\r\n\r\n<p>With a focus on Automotive, E-Commerce, Electronics, Energy, Finance, FMCG, Healthcare, High-Tech, Marketing, Publishing, Software, Telecom and&nbsp;<a href=\"https://www.infopulse.com/industries/\">other industries</a>, our primary aim is to provision our clients with quality services, customer-specific technologies, and comprehensive expertise. Our business&nbsp;<a href=\"https://www.infopulse.com/company/customer-oriented-culture/\">is tailored</a>&nbsp;around our client &ndash; to deliver benefits, perform exceptionally, improve business agility, solve problems, turn them into opportunities and fill the needs.</p>\r\n\r\n<h3>Our approach</h3>\r\n\r\n<p>By applying key principles of our&nbsp;<a href=\"https://www.infopulse.com/company/it-lifecycle-services/\">full &ldquo;value chain&rdquo; approach</a>, Infopulse is an integrated partner for all of your IT solution needs &ndash; from simple maintenance to product development, from basic research to complex consulting. We &ldquo;speak the language&rdquo; of the Industry, having advanced knowledge in architecture, security, management, methodology, business, finance, packaging, and other functional domains.</p>\r\n\r\n<p>Our business is based on our&nbsp;<a href=\"https://www.infopulse.com/company/about-infopulse/corporate-values/\">Motto</a>&nbsp;&ndash; Creating Value, Delivering Excellence!</p>\r\n',2,1),(84,'EXADEL','info@exadel.com',5582,NULL,'2017-08-21 08:20:30','2017-08-21 08:20:30','stacked-logo-blue.png','EXADEL','https://exadel.com/','+1866 3414828','<p>We deliver award-winning innovative technology solutions to companies around the world. With 15 locations in the US and Europe, 800+ developers, and a 95% client satisfaction rating, we have the expert resources and global footprint to produce effective business results.</p>\r\n',2,1),(85,'Silego Technology Inc.','vitay@silego.com',5582,NULL,'2017-08-22 09:21:08','2017-11-18 09:36:21','1510993997-10269558_10152181163103585_1012117294754844754_n.jpg','Silego ','http://www.silego.com/','+38(014) 083-27-88','<p>Silego Technology, Inc. is a fabless semiconductor company headquartered in Santa Clara, California with operations in Taiwan, and additional design/technology centers in China, Korea and Ukraine.</p>\r\n\r\n<p>Silego designs and sells highly configurable power, logic, and timing mixed signal IC products referred to as CMICs (Configurable Mixed-signal IC Products). The CMIC products integrate medium precision analog components, discrete digital logic, and passive components into highly configurable small, easy to use, low cost ICs. CMIC products provide customers the benefits of reduced system parts count, lower power consumption, less board space and reduced BOM costs. CMICs provide the flexibility of an FPGA and have similar pricing to ASICs without nonrecurring engineering costs, and long design cycles. Silego&rsquo;s goal is to allow electronics manufacturers to integrate 20 components in 20 minutes for $0.20.</p>\r\n\r\n<p>Silego&rsquo;s customers include many leading OEMs that manufacture and sell Personal Computers systems, data communication equipment, and consumer electronic devices. Silego was recognized in 2010 by Deloitte Technology Fast 50 Rising Star ranking as one of the fastest growing technology companies in Silicon Valley.</p>\r\n',2,1),(86,'SKY I.T. GROUP','iurii.prytuliak@gmail.com',5582,NULL,'2017-08-22 18:59:44','2017-08-22 18:59:44','Wsqopcs4.png','SKY I.T. GROUP','http://www.skyitgroup.com/','+380936319915','<p>Sky I.T. Group remedies complex business problems with innovative technology, targeted solutions, and a team that has your back. It&#39;s that simple!</p>\r\n',2,1),(87,'SOFT-GROUP','hr@softgroup.ua',5582,NULL,'2017-08-28 09:34:43','2017-08-28 09:34:43','20953353_1875266722734454_1843933798539335670_n.jpg','SOFT-GROUP','http://www.softgroup.ua/o-nas','+380444516764','<p>We provide professional IT and programmers&rsquo; support on contract basis, as well as project development services on the fix-time and fix-price basis to world-class clients in the U.K., United States, and Europe.</p>\r\n',2,1),(88,'ВІСК','robota@visk.dp.ua',6127,NULL,'2017-08-29 13:50:21','2017-08-29 13:50:21','NULL','ВІСК','http://www.visk.dp.ua','0567670110','<p><img alt=\"\" src=\"http://www.visk.dp.ua/img/logo.svg\" style=\"float:left; height:32px; width:93px\" /><strong>Про компанію &quot;ВІСК&quot;</strong><br />\r\nЗаснована в 2012 році.&nbsp;Веде діяльність на міжнародному ринку.&nbsp;Постачальник готових рішень для телекома та ІТ-бізнесу:</p>\r\n\r\n<ul>\r\n	<li>консультування із питань управління</li>\r\n	<li>комплексні системи управління</li>\r\n	<li>програмне забезпечення</li>\r\n	<li>настільні та мобільні додатки</li>\r\n	<li>локалізація та переклад</li>\r\n	<li>маркетинг</li>\r\n</ul>\r\n',2,2),(89,'Uni2Biz ИТ-стажировка','participate@uni2biz.org',6127,NULL,'2017-08-29 14:01:52','2017-08-29 14:01:52','NULL','Uni2Biz','http://www.uni2biz.org','0636272914','<p>Uni2Biz - это международная веб-платформа.</p>\r\n\r\n<p>Uni2Biz предлагает множество возможностей в образовании и бизнесе для студентов и выпускников.</p>\r\n\r\n<p>Главная цель Uni2Biz - подготовка студентов и недавних выпускников к карьере и предоставление возможности участия в бизнесе. Таким образом, Uni2Biz &ndash; это мост между студентами и бизнесом.</p>\r\n\r\n<p>Каждый студент имеет возможность самовыражения. Студенты работают в условиях модели реального бизнеса. Это место, где сочетаются все навыки, необходимые для достижения успеха. Работа над проектом проводится с студентами разных специальностей в небольших координируемых группах.</p>\r\n\r\n<p>Веб-сайт Uni2Biz будет служить платформой, где студенты и будущие работодатели найдут друг друга.</p>\r\n\r\n<p>Платформа Uni2Biz используется для тренировки, а также для:</p>\r\n\r\n<ul>\r\n	<li>симуляции реального бизнеса;</li>\r\n	<li>связи между участниками и их будущими работодателями;</li>\r\n	<li>опыта использования делового языка;</li>\r\n	<li>приобретения навыков, которые будут полезны в будущей работе;</li>\r\n	<li>выражения креативности подхода и образа мышления участников;</li>\r\n	<li>интеграции в международный бизнес;</li>\r\n	<li>развития чувства корпоративной ответственности, находчивости, гибкости, восприимчивости мышления и других жизненно необходимых для бизнеса навыков;</li>\r\n</ul>\r\n\r\n<p>Uni2Biz - это волонтерский проект, участие в нем бесплатное. Работа ведется очень энергично. Проект функционирует как бизнес: если студент не выполняет работу, за которую он отвечает, то он выходит из проекта, а если он выполняет задания хорошо и вовремя, его берут на оплачиваемую работу.</p>\r\n\r\n<p>Возможности развития неограниченны. Все зависит от креативности участников и реальных потребностей. Uni2Biz - это международный проект, который проходит в нескольких странах, что открывает возможность интеграции в мировой бизнес.</p>\r\n',2,2),(90,'P1: K Accelerator','info@p1k.co.uk',5582,NULL,'2017-08-31 11:20:36','2017-08-31 11:20:36','19105820_318694701893873_7805513608980893649_n.png','P1: K Accelerator','https://p1k.co.uk/','+380931367727','<p>We&nbsp;do&nbsp;not predict the future, we&nbsp;create&nbsp;it! Making hi-end technologies serve your purpose is&nbsp;what we&nbsp;love doing. Because it&rsquo;s our passion. Passion that transformed into a&nbsp;number-one goal. Call&nbsp;us Phase One: Karma or&nbsp;P1:K for short. Developing state-of-the-art technologies is&nbsp;our strongest suit.</p>\r\n',2,1),(91,'UDS Consulting','info@uds.systems',5582,NULL,'2017-09-03 08:49:50','2017-09-03 08:49:50','15283934_208653432916367_3602120719658946889_n.png','UDS Consulting','https://uds.systems/','+380443610738','<h3>We provide high quality Microsoft Dynamics CRM &amp; Dynamics 365 solutions, starting from CRM Online Customization and up to long-term On-Premise Projects with Agile methodology, industry modifications, multiple system integrations for EU, AU and US based companies</h3>\r\n',2,7),(92,'SMYT','sales@smytcorp.com',5582,NULL,'2017-09-05 10:07:24','2017-09-05 10:10:45','10801990_705904802838403_1486453089777570348_n.png','SMYT','http://smytsoft.com/','+380932566680','<p>We develop from scratches cross platform applications (Web - Windows - Linux - Android) having one or many key features we are really good at:</p>\r\n\r\n<p>- big data handling</p>\r\n\r\n<p>- database engineering</p>\r\n\r\n<p>- personnel access and attendance management</p>\r\n\r\n<p>- E-document and reporting management</p>\r\n\r\n<p>- custom geospatial solutions (putting on a dynamic web map what you have in your database(s) and doing all kinds of analytics with that)</p>\r\n\r\n<p>We prefer to focus at non-standard, sophisticated cases.&nbsp;</p>\r\n',2,1),(93,'Zeus Electronics','hr@zeuselectronics.eu',5582,NULL,'2017-09-06 09:57:10','2017-09-06 09:57:10','c61c1969932178426b198d6686e8e6c2.png','Zeus ','https://zeuselectronics.eu/','+380676791319','<p>Zeus Electronics is&nbsp;an&nbsp;international operating state-of-the-art mobile and web solutions provider. Though Zeus Electronics is&nbsp;mainly a&nbsp;technique driven company with in-depth understanding of&nbsp;the high expectations from the industry we&nbsp;are always aware about the heavy cost pressure in&nbsp;the global market and employee satisfaction rate. All our engineers are fascinated by&nbsp;technology and we&nbsp;possess operational expertise. Zeus Electronics&rsquo; superior reputation and attractiveness as&nbsp;employer result in&nbsp;long employee tenures and a&nbsp;significantly low turnover rate&nbsp;&mdash; the preconditions for stable project&nbsp;<a href=\"http://teams.to/\" target=\"_blank\">teams.To</a>&nbsp;maintain long-term relationships Zeus Electronics&rsquo; principle commitment is&nbsp;to&nbsp;satisfy our customers permanently with affordable excellence at&nbsp;highest quality standards in&nbsp;reaching both their technical and commercial goals.</p>\r\n',2,7),(94,'ElifTech','info@eliftech.com',5582,NULL,'2017-09-11 11:12:17','2017-09-11 11:15:37','1505124754-17554140_1263861613667422_1461656545530918286_n.jpg','ElifTech','https://www.eliftech.com/','+380967462360','<p>ElifTech&nbsp;&mdash; is&nbsp;a&nbsp;young software development company providing services for&nbsp;US and European customers with a&nbsp;cozy office in&nbsp;Lviv.</p>\r\n\r\n<p>Our mission is&nbsp;ambitious&nbsp;&mdash; we&nbsp;aspire to&nbsp;create a&nbsp;community of&nbsp;educated self-driven world-class engineers and to&nbsp;grow into a&nbsp;highly technical customer-centric company delivering prime-quality services to&nbsp;our clients.</p>\r\n\r\n<p>At&nbsp;the same time, we&nbsp;are an&nbsp;engineer-driven community with supreme software specialists involved, who leverage scientific approach in&nbsp;computer science and mathematics.</p>\r\n\r\n<p>We&nbsp;are focused on&nbsp;involving only top engineers who strive to&nbsp;research, study and implement the cutting-edge technological solutions to&nbsp;the real customer problems.</p>\r\n\r\n<p>Novices and smart students are also invited into the company. We&nbsp;are showing them what they can achieve and guiding them on&nbsp;how to&nbsp;become true professionals in&nbsp;software development and thus a&nbsp;part of&nbsp;our company.</p>\r\n\r\n<p>Our approach to&nbsp;managing resources is&nbsp;concentrated on&nbsp;the needs of&nbsp;our developers because we&nbsp;understand that the main idea of&nbsp;management and operations is&nbsp;to&nbsp;help engineers in&nbsp;doing their job.</p>\r\n\r\n<p>Our small team is&nbsp;free of&nbsp;bureaucracy and unnecessary management processes, which makes it&nbsp;truly engineer-oriented.</p>\r\n\r\n<p>Come and see on&nbsp;your own!</p>\r\n',2,1),(95,'GoGo Cab','gogotaxi.vn@gmail.com',5582,NULL,'2017-09-12 09:25:54','2017-09-12 09:28:17','1505204766-15283993_1797481683851261_2240236110181197683_n.png','GoGo','https://gogotaxi.com.ua/','+380732083060','<p>GoGo Taxi - новий мобільний сервіс замовлення таксі у Вінниці.</p>\r\n',2,1),(96,'Qoderoom ','hello@qoderoom.com',5582,NULL,'2017-09-16 08:10:24','2017-09-16 08:10:24','16729184_1578792745468639_6858281221655686459_n.png','Qoderoom ','http://qoderoom.com','+442032900389','<p>Located in Eastern Europe, Qoderoom is present on the market since 2009. We have more then hundred of successfully completed projects and even larger amount of happy customers.<br />\r\n<br />\r\nOur processes has been awarded with ISO 9001:2008 certification, our loyalty program software solution has successfully passed PCI DSS certification by VISA, including rigorous penetration tests.<br />\r\n<br />\r\nQoderoom is a part of GRPIIIQ &ndash; group of IT companies that allow full-cycle business transformation for the fourth technological revolution.</p>\r\n',2,7),(97,'GKS Веб Студія','gkswebstudio@gmail.com',5582,NULL,'2017-09-18 10:27:15','2017-09-18 10:27:15','12814591_1569851966661699_7726235579588850720_n.jpg','GKS ','http://gks.com.ua/en/','+380931097758','<p>GKS Веб-Студія займається&nbsp;<strong>створенням і розвитком сайтів</strong>. Завдяки команді професіоналів ми робимо сайти високої складності, потужні за своїм функціоналом.</p>\r\n\r\n<p>У той же час ми з задоволенням створюємо сайти &ndash; візитки, і не збільшуємо ціни на те, що за визначенням не повинно коштувати дорого.</p>\r\n\r\n<p>Ми намагаємося точно виконувати взяті на себе зобов&rsquo;язання за термінами та якістю робіт, завдяки злагодженій взаємодії фахівців потрібних напрямків.</p>\r\n\r\n<p><strong><em>Принцип роботи з клієнтами &ndash; доброзичливість і відповідальність.</em></strong></p>\r\n',2,7),(98,'Promotion LTD.','osh@promotion-staff.com',5582,NULL,'2017-09-21 07:48:27','2017-09-21 07:48:27','16194873_720190024806658_2398252487495256216_n.png','Promotion','http://www.promotion-staff.com/','+380679397348','<p>The company&nbsp;<strong>&laquo;Promotion&raquo;</strong>&nbsp;was founded in 1998 in Canada and has its operating offices in Toronto, Moscow and Kiev.</p>\r\n\r\n<p>The company&nbsp;<strong>&laquo;Promotion&raquo;&nbsp;</strong>is a leading company in secondment / outsourcing, in matters of search and selection of highly qualified specialists of different professions, in human resources outsourcing, payroll preparation and human resources management consulting for leading multinational companies.</p>\r\n\r\n<p><br />\r\nThe total number of secondment personnel of our partners, supported by a group of companies&nbsp;<strong>&laquo;Promotion&raquo;</strong>&nbsp;is<strong>&nbsp;more than 10,000 professionals</strong>.The group of companies&nbsp;<strong>&laquo;Promotion&raquo;</strong>&nbsp;carries out personnel secondment / outsourcing, search and selection of highly qualified specialists&nbsp;<strong>in more than 12 countries</strong>, including&nbsp;<em>Russian Federation, Azerbaijan, Romania, Armenia, Belarus, Kazakhstan, Canada, Moldova, Poland, United States, Uzbekistan</em>&nbsp;etc.</p>\r\n\r\n<p>According to the National Business-ranking, group of companies&nbsp;<strong>&laquo;Promotion&raquo;</strong>&nbsp;is the&nbsp;<strong>branch leader</strong>.&nbsp;<strong>&laquo;Promotion&raquo;</strong>&nbsp;has the<strong>&nbsp;reputation of reliable partner</strong>.</p>\r\n\r\n<p>The group of companies&nbsp;<strong>&laquo;Promotion&raquo; is a member of the American Chamber of Commerce, member of the Taxpayers Association</strong>.</p>\r\n\r\n<p>The group of companies&nbsp;<strong>&laquo;Promotion&raquo;</strong>&nbsp;provides services for more than&nbsp;<strong>150 partners</strong>&nbsp;- large foreign companies in various market segments and is recognized as the most customer-oriented, flexible and reliable company, providing high-quality service.</p>\r\n\r\n<p>Financial stability of the group of companies&nbsp;<strong>&laquo;Promotion&raquo;</strong>&nbsp;is based on the formation of&nbsp;<strong>multi-million financial reserves.</strong></p>\r\n\r\n<p>In order to optimize personnel secondment (outsourcing) projects and the ability to provide full-cycle quality services, the company&nbsp;<strong>&laquo;Promotion&raquo;</strong>&nbsp;is represented by several companies belonging to the group of companies&nbsp;<strong>&laquo;Promotion&raquo;</strong>.</p>\r\n\r\n<p>The group of companies&nbsp;<strong>&laquo;Promotion&raquo;</strong>&nbsp;provides services based on developed unified technology of interaction with each of the Partners of Group of companies&nbsp;<strong>&laquo;Promotion&raquo;</strong>, that allows to provide a high quality level of service.</p>\r\n\r\n<p>The main task of the group of companies&nbsp;<strong>&laquo;Promotion&raquo;</strong>&nbsp;is to provide high-quality services based on a clear understanding of the Partners issues, intimate knowledge of the labor market, where the service is provided, systemic usage of modern personnel technologies and readiness to solve effectively issues all over the world.</p>\r\n',2,7),(99,'ТОВ Домени та хостинг','alexander@domen-hosting.net',5582,NULL,'2017-09-21 08:05:38','2017-09-21 08:05:38','10559841_795184187195043_4054049362597345808_n.jpg','DOMEN-HOSTING','https://domen-hosting.net/','+380672752780','<p>Веб-хостинг (размещение сайтов), VPS/VDS и выделенные серверы, а также регистрация доменов и SSL сертификатов в Украине с 2007 года.</p>\r\n',2,1),(101,'SoftServe','holeytoe@gmail.com',6150,NULL,'2017-09-22 20:12:48','2017-11-15 19:30:40','1510770639-mad-programer.png','SoftServe','http://softserve.ua/en/','+38(056) 565-57-58','<p>1. Тестова сторінка!!!!</p>\r\n\r\n<p>SoftServe&nbsp;&mdash; найбільша глобальна IT-компанія з&nbsp;українським корінням та&nbsp;найкращий роботодавець України 2010&nbsp;&mdash; 2015&nbsp;років.</p>\r\n\r\n<p>За&nbsp;час існування ми&nbsp;здобули визнання понад 350 компаній усього Світу, серед яких відомі бренди США, Канади та&nbsp;Західної Європи.</p>\r\n\r\n<p>SoftServe&nbsp;&mdash; компанія, в&nbsp;якій працює понад 4&nbsp;000 професіоналів у&nbsp;різних сферах ІТ. Наші розробницькі центри розташовані у&nbsp;Львові, Дніпрі, Рівному, Івано-Франківську, Чернівцях, Києві, Харкові, Софії (Болгарія) та&nbsp;Вроцлаві (Польща). Бізнес-представництва SoftServe діють у&nbsp;Лондоні (Великобританія), Гамбурзі (Німеччина), Амстердамі (Нідерланди), Стокгольм (Швеція), Лехі, Флориді, Каліфорнії, Юті (США).</p>\r\n',2,1),(102,'gfcndfg','angelaborets@gmail.com',6151,NULL,'2017-09-22 23:05:16','2017-09-22 23:05:16','NULL','xcbsf','','dfsfg','<p>fdsdf</p>\r\n',2,1),(103,'парпар','angelaborets@gmail.com',6151,NULL,'2017-09-23 06:32:47','2017-09-23 06:32:47','NULL','юлторь','','3hjоП!@#?}];’','<p>рлртл</p>\r\n',2,1),(104,'Hotels24.ua','info@hotels24.ua',5582,NULL,'2017-09-25 15:54:40','2017-09-25 15:54:40','11375_10153308718384128_5897335833790216546_n.png','Hotels24.ua','https://hotels24.ua/','+38(050) 359-97-62','<p><strong>Hotels24.ua</strong>&nbsp;&mdash; безкоштовний сервіс бронювання готелів по всій Україні. Наша команда &mdash; це понад 60 співробітників, яких об&#39;єднує одна мета: допомогти вам зупинитися в будь-якому куточку нашої країни. Шикарний готель або недорогий хостел? Місто-мільйонник або невелике селище? Відпочинок або відрядження? Ви отримаєте тільки найкращі пропозиції готелів без зайвої витрати часу та грошей.</p>\r\n',2,1),(105,'ПАТ \"ВІННИЦЯОБЛЕНЕРГО\"','kanc@voe.com.ua',5582,NULL,'2017-09-26 07:22:27','2017-09-26 07:22:27','13336065_1563752427253203_8501811005041559593_n.jpg','ВІННИЦЯОБЛЕНЕРГО','http://www.voe.com.ua/','+38(043) 265-95-95','<p>&nbsp;</p>\r\n\r\n<p>Основним видом діяльності ПАТ &quot;Вiнницяобленерго&quot; є постачання електроенергії за регульованим тарифом. Товариство &quot;Вiнницяобленерго&quot; також надає інші послуги населенню та юридичним особам:<br />\r\n&bull; Перевірка, встановлення, ремонт та заміна лічильників електроенергії.<br />\r\n&bull; Підключення будинків до електромережі.<br />\r\n&bull; Будівельно-монтажні та електромонтажні роботи (будівництво і реконструкція електроустановок, улаштування вводів в житлові будинки, монтаж виносних шаф обліку електричної енергії, виконання ремонту кабельних мереж та повітряних ліній тощо);<br />\r\n&bull; Видача технічних умов на приєднання електроустановок.<br />\r\n&bull; Проектно-вишукувальні роботи, погодження проектної документації.<br />\r\n&bull; Допуск до експлуатації електроустановок.<br />\r\n&bull; Оформлення та нагляд за роботами в охоронній зоні електромереж.<br />\r\n&bull; Технічне обслуговування абонентських електроустановок;<br />\r\n&bull; Лабораторні роботи (пошук і визначення місця пошкодження кабельних ліній, вимірювання опору контуру заземлення, заземлювача опори, вимірювання опору і ємності обмотки машин, апаратів, опо-ру ізоляції, випробування підвищеною напругою, вимірювання про-бивної напруги тощо).</p>\r\n',8,1),(107,'Scopic Software','jobs@scopicsoftware.com',5582,NULL,'2017-09-28 08:49:19','2017-09-28 08:49:19','17309099_714071082127654_6387421667771458768_n.png','Scopic ','https://scopicsoftware.com/','+38(097) 466-93-08','<p>Scopic Software is the largest virtual software services company in the world. We are based in the United States, with our operational management located onshore, and our engineering staff offshore. Without the bounds of location, we have been able to hand-select a diverse team with varied skillsets and areas of expertise from over 20 countries. We develop customized IT solutions for web, mobile,&nbsp;and desktop, with a focus on innovation. We believe in executing the 4 D&rsquo;s in every project: Define, Design, Develop and Deploy.<br />\r\n<br />\r\nAt Scopic, we create visually engaging and user-centric interactive solutions made especially for our clients and their business needs. We have developed over 300 web apps, 100 mobile apps, and 100 desktop apps, for a wide range of industries and niches including: finance, fitness, healthcare, manufacturing, and more. We value our client&rsquo;s needs and strive to create long lasting relationships.</p>\r\n',2,7),(108,'ZV Девелопмент','info@zv.ua',5582,NULL,'2017-10-02 07:16:49','2017-10-02 07:17:35','18765797_1858001921189390_7867869407339381039_n.jpg','ZV ','https://zv.ua/uk/','+38(044) 390-04-53','<p><strong>Компанія &laquo;ZV Development&raquo;</strong>&nbsp;на ринку України з 1989 року. Ми будуємо котеджі з 1993 року. В Україні ми були першими, хто став до цієї нелегкої, але неймовірно приємної праці. Зараз у нашому портфелі 3 котеджних містечка, які ми дуже любимо. Але ми йдемо далі і відкриваємо нові горизонти. Зараз для нас пріоритетним є використання новаторських енергоефективних технологій, які допоможуть нашим жителям йти в ступінь із часом і відчувати себе по-справжньому вдома.</p>\r\n\r\n<p><strong>Бачення.</strong>&nbsp;Ми вважаємо, що маємо створювати не просто &ldquo;житло&rdquo; для своїх покупців, ми зобов&rsquo;язані створювати &ldquo;дім&rdquo;, місце, яке відображає особистість свого власника. Ми щиро віримо в те, що середовище проживання визначає не лише якість життя, але й свідомість людини, її характер. Всі співробітники компанії &ldquo;ZV Development&rdquo; мріють формувати новий вектор у розвитку цілого покоління через створення нових комфортних умов проживання.</p>\r\n\r\n<p><strong>Місія.</strong>&nbsp;Постійно вчитись та розвиватись на кожному етапі свого існування. Разом зі своїми клієнтами та друзями відкривати нові горизонти домобудування та покращення якості життя. Для нас неймовірно важливо стрибати вище голови і радіти тому, що ми змогли змінити чиєсь життя на краще.</p>\r\n',9,7),(109,'Materialise','olesia.kozak@materialise.kiev.ua',5582,NULL,'2017-10-02 11:27:02','2017-10-04 14:37:36','12805672_1105990749451650_2010548694726082344_n.png','Materialise','http://www.materialise.com/en','+38(050) 774-26-39','<p>As of the start in 1990 our goal was to enable new uses for the extraordinary potential that 3D printing offers. Since then, Materialise has pursued its experience into a range of software solutions, engineering and 3D printing services, which together form the backbone of the industry.</p>\r\n\r\n<p>Materialise&rsquo;s open and flexible platforms enable players in industries such as healthcare, automotive, aerospace, art and design, and consumer goods, to build innovative 3D printing applications that make the world a better and healthier place.</p>\r\n\r\n<p>Headquartered in Belgium, with branches worldwide, the company has brought together the largest group of software developers in the industry and one of the largest 3D printing facilities in the world.</p>\r\n\r\n<p>Ultimately, we empower our customers to transition towards a digital manufacturing process and to launch innovations that have the potential to forever change the face of their industry.</p>\r\n\r\n<p>That&rsquo;s what keeps us pioneering, why it&rsquo;s so important to encourage, inspire and co-create a better and healthier world.</p>\r\n',2,7),(110,'Hotels24.ua','anna.zamyatina3@gmail.com',6177,NULL,'2017-10-02 20:06:13','2017-10-02 20:26:28','1506972305-Дизайн без названия.png','Hotels24','https://hotels24.ua/','+38(050) 359-97-62','<p><strong>Hotels24.ua&nbsp;&mdash; бесплатный сервис бронирования отелей по&nbsp;всей Украине.</strong></p>\r\n\r\n<p>Проект стартовал в&nbsp;марте 2009 года. На&nbsp;сегодняшний день мы&nbsp;принимаем участие в&nbsp;организации престижных ежегодных премий Hospitality Awards и&nbsp;Ukrainian Travel Awards. Hotels24 является членом Ассоциации гостиничных объединений и&nbsp;гостиниц городов Украины, Ассоциации малых отелей Украины, Ассоциации хостелов Украины, партнером Ассоциации Звёздочных отелей Украины.</p>\r\n\r\n<p>Наша команда&nbsp;&mdash; это более 80 сотрудников, которых объединяет одна цель: помочь клиентам остановиться в&nbsp;любом уголке нашей страны. Мы&nbsp;активно принимает участие в&nbsp;личностном и&nbsp;профессиональном развитии наших сотрудников.</p>\r\n\r\n<p>Hotels24&nbsp;&mdash; это национальный лидер по&nbsp;бронированию отелей по&nbsp;всей Украине. В&nbsp;день мы&nbsp;обслуживанием больше 500 клиентов, и&nbsp;у&nbsp;тебя есть возможность быть частью большой компании.</p>\r\n\r\n<p>&nbsp;</p>\r\n',15,1),(112,'AB Soft','jobs@ab-soft.net',5582,NULL,'2017-10-05 11:50:39','2017-10-05 11:50:39','17426012_779767095520464_1063843133698477921_n.jpg','AB Soft','http://ab-soft.net/','+38(048) 785-78-10','<p>We specialize in developing application for any area of today&#39;s modern world, either it would be business application, mobile application development, cloud computing or IP telephony. AB Soft is focused on delivering its product which would reflect highest possible standards, on today&#39;s market.</p>\r\n',2,13),(113,' Ester Digital PLC','hello@ester.co',5582,NULL,'2017-10-11 10:19:25','2017-10-11 10:19:25','18671046_1519051848113188_6981696909473050278_n.png','Ester ','https://ester.co/about','+38(011) 111-11-11','<p>Ester.co formed in&nbsp;2015 to&nbsp;deliver world-class apps, games and web experiences to&nbsp;clients who insist on&nbsp;the best. Our team of&nbsp;designers, artists, full-stack engineers, and DevOps are committed to&nbsp;establishing a&nbsp;deep understanding of&nbsp;all clients&#39; needs through a&nbsp;thorough analysis of&nbsp;all business requirements.</p>\r\n\r\n<p>We&nbsp;don&rsquo;t hang about either, we&rsquo;re focused on&nbsp;rapid iterations, we&nbsp;practice Continuous Intergration and feedback using the Agile Scrum process. Get in&nbsp;touch, we&rsquo;d love to&nbsp;hear from you.</p>\r\n',2,11),(114,'ТОВ \"БаДМ\"','aashevchenko@badm.biz',6256,NULL,'2017-10-20 13:09:46','2017-10-20 13:09:46','NULL','БаДМ','https://www.badm.ua/ua/','+38(066) 374-60-65','<p>Компания <strong>&laquo;БаДМ&raquo;</strong>&nbsp;&mdash; крупный поставщик на&nbsp;украинском фармрынке:</p>\r\n\r\n<ul>\r\n	<li>23 лет на&nbsp;фармрынке Украины</li>\r\n	<li>10 региональных структурных подразделений по&nbsp;территории Украины badm.biz</li>\r\n	<li>70+ ІТ-специалистов</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',1,1),(115,'Green Web, Digital Marketing Agency','info@greenweb.com.ua',5582,NULL,'2017-10-23 10:20:33','2017-10-23 10:20:33','13606725_850537745051335_5213590617435307845_n.png','Green Web','https://greenweb.com.ua/','+38(097) 662-67-66','<p>Создание сайтов. Продвижение. Контекстная реклама.&nbsp;</p>\r\n',2,7),(116,'Mohican Lab','mohicanlab@mohicanlab.com',5582,NULL,'2017-10-24 09:04:22','2017-10-24 09:04:22','13533207_1098906613523425_7915234227107897864_n.png','Mohican Lab','http://www.mohicanlab.com/','+38(000) 000-00-00','<p>A group of 20 enthusiastic, idea-driven professionals, striving to enrich the gaming world with new and engaging titles!<br />\r\nFounded in 2015, we have been developing free-to-play games rooted in the ideals of fun and the spirit of adventure.<br />\r\nBased in Tel-Aviv, our in-house development team consists of young inspired professionals with experience in game design and software development.<br />\r\n<br />\r\nDedicated to maintaining the balance between innovation and reliability, we are eagerly producing unique free-to-play experiences for you to share with your closest friends.</p>\r\n',2,7),(117,'Uniweb','hr@uniweb.ua',5582,NULL,'2017-10-26 10:42:08','2017-10-26 10:42:08','14907017_1285684988148867_8936725980351650820_n.png','Uniweb','http://www.uniweb.ua/','+38(044) 597-10-08','<p>Компания Юнивеб была создана в 2004 году для решения технических задач европейской SEO-студии.</p>\r\n\r\n<p>Начиная с 2008 года компания активно разрабатывает направление в сфере индивидуальных интернет-решений для среднего и крупного бизнеса и долгосрочной поддержке ресурсов электронной коммерции.</p>\r\n\r\n<p>В 2010 году компания Юнивеб практически полностью перешла на разработку собственных продуктов, отказавшись от аутсорс направления.</p>\r\n\r\n<p>В 2011 году открыто направление разработки мобильных приложений в виде самостоятельного подразделения компании.</p>\r\n\r\n<p>На сегодня компания активно развивается и ищет новых партнёров для сотрудничества.</p>\r\n',2,7),(118,'GlobalLogic Ukraine','join.lviv@globallogic.com',5582,NULL,'2017-10-28 07:27:43','2017-10-28 07:27:43','10154243_737878812930419_4009210217498576076_n.jpg','GlobalLogic','https://www.globallogic.com/ua/','+38(032) 244-57-34','<p>GlobalLogic is a leader in full-lifecycle product development services.<br />\r\nThere are 4 GlobalLogic offices in Ukraine: in Kyiv, Kharkiv, Lviv and Mykolaiv.</p>\r\n\r\n<p>GlobalLogic Ukraine is a talent team that collaborates with world technology leaders in creating innovative products and new quality standards of program engineering.<br />\r\n<br />\r\nGlobalLogic represents Ukraine as a country of professionals. We develop IT business and economy of Ukraine by providing jobs and growing up the best specialists in their sphere.</p>\r\n\r\n<p>&nbsp;</p>\r\n',2,11),(119,'TestCompany','natalisnejka@gmail.com',6269,NULL,'2017-10-28 15:07:12','2017-10-28 15:07:12','PROG.jpg','test','https://robotamolodi.org','+38(066) 123-45-78','<p>Корпорація &laquo;ІСД&raquo; є однією з найбільших транснаціональних металургійних компаній з головним офісом в Україні, м. Київ.&nbsp;</p>\r\n\r\n<p>Корпорація &laquo;ІСД&raquo; найвідоміша світу в якості провідного виробника сталі у регіоні Центральної та Східної Європи. Виробничі та прокатні потужності Корпорації є стратегічно розташованими у краінах СНД та Євросоюзу, а продукція &laquo;ІСД&raquo; знаходить свого покупця на всіх основних світових ринках збуту.&nbsp;</p>\r\n\r\n<p>За результатами 2008 року Корпорація &laquo;ІСД&raquo; війшла до числа 40-ти найбільших виробників сталі у світі з показником більш ніж 10 млн.т. сталі на рік*.</p>\r\n\r\n<p>Корпорація є лідером в області технічного переоснащення металургійних комбінатів. Кожен з металургійних активів &laquo;ІСД&raquo; впроваджує низку найамбітніших програм реконструкції та розширення виробничих потужностей у сучасній індустрії. Загальний об&rsquo;єм інвестицій з 2005 до 2011 року складає 2,7 млрд. доларів США. В 2007 році &laquo;ІСД&raquo; досяг піку семирічного інвестиційного плану на своїх заводах, після внесення в модернізацію більше 1 млрд. доларів США.&nbsp;</p>\r\n',2,1),(120,'Ciklum','bme@ciklum.com',5582,NULL,'2017-10-30 08:26:03','2017-10-30 08:26:03','15965212_537704506437272_6859522063103729320_n.jpg','Ciklum','https://www.ciklum.com/','+38(044) 545-77-45','<p>Ciklum is&nbsp;a&nbsp;top-five global Software Engineering and Solutions Company. Our 3,000+ IT&nbsp;professionals are located in&nbsp;the offices and delivery centres in&nbsp;Ukraine, Belarus, Poland and Spain. As&nbsp;Ciklum&rsquo;s employee, you&rsquo;ll have the unique possibility to&nbsp;communicate directly with the client when working in&nbsp;Extended Teams. Besides, Ciklum is&nbsp;the place to&nbsp;make your tech ideas tangible. The Vital Signs Monitor for the Children&rsquo;s Cardiac Center as&nbsp;well as&nbsp;Smart Defibrillator, the winner of&nbsp;the IoT World Hackathon in&nbsp;the USA, are among the cool things Ciklumers have developed. Ciklum is&nbsp;a&nbsp;technology partner for Google, Intel, Micron, and hundreds of&nbsp;world-known companies. We&nbsp;are looking forward to&nbsp;seeing you as&nbsp;a&nbsp;part of&nbsp;our team!</p>\r\n',2,7),(121,'Forte Group','contact@fortegrp.com',5582,NULL,'2017-10-31 10:42:41','2017-10-31 10:42:41','10320388_1056314471068469_2775889327194879349_n.png','Forte Group','https://fortegrp.com/','+38(068) 034-16-40','<p>Headquartered in&nbsp;Chicago, FORTE Group addresses&nbsp;IT talent needs; with a&nbsp;focus on&nbsp;mobile, web, Windows development and&nbsp;QA. We&nbsp;specialize in&nbsp;flexible engagement models: temp &amp; perm recruitment, on-site &amp; offshore teams, and in-house projects. We&nbsp;have access to&nbsp;exclusive&nbsp;IT talent through our global recruitment practices and sister training company- FORTE Knowledge. FORTE has recruited, trained, and placed over 3000 IT&nbsp;professionals since 2000. Currently, we&nbsp;employ over 250 consultants and 30 recruiters in&nbsp;our 3 offices.</p>\r\n',2,19),(122,'Levi Nine','HR-Kiev@levi9.com',5582,NULL,'2017-11-06 10:50:28','2017-11-06 10:50:28','levi.png','Levi9','https://ukraine.levi9.jobs/','+38(044) 594-88-38','<p>Established in&nbsp;1989, Levi9&nbsp;IT Services Ukraine is&nbsp;known as&nbsp;the oldest professional&nbsp;IT outsourcing company nevertheless ceasing to&nbsp;be&nbsp;at&nbsp;the cutting edge of&nbsp;technology development.</p>\r\n\r\n<p>We&nbsp;truly believe that working at&nbsp;Levi9&nbsp;is much more than a&nbsp;job&nbsp;&mdash; you will be&nbsp;a&nbsp;part of&nbsp;a&nbsp;dynamic, qualified and motivated European team with a&nbsp;unique corporate family spirit.</p>\r\n\r\n<p>Levi9&nbsp;is built on&nbsp;the belief that true innovation happens when you bring together the best minds and ideas for the perfect achievements. That&rsquo;s what we&nbsp;do.<br />\r\nWe&rsquo;re a&nbsp;fast-growing company made up&nbsp;of&nbsp;vibrant, intelligent, and passionate people, being the employer for specialists at&nbsp;all career levels: from career starters to&nbsp;experienced engineers.</p>\r\n\r\n<p>We&nbsp;are aware that Levi9 success is&nbsp;all about the people working here that&rsquo;s why we&nbsp;aim to&nbsp;attract and retain great talent by&nbsp;ensuring that all of&nbsp;our employees feel intellectually stimulated and supported by&nbsp;attentive talent management.</p>\r\n\r\n<p>Still, working at&nbsp;Levi9 Kyiv or&nbsp;Lviv means not only to&nbsp;be&nbsp;challenged, but also to&nbsp;have fun! Everyone here works incredibly hard and we&nbsp;make sure to&nbsp;balance this with joyful social activities inside and outside the office.</p>\r\n\r\n<p>Instagram:&nbsp;goo.gl/Z3bnqo<br />\r\nYouTube:&nbsp;goo.gl/lyScMU</p>\r\n',2,7),(123,'Leobit','info@leobit.co',5582,NULL,'2017-11-09 13:01:54','2017-11-09 13:01:54','13921014_563470037189653_1973856360927998463_n.png','Leobit','http://leobit.co/','+38(073) 536-24-80','<p>Leobit is a privately held company that provides premium software engineering services to technology companies from US, Canada &amp; Europe.&nbsp;<br />\r\nThe Headquarter of the company is Lviv, Ukraine &ndash; the 2nd IT city after capital Kiev with much more attractive environment.</p>\r\n\r\n<ul>\r\n	<li>We are young company with innovative approaches and flexible outsourcing models, processes and pricing</li>\r\n	<li>We have strong team of professionals that specialize in web &amp; enterprise applications, cloud technologies, mobile, architecture design and quality assurance</li>\r\n	<li>We build the right model, the right process with the best engineers</li>\r\n	<li>We will help your company to accelerate thought software</li>\r\n</ul>\r\n\r\n<p>WHY UKRAINE? WHY LVIV?</p>\r\n\r\n<ul>\r\n	<li>Eastern Europe is&nbsp;<a href=\"http://ceeoa.org/news/ceeoa-news/it-outsourcing-to-eastern-europe/\">#1</a>&nbsp;IT outsourcing destination</li>\r\n	<li>Ukraine has strong educational heritage</li>\r\n	<li>Lviv has 20 universities with more than 20&#39;000 students in total</li>\r\n	<li>English is the second language for most of the young people in Lviv</li>\r\n	<li>Lviv has IT Business Services Cluster</li>\r\n	<li>Lviv &ndash; is the 2nd IT city after capital Kiev saturated with strong engineers and powerful IT eco-system</li>\r\n	<li>Outsourcing industry in Lviv has more than 20 years</li>\r\n	<li>Ukraine time zone has good overlapping with US &amp; Europe</li>\r\n	<li>IT &ndash; strategic direction for Lviv supported by&nbsp;<a href=\"http://city-institute.org/en/index.php?option=com_content&amp;view=article&amp;id=140&amp;Itemid=107\">government</a></li>\r\n	<li>Lviv has great and pleasant environment to work &amp; live &ndash; international airport, city center is part of UNESCO heritage, 60 km from EU border</li>\r\n	<li><a href=\"http://investinlviv.com/why-lviv\">Investor&rsquo;s</a>&nbsp;feedbacks about Lviv\r\n	<ul>\r\n		<li>Closer mentality &amp; culture to Europe &amp; US</li>\r\n		<li>Direct and open in communication</li>\r\n		<li>Flexible to project constraints, technologies and resource allocation</li>\r\n		<li>Responsible to meet client deadlines and milestones</li>\r\n		<li>Keep commitments</li>\r\n		<li>Can say &#39;no&#39; when needed</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>WHY LEOBIT?</p>\r\n\r\n<ul>\r\n	<li>We build the right outsourcing model</li>\r\n	<li>We build the right process</li>\r\n	<li>We have the best people</li>\r\n	<li>We value every customer</li>\r\n	<li>Even small client is important for us</li>\r\n	<li>We build long-term partnership on transparency, trust &amp; professionalism</li>\r\n	<li>We rely on simplicity &amp; lean principles for outsourcing process</li>\r\n	<li>We have strong team of experts</li>\r\n	<li>We operate in highly talented resource ecosystem</li>\r\n	<li>We have more attractive work environment</li>\r\n	<li>We provide more flexible pricing</li>\r\n</ul>\r\n',2,11),(124,'dfkdshf','ira-skorpiosha@mail.ru',6139,NULL,'2017-11-11 14:40:35','2017-11-11 14:41:18','NULL','ytut','','+38(078) 679-69-69','<p>тест</p>\r\n',1,8),(125,'Luxoft','kiev@luxoft.com',5582,NULL,'2017-11-13 07:27:03','2017-11-13 07:27:03','11164755_608321482537646_2834758884015191857_n.png','Luxoft','https://career.luxoft.com/','+38(044) 238-81-08','<p>Luxoft is a leading provider of software development services and innovative IT solutions to a global client base consisting primarily of large multinational corporations.&nbsp;<br />\r\n<br />\r\nLuxoft&#39;s software development services consist of core and mission critical custom software development and support, product engineering and testing, and technology consulting. Luxoft&#39;s solutions are based on its proprietary products and platforms which aim to impact clients&#39; business outcomes and efficiently deliver continuous innovation.&nbsp;<br />\r\n<br />\r\nThe Company develops its solutions and delivers its services from 34 cities with dedicated delivery centers worldwide. It has over 12,700 employees across 39 cities in 19 countries in North America, Mexico, Western and Eastern Europe, Asia Pacific, and South Africa. Luxoft is incorporated in Tortola, British Virgin Islands, has its operating headquarters office in Zug, Switzerland and is listed on the New York Stock Exchange.&nbsp;<br />\r\n&nbsp;</p>\r\n',2,7),(126,' Fornova','monica@fornova.net',5582,NULL,'2017-11-15 10:31:40','2017-11-15 10:31:40','10258_1015555658483413_8200533791897151108_n.png',' Fornova','https://www.fornova.com/','+38(011) 111-11-11','<p>About</p>\r\n\r\n<p>Powerful market intelligence &amp; distribution for travel &amp; retail.</p>\r\n\r\n<p>Company Overview</p>\r\n\r\n<p>Fornova is a global provider of B2B data solutions that directly impact revenue creation in increasingly competitive markets. Hundreds of online travel and retail businesses around the world leverage Fornova solutions to maximize sales.</p>\r\n\r\n<p>Products</p>\r\n\r\n<p>Supernova market intelligence &amp; distribution for travel.<br />\r\nGoldenfeeds product feed generation and cross-channel distribution for retail.</p>\r\n',2,1),(127,' SCR.','Zborovska.olha@gmail.com',5582,NULL,'2017-11-16 10:09:28','2017-11-16 10:09:28','1011659_700847459932760_1841496673_n.png',' SCR.','http://www.scrdairy.com/','+38(067) 430-23-52','<p>SCR is the leading pioneer of Cow Farming and Milking Intelligence Solutions</p>\r\n\r\n<p>Building on over 35 years of meaningful innovation, SCR is the leading pioneer of Cow and Milking Intelligence.<br />\r\nMonitoring millions of cows worldwide, our data-driven solutions are trusted by successful dairy farmers to deliver the insights and analytics needed to optimize the productivity of every cow. Improving efficiency and driving growth, we help to ensure a secure and prosperous future for their farms and families.</p>\r\n\r\n<p>Cow Intelligence<br />\r\n<br />\r\nOur leading edge cow monitoring systems collect and analyze<br />\r\ncritical data points, from activity to rumination, on every individual<br />\r\ncow, delivering the heat, health and nutrition insights farmers need, when they need them.<br />\r\n<br />\r\nMilking Intelligence<br />\r\n<br />\r\nOur advanced milking solutions, led by best-in-class milk measurement technologies, simplify and streamline<br />\r\nthe milking process to save time, improve accuracy and drive overall efficiency.<br />\r\n<br />\r\nHerd Intelligence<br />\r\n<br />\r\nOur powerful and scalable management system provides<br />\r\nintegrated, actionable information, for efficient and profitable herd<br />\r\nmanagement. The system enables intelligent utilization of the data<br />\r\nprovided by SCR cow and milking intelligence solutions and is<br />\r\ncompatible with third-party solutions.</p>\r\n',2,1);
