INSERT INTO `news` VALUES (1,'Успіх ІТ-Академії','<p><strong>Практично 100% працевлаштованих за спеціальністю випускників — чому Вінницька ІТ-Академія має такий успіх? Чому наші випускники настільки добре відповідають вимогам провідних ІТ-компаній?</strong></p>\r\n\r\n<p><strong>Звісно, цей успіх має багато складових. Однією з них  є “основа основ”, загальна концепція Академії, підхід до навчання наших студентів. В чому вона полягає? Чим особлива навчальна програма Вінницької ІТ-Академії? Давайте розглянемо, які погляди формують нашу концепцію навчання програмуванню.</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong><strong>Спочатку навчити програмувати “в принципі”, </strong></strong></p>\r\n\r\n<p><strong><strong>а тільки потім — сучасних технологій розробки</strong></strong></p>\r\n\r\n<p><strong>Зараз не злічити курсів, які вивчають якусь одну мову програмування “з нуля”. Роки досвіду у навчанні програмістів дозволяють нам впевнено заявляти: такий підхід не є ефективним. Далеко не всі мови програмування підходять на роль першої мови. Деякі мови програмування, як, приміром, Python, мають чудовий інструментарій для вирішення завдань, але зовсім не підходять для навчання програмуванню, оскільки вони використовують досить високі рівні абстракції. Це ніби навчати множенню людину, яка не знає додавання. Можна навчити правильно множити, але людина не буде розуміти суті того, що робить. Тому для найкращих результатів потрібно починати вивчати програмування із низькорівневих мов. В ІТ-Академії навчання починається із вивчення мови C (читається: Сі). Ця мова не тільки тримається на високих позиціях у рейтингах мов програмування, але й чудово підходить в якості першої мови програмування. В процесі вивчення С студенти розбирають основні алгоритми і отримують неоціненну базу знань, яка в подальшому допомагає засвоїти практично будь-яку мову програмування.</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong><strong>Спробувати багато — зупинитись на одному</strong></strong></p>\r\n\r\n<p><strong>Більшості курсів з програмування притаманна одна спільна риса: перед початком навчання людина має чітко визначитися, яку мову програмування вона хоче вивчати. І вже в процесі часто виявляється, що вибрана мова/технологія не настільки подобається (або не дуже добре дається) студентові. Що робити далі — міняти мову вивчення, знову робити крок у невідоме? </strong></p>\r\n\r\n<p><strong>Ми вважаємо, що для того, щоб максимально об’єктивно вирішити, яку мову вивчати, потрібно спробувати попрацювати з декількома найпопулярнішими мовами програмування. Саме тому після вивчення С наші викладачі паралельно знайомлять студентів із Java, C#, JavaScript та PHP, а також навчають основам роботи з HTML5 і CSS3. Тільки після ознайомлення з цими мовами студенти роблять вибір на користь однієї з них, вдосконалюючи надалі свої знання та вміння у вибраній області. </strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong><strong>Гнучка програма викладання. Навчаємо тільки найактуальнішого</strong></strong></p>\r\n\r\n<p><strong>Змінити програму викладання у вищому навчальному закладі — це ціла пригода і тривалий процес (дуже м’яко кажучи). Але в ІТ-сфері все змінюється настільки швидко, що чекати на затвердження та впровадження нової програми просто немає часу! В ІТ-Академії програма вивчення може змінюватися в ході навчання, як тільки викладачі побачать в цьому потребу. Це дає можливість не зациклюватися на тому, що вже не є актуальним, і спрямувати всі зусилля на отримання найбільш затребуваних на ринку вмінь та навичок.</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong><strong>Реальні проекти або що написати в резюме? </strong></strong></p>\r\n\r\n<p><strong>Що викликає найбільше невпевненості у новачків-програмістів перед першою співбесідою? Як правило, це відсутність досвіду програмування в реальних умовах. Додати впевненості випускникові курсів може тільки одне — участь у справжніх, реальних проектах з реальними задачами. Саме такі проекти ми пропонуємо нашим студентам в якості курсових та дипломних робіт. В результаті випускники після закінчення Академії мають “портфоліо” — участь у 2-3 робочих проектах, що є дуже вагомим плюсом при проходженні перших співбесід в ІТ-компаніях.</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong><strong>Індивідуальний підхід до студента, review успіхів, цілей та досягнень</strong></strong></p>\r\n\r\n<p><strong>Незважаючи на те, що навчання в ІТ-Академії проводиться в групах, індивідуальний підхід до кожного — це наш принцип. Студенти під час навчання проходять декілька тестувань та іспитів. Але тестування призначене не для того, щоб поставити оцінку, а щоб порівняти досягнення окремого студента з його попередніми результатами. Таким чином, студенти порівнюються не між собою, а із самими собою. Це дозволяє оцінити свій прогрес, побачити власні прогалини в знаннях та скоректувати їх при потребі, а також позитивно впливає на мотивацію до навчання.</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong><strong>Англійська мова — must have!</strong></strong></p>\r\n\r\n<p><strong>Чи правда, що всі програмісти чудово володіють англійською? Хотілося б, щоб це було так )) Але насправді в компаніях працюють розробники і з досить низьким рівнем знань англійської. Статистика показує, що таких програмістів менш охоче беруть на роботу, і зарплатня в них відчутно нижча, ніж в спеціаліста з аналогічним рівнем вмінь та навичок, але кращою англійською. Тому ми намагаємось зробити наших випускників максимально конкурентноздатними і приділяємо багато часу для вивчення англійської мови. Більше того, всі заняття з англійської мають ІТ-тематику. На уроках розглядаються реальні ситуації, які є частиною роботи в компанії, такі як: спілкування з клієнтом, опис проекту, робота в команді, презентація компанії чи стартапу тощо. Це не тільки сприяє вивченню мови, а й надає реальне розуміння того, що відбувається в професійній сфері. В кінці і також після навчання студенти відвідують розмовний клуб при Академії і значно покращують свої вміння вільно висловлювати думки англійською. </strong></p>\r\n\r\n<p><strong>-----------</strong></p>\r\n\r\n<p><strong>Для того, щоб втілити в життя будь-яку, навіть найгеніальнішу, ідею, потрібні люди, які вірять в неї і працюють на її реалізацію. Саме тому ми так високо цінуємо наших викладачів. Це програмісти — хороші практики, які люблять свою справу і намагаються передати студентам не тільки знання та навички, але й пристрасть до вирішення програмістських задач. Саме їхніми зусиллями наша концепція реально працює, а не залишається формальністю.</strong></p>\r\n\r\n<p><strong>Але основний фактор успіху — мотивація наших студентів, які, незважаючи на безліч труднощів та перепон, не покидають вчитись та самовдосконалюватися. ІТ-Академія - це середовище, яке спонукає студентів не зупиняються на досягнутому, не здаватися на півшляху до мети. Якщо Ви відчуваєте в собі наполегливість, бажання рухатися до своїх життєвих цілей і постійно самовдосконалюватись і маєте великий інтерес до сучасних технологій — приходьте до Вінницької ІТ-Академії! Програмуйте своє майбутнє!</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong><strong>Вінницька ІТ-Академія</strong></strong></p>\r\n\r\n<p><strong><a href=\"http://www.ita.in.ua\"><strong>ita.in.ua</strong></a></strong></p>\r\n\r\n<p><strong><strong>тел. 067 431 19 21</strong></strong></p>\r\n','1496835707_18738385_1900006390239168_2090551672524741742_o.jpg','2017-03-27 19:44:18','2017-06-07 12:41:47',1),(4,'Опануй мистецтво веб-дизайну з  ІТ-Академією!','<p><strong>Якщо ви тут, напевно, ви хочете освоїти веб-дизайн та стати крутим спеціалістом? В одній з попередніх статей студенти ІТ-Академії розповіли про свої враження та досягнення — очевидно, що вони в захваті від навчання та створення проектів! Викладачі створили всі умови, довго працювали над навчальною програмою та по максимуму передають свій досвід нашим студентам по сьогодні!</strong></p>\r\n\r\n<p><strong>То які ж основні принципи навчання веб-дизайну? Можливо, це певний секрет успіху? Давайте поговоримо про концепцію та підхід до навчання з викладачем веб-дизайну ІТ-Академії Володимиром Чубатюком.</strong></p>\r\n\r\n<p><br />\r\n<strong><img alt=\"DSC03720.JPG\" src=\"https://lh4.googleusercontent.com/LkkxKiCYS2bqIr0DybIasRO1mjpYzjesZKx4P0b4yO-zKOxz4j-N-4xzGi9OifMbmYFn5cruywt4ApKyNpRxTLuRi7aPFfydej0g_UmSKYPxWQ49cVugB4wgMOW5WvXg_3FKRuce\" style=\"height:222px; width:384px\" /></strong></p>\r\n\r\n<p><strong>“<em>Я не тільки веб-дизайнер, а й веб-майстер. Є сайти які я “підняв” з нуля. Тобто знаю </em><em>ВЕСЬ </em><em>процес виготовлення сайту: від купівлі домену та налаштування самотужки хостингу, до написання СЕО статей, просування його в пошуковиках, налаштування Google AdWords  і до комунікації з реальними відвідувачами. В своїй викладацькій роботі роблю наголос на практичні знання, які будуть використані в самій роботі. Тобто студентам даються тільки ті знання, які їм потрібні для роботи. Нічого зайвого. </em></strong></p>\r\n\r\n<p><strong><em>Зате далі, під час курсових робіт, ми вчимося аналізувати чужі і свої роботи, знаходити в них плюси і мінуси. І, що я вважаю за головне, на кожному занятті я ділюсь своїми знаннями, які отримав з практичного досвіду роботи як в великих командах, так і будучи фрілансером. Ті знання, звичайно, можна погуглити і десь знайти, але, для того щоб гуглити, треба знати що саме шукати. Я віддаю ці крупинки на кожному занятті, і коли їх зрозуміють студенти — я буду впевнений що кожен наш випускник буде на висоті. </em></strong></p>\r\n\r\n<p><strong><em>Я і сам постійно навчаюсь, адже в нашій галузі все змінюється досить швидко і не можна дозволити собі пасти задніх”</em></strong></p>\r\n\r\n<p><strong>Отже практика, самокритика та аналіз своїх робіт — це 3 основних принципи, яким надає перевагу наш провідний викладач веб-дизайну.</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>В’ячеслав Кувшинов - молодий, енергійний та креативний веб-дизайнер ІТ-Академії:</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong><em>“</em><em>Думаю, в преподавании веб-дизайна самое важное — объяснить студентам, для чего веб-дизайн существует. Необходимо донести мысль, что все сайты делаются для обычных пользователей. И что сайт должен доносить до пользователя информацию максимально удобным для него образом. А также побудить пользователя совершить действие (купить товар, оставить e-mail, подписаться и т. д.)</em></strong></p>\r\n\r\n<p><strong><em>Еще важно привить чувство вкуса и дать необходимые теоретические и практические навыки.</em></strong></p>\r\n\r\n<p><strong><img alt=\"lYsggBlVUac.jpg\" src=\"https://lh5.googleusercontent.com/OU4Sl6tAm7lROPOtDUiIiHGPBYtz7Vnk82sPZ5j0pWFCRSZVeCqaCiYQ8D54F31b5bQPgxBtFVUvsmdBvo3IhhBJ3L45FgldM0xOPJ9zCOZsjGytSNS6PSPDEbQqFHDGbzQYZVVq\" style=\"height:304px; width:233px\" /></strong></p>\r\n\r\n<p><strong><em>Считаю, что лучшим вариантом для улучшения вкуса является просмотр других профессиональных дизайнов и критическое сравнение их со своими.</em></strong></p>\r\n\r\n<p><strong><em>При изучении фотошопа, основного инструмента для создания дизайна сайтов, нужно показывать приемы, необходимые для прорисовки элементов сайта. Рисовать вместе со студентами части сайтов, например карточку товара, для получения ими опыта.</em></strong></p>\r\n\r\n<p><strong><em>Во время практических занятий показывать теорию на примере.</em></strong></p>\r\n\r\n<p><strong><em>Важно научить студентов работать со шрифтами, совмещать их и подбирать шрифты под разные проекты.</em></strong></p>\r\n\r\n<p><strong><em>Нужно научить создавать удобные для пользователей сайты, запоминающиеся логотипы, крутой фирменный стиль и т. д.”</em></strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Чудово, що В’ячеслав навчає наших студентів зручному та одночасно стильному та оригінальному дизайну, який буде відповідати всім сучасним вимогам!</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Важлива частина навчання веб-дизайну - це розуміння основ верстки сайтів (HTML + CSS). Для чого дизайнеру розумітись в веб-програмуванні? Тому що дизайнер має знати не тільки те, чого хоче користувач,  а й на що спроможний програміст, який далі буде працювати над дизайном, тобто робити його “робочим”.</strong></p>\r\n\r\n<p><strong>Про викладання цих технологій нам розкаже нижче викладач Євгеній Долгій:</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong><em>“​Я вважаю, що найважливіше в вивченні веб- програмування (html, css,​ javascript) є знання інструментів і засобів реалізації поставлених перед студентом задач, вміння підібрати оптимальний набір команд для кожного конкретного випадку та ніколи не зупинятись на досягнутому!</em></strong></p>\r\n\r\n<p><strong><img alt=\"IMG_4456.JPG\" src=\"https://lh4.googleusercontent.com/nA4wh8ww4vCJM6Mk8e8Ypf12MYBmgQAXVtueRWz9cZPHZmICtsqyblBh-dSJLOMedlAD5eCG14xc2U7fgijAa2_p4I0OIRmyriBALBB_a8jOLhCnLQrn2hXmYZrMLcPmDpQA7GL7\" style=\"height:189px; width:253px\" /></strong></p>\r\n\r\n<p><strong><em>На заняттях намагаюсь на реальних прикладах реалізації певної задачі продемонструвати переваги та недоліки тих чи інших варіантів її вирішення.</em></strong></p>\r\n\r\n<p><strong><em>В будь-якому випадку студенти IT-Академії навчаються в нас з метою подальшого працевлаштування у динамічній та доволі широкій сфері IT-технологій, тому найважливіше - навчити студента практично застосовувати здобуті навички та знання.”</em></strong></p>\r\n\r\n<p><strong>   Отже, постійне практичне використання засобів та інструментів - запорука успіху! </strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Англійська мова —  важливий аспект при працевлаштуванні в ІТ-компанію. Це необхідно при роботі з технологіями, для веб-дизайнерів тим паче. </strong></p>\r\n\r\n<p><strong>Про це нам розкаже одна з викладачок англійської мови Віталія Арсенюк:</strong></p>\r\n\r\n<p><br />\r\n<strong><img alt=\"DSC04393.jpg\" src=\"https://lh6.googleusercontent.com/rsFti6z1qTZWlZsULoJ-X_sALi4MpEn7D9EBQUm56WFMxhEbS1GJfxBqQR_IvD-CIbeAdsWWH2fKgYApRp4shnbLL1vYYqwK8WWUcRZaPFPgydACj5YJCgxtil7eXjR5mrAzoztR\" style=\"height:360px; width:601px\" /></strong></p>\r\n\r\n<p><strong><em>“В наш час професія веб-дизайнера користується величезним попитом та загальним визнанням. Останнім часом ІТ-індустрія дуже швидко розвивається, щодня з’являються нові технології та нове програмне забезпечення і, звичайно, є потреба у швидкому опрацюванні великої кількості матеріалу. І тут без знання англійської не обійтись, оскільки  вся  нова інформація, документація, книги, усе актуальне та найсвіжіше, зазвичай, англійською мовою. Цілком зрозуміло, що цінність (і в грошовому вимірі теж) працівника, який володіє англійською, зростає у рази.</em></strong></p>\r\n\r\n<p><strong><em>Наші студенти – майбутні веб-дизайнери —  це усвідомлюють та з задоволенням відвідують заняття з англійської мови, де вони мають змогу вивчати і граматику, і професійну лексику, і розвивати навички спілкування та аудіювання.</em></strong></p>\r\n\r\n<p><strong><em>Курс «Англійська для веб-дизайнерів» розрахований на 9 місяців і складається з двох  частин: General English (Загальний курс англійської) та English for web designers (Англійська для веб-дизайнерів - цей модуль іде синхронно із темами, які вивчаються на заняттях з веб-дизайну, що робить курс цікавішим і динамічнішим). Заняття проходять 2 рази на тиждень. За допомогою цікавих ігор, карток, презентацій, захоплюючих рольових ситуацій та дебатів студенти вчаться комунікувати із замовником, використовувати професійну термінологію, вирішувати конфліктні ситуації та просто спілкуватись англійською. Це дасть їм у майбутньому впевненість у своїх силах та можливість тримати руку на пульсі актуальних змін у веб-дизайні.  </em></strong></p>\r\n\r\n<p><strong><em>Курс також передбачає щомісячні тести для перевірки засвоєного матеріалу та регулярне виконання домашніх завдань. У поєднанні, все це сприяє успішному завершенню навчання і  відкриває перед нашими студентами нові можливості кар’єрного зросту. Отож, приєднуйтесь до нас і вивчайте англійську та веб-дизайн з нами! Бо ця професія цікава, сучасна і перспективна!”</em></strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Якщо ви творча, цілеспрямована людина, яка має мрію - не вагайтесь і перед вами відкриється горизонт можливостей та нове життя з новою професією! </strong></p>\r\n\r\n<p><strong>Запрошуємо на навчання!</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Вінницька ІТ-Академія</strong></p>\r\n\r\n<p><strong>тел. 067-431-19-2</strong></p>\r\n\r\n<p><a href=\"http://ita.in.ua\">http://ita.in.ua</a></p>\r\n','1496835784_111.jpg','2017-05-03 14:57:43','2017-06-07 12:43:04',1),(5,'Створювати комп’ютерні ігри цікавіше, ніж грати в них!','<p><strong><em>Ви думаєте, що ваша дитина “надмірно” цікавиться ком’ютером та ІТ-технологіями? Іноді Ви чуєте від неї незнайомі Вам терміни (про себе думаєте: «це щось хакерське») =). Тоді варто, аби Ваша дитина витрачала свій вільний час не просто на ігри та соціальні мережі, а на їх створення. Вже сьогодні Ви можете дати своїй дитині можливість успішно побудувати майбутнє і отримувати задоволення від роботи. Це все реально! </em></strong></p>\r\n\r\n<p><strong>Можливо, Вам здається, що для учня початкової школи ще зарано навчатись програмуванню. Та це не так! В Школі Хакерів Вінницької ІТ-Академії навчаються школярі, починаючи з 3-го класу. І, повірте, вони схоплюють весь матеріал на льоту.</strong></p>\r\n\r\n<p><strong>Навчання в Школі Хакерів можливе протягом усього часу навчання в школі. Адже технологічний процес йде семимильними кроками і нові програмні продукти та технології створюються надзвичайно швидко. Тому в Академії учні розвивають свої здібності «в ногу з часом». Крім того, до закінчення школи вони вже мають базові навички створення комп’ютерних програм, веб-сайтів, ігор, мобільних додатків та інших проектів. А це дає можливість швидко збудувати кар’єру в ІТ-сфері та досягти фінансової незалежності.</strong></p>\r\n\r\n<p><strong>Групи Школи Хакерів формуються за віком. В молодших групах (9-12 років) проводяться заняття з Інтернет програмування, логіки та алгоритмізації і англійської мови для ІТ. Три пари (4,5 год) проводяться 2-3 рази на тиждень, в зручний час для учнів. Надалі, по мірі навчання, додається ще одна пара — предмету «Алгоритмізація та програмування на мовах С/С++», який вивчається в старших групах (13-16 років).</strong></p>\r\n\r\n<p><strong>Кожне заняття складається виключно під знання учнів. Теми містять в собі мінімальне і просте пояснення теорії, але максимально цікаві завдання прикладного характеру. Ми не повторюємо шкільну програму, а створили і розвиваємо свою, яка, на нашу думку, дозволяє не тільки навчитись технологій, а й розвиватись різносторонньо. Завдання наших викладачів знайти підхід до кожної дитини та розвивати її інтелектуальний та творчий потенціал.  </strong></p>\r\n\r\n<p><strong>На заняттях ми використовуємо різні мотиваційні засоби, за допомогою яких дитина власними зусиллями виконує завдання. Також ефективне навчання неможливе без самостійної роботи над собою, тому ІТ-Академія передбачає домашні роботи.  Та домашні завдання не є громіздкими та незрозумілими. Викладач підбирає цікаві види робіт, які сприятимуть легкому засвоєнню матеріалу, а також дають можливість зрозуміти, що учень засвоїв, а на що потрібно звернути більше уваги. Якщо дитина пропустила урок, ми проводимо додаткові заняття, щоб допомогти з освоєнням пропущеної теми.</strong></p>\r\n\r\n<p><strong>На заняттях з Логіки та алгоритмізації основним завданням викладача є навчити учнів логічно мислити, щоб надалі легше і краще програмувати. Розвивати в учнів абстрактне мислення, навчити розбирати поставлену задачу на простіші частинки і знаходити нові підходи до їх розв\'язання. В програмуванні це важливо вміти робити. Крім того на кожному занятті учні переглядають цікаві відео, розв’язують задачі сучасного змісту і прикладного характеру, вчаться знаходити нестандартні рішення та креативно мислити.</strong></p>\r\n\r\n<p><strong>На заняттях з Інтернет-програмування хакери вивчають технології, які їм знадобляться для веб розробки. HTML — для того, щоб вони могли швидко реалізувати сторінку в інтернеті за раніше описаним макетом. CSS — для того, щоб втілити ідеї дизайнерів на сайті. А робота з GIT допоможе вести проект, контролювати все, що було реалізовано, і сприяє злагодженій роботі команди.</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Заняття з англійської мови дуже важливі для  формування майбутнього програміста з багатьох причин. По-перше, чим раніше учень почне відчувати англомовне середовище, яке є у всіх айтішних компаніях, тим краще. Знаючи це, ми привчаємо наших хакерів до комунікації англійською мовою, тобто назви робочих файлів зроблені англійською (наприклад не журнал, а “register“ , не розклад, а “schedule”), завдання, теми листів, привітання — все  англійською. По-друге, наші учні займаються як і по відомих підручниках, так і майже з самого початку вони вивчають лексику, пов’язану з кодом мов, які викладають наші викладачі програмування. Старші хакери займаються повністю по наших власних розробках (вся тематика IT). По-третє, ми заради економії часу та коштів  батьків, що витрачаються на  різні курси, гармонійно організувавши все “під одним дахом”: цікаві заняття з логіки, корисні курси програмування та захоплюючі уроки  англійської мови, як спеціалізованої, так і загального вжитку! </strong></p>\r\n\r\n<p><strong>Кожнен курс занять поділений на модулі, окремі теми, щоб виділити всі отримані знання з курсу і закріпити їх на реальних проектах.  По закінченню курсу дитина отримує сертифікат про пройдений курс та має можливість перейти на наступний курс та продовжити навчання.</strong></p>\r\n\r\n<p><strong>В сучасному суспільстві люди використовують інформаційні технології увесь свій час. Ми зможемо дати Вашим дітям знання, які вони хочуть і планують опанувати, щоб кожна дитина програмувала своє майбутнє, а ІТ-Академія їм в цьому допоможе.</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Вінницька ІТ-Академія</strong></p>\r\n\r\n<p><strong>тел. 067-431-19-21</strong></p>\r\n\r\n<p><a href=\"http://ita.in.ua\">http://ita.in.ua</a></p>\r\n','1496835931_Вінниця Новий А4 Плакати А3, А4, і єврофлаєра.jpg','2017-05-03 14:59:20','2017-06-07 12:45:31',1),(6,'Твій День кар’єри - PROF IT Day','<p><strong>Чи є сенс сидіти на місті і не рухатись далі, коли все навколо так швидко розвивається?</strong></p>\r\n\r\n<p><strong>Звісно ж ні. Піднімайся, і йди швидше на День кар’єри <strong>PROF IT Day! </strong>Адже це саме твій день!</strong></p>\r\n\r\n<p><strong>Чому?</strong></p>\r\n\r\n<p><strong>Тому що ти:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>працюєш (адміністратором, програмістом з невисокою зарплатою), навчаєшся в училищі, інституті, коледжі, школі; </strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>цікавишся новинками програмуванням та сучасною ІТ-сферою і думаєш, як стати висококласним “айтішніком”, працювати в передовій компанії, отримувати гідну зарплату та соціальний пакет, але при цьому займатись улюбленою справою;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>розумієш, що обраний напрямок навчання - це не те, і він тобі не подобається;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>тобі цікаве програмування і все, що пов’язане з IT;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>проходиш 1-ий, 2-ий, 3-ій курси, і відчуваєш, що не зможеш отримати практичних знань з програмування. А скоро шукати роботу, проходити співбесіди і хочеться працювати за спеціальністю - програмістом, а не складати комп’ютери чи налаштовувати системи і оргтехніку;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>прагнеш мати знання, щоб легко пройти співбесіду;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>хочеш за період навчання в школі зробити вірний вибір в житті, не помилитись з вибором професії та навчального закладу, де можна її здобути;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>хочеш більше дізнатись про ІT-сферу, та які перспективи чекають на тебе, якщо твій вибір буде на користь IТ;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>хочеш змінити своє життя!</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Отже <strong>PROF IT Day</strong> саме для тебе. Під час <strong>PROF IT Day</strong> представники передових компаній влаштовують презентації пропонують вакансії, проводять семінари, тренінги, майстер-класи, та приймають резюме від кандидатів.</strong></p>\r\n\r\n<p><strong>Освітні заклади знайомлять з умовами вступу та навчання, перспективами напрямків, за якими вони готують фахівців, а також здійснюватимуть попередній відбір анкет потенційних студентів.</strong></p>\r\n\r\n<p><strong>Тому важливо не пропустити такий шанс! Адже це спілкування з успішними “айтішниками” і твоя можливість мати чудову ІТ-перспективу.</strong></p>\r\n\r\n<p><strong>Ми всі ідем на <strong>PROF IT Day</strong>, а ти?</strong></p>\r\n\r\n<p><a href=\"https://profitday.info/upcomingevents\">https://profitday.info/upcomingevents</a></p>\r\n','1496836020_18700532_1899992890240518_5867732294932022643_o.jpg','2017-05-04 13:01:54','2017-06-07 12:47:00',1),(7,'Результати відбору на грантовий конкурс від Вінницької ІТ-Академії та Фонду RIA','<p><img alt=\"\" src=\"https://fond-ria.org/wp-content/uploads/2017/01/IT-Academy-RIA.jpg\" style=\"height:263px; width:672px\" /></p>\r\n\r\n<p>Завершено відбір учасників на отримання гранту на навчання у Вінницькій ІТ-Академії! Вітаємо студентів та дякуємо усім аплікантам за участь!</p>\r\n\r\n<p>Нагадаємо: <a href=\"https://fond-ria.org/grantovyj-konkurs-na-navchannya-u-vinnytskij-it-akademiyi-vid-fondu-ria/\">Грантовий конкурс</a> на отримання стипендії розпочався ще у лютотому 2017 року. Після виконання вимог програми до <a href=\"https://fond-ria.org/rezultaty-konkursnogo-vidboru-na-navchannya-u-vinnytskij-akademiyi/\">другого туру</a> відбору перейшло 20 учасників.</p>\r\n\r\n<p>З усіма аплікантами було проведено особисті співбесіди, після чого грантова комісія прийняла рішення щодо надання грантової підтримки наступним студентам у таких розмірах:</p>\r\n\r\n<ol>\r\n	<li>Олександр Петренко – Вінниця, web-design, 3000 грн.</li>\r\n	<li>Андрій Кіяніцин – Вінниця, QA, 3000 грн.</li>\r\n	<li>Олександр Цимбал – Вінниця, програмування, 5000 грн.</li>\r\n	<li>Вадим Винниченко – Суми, 100% відшкодування вартості дистанційного навчання</li>\r\n	<li>В`ячеслав Ольшевський – Турбів, програмування, 15000 грн.</li>\r\n	<li>Тарас Кобилянський – Вінниця, програмування, 5000 грн.</li>\r\n	<li>Сергій Семесенко – Вінниця, програмування, 2000 грн.</li>\r\n	<li>Вадим Мельник – Вінниця, програмування, 5000 грн.</li>\r\n	<li>Тетяна Ковблюк – Вінниця, програмування, 7500 грн.</li>\r\n	<li>Ірина Ластовецька – Вінниця, web-design, 6000 грн.</li>\r\n	<li>Алла Бевз – Вінниця, програмування, 2000 грн.</li>\r\n</ol>\r\n\r\n<p>Навчальний рік розпочинається 8.05.2017 року. Отримувачам гранту необхідно звернутися до ІТ-Академії для оформлення договорів на навчання. Контактна інформація за посиланням: <a href=\"http://ita.in.ua/contact.html\">ita.in.ua</a>.</p>\r\n\r\n<p>Урочисте вручення Сертифікатів на отримання гранту на навчання відбудеться на Prof IT Day 20 травня о 12:00 за адресою: м.Вінниця, вул. Київська, 50/1, готель ”Оптіма”.</p>\r\n\r\n<p>Сертифікати мають бути використані до 31.05.2017 року без права передачі іншим особам.</p>\r\n\r\n<p>Вітаємо нових студентів ІТ-Академії!</p>\r\n','1496836288_18623311_1898228757083598_3940612862732505370_o.jpg','2017-05-06 15:07:57','2017-06-07 12:51:28',1),(10,'День Кар’єри у Вінниці — цікаво та змістовно!','<p>20 травня у Вінниці відбувся черговий День Кар’єри — Prof IT Day. У перекладі з англійської “profit” означає “користь, вигода, прибуток”. Яку ж користь отримали відвідувачі заходу? День Кар’єри у Вінниці — цікаво та насичено! (Новини компаній) Автор: 20 хвилин (Вінниця) access_time 5 годин тому По-перше — це можливість віч-на-віч поспілкуватися з роботодавцями, детальніше дізнатися про умови роботи в компаніях Вінниці, залишити своє резюме і навіть пройти попередню співбесіду чи влаштуватися на роботу. Саме нові можливості в працевлаштуванні — головна мета проведення Prof IT Day. Цього року участь в Дні Кар’єри брало понад 25 компаній та організацій нашого міста (Ciklum, memCrab, asta.mobi, IT Sanes, CIP, Центр зайнятості та ін.). Окрім того, декілька навчальних закладів Вінниці представили власні програми і розповіли, чому і як вони можуть навчити своїх студентів. Таким чином, кожен гість отримав реальну можливість зробити декілька кроків у напрямку своєї мрії — цікавої та престижної роботи. По-друге, паралельно із презентаціями компаній та навчальних закладів відбулася програма семінарів, майстер-класів, лекцій від провідних фахівців сфери ІТ і не тільки. Спікери — успішні HR-и, програмісти, дизайнери — розповідали про те, як знайти роботу, як не втратити її, ділилися власним досвідом навчання та працевлаштування. Працюючі програмісти мали можливість підвищити свій рівень, відвідавши двогодинні майстер-класи від спеціалістів з багаторічним досвідом програмування. Також було проведено декілька лекцій на тему важливості англійської мови для працевлаштування та роботи, під час яких гості не тільки мали змогу дізнатися про те, як ефективніше і швидше вивчити English, але й попрактикувалися у своїх вміннях та навичках. І, по-третє, подібні заходи — це чудова можливість познайомитися з новими людьми, зав’язати корисні контакти, розширити свою власну “соцмережу”. Хтозна — а якщо для когось зустріч на Prof IT Day виявиться доленосною? Якщо ви були на Prof IT Day у Вінниці — шукайте себе на фото у Facebook: https://www.facebook.com/profitday.info/<br />\r\n\r\n','1496836468_18559008_1898229713750169_8159248265768663222_o.jpg','2017-05-24 14:03:05','2017-06-07 12:54:28',1),(11,'Літній IT-табір від Школи Хaкерів','<p>Сонце, літо, уроків немає…. А ви не знаєте, де подіти енергію вашої дитини влітку? Годі дарма витрачати час! Записуйтесь у літній IT-табір від Школи Хaкерів. Тут школярі мають змогу зарядитись терабайтами цікавої інформації, розвивати свої здібності та ідеї, створити свій перший сайт :-) Літній IT-табір від Школи Хaкерів Автор: 20 хвилин (Вінниця) access_time 29 травня 2017 р. Освітній ІT-табір від Школи Хакерів допоможе направити енергію вашої дитини в необхідний напрямок. Це табір нової ери, де професійні викладачі-практики будуть розвивати здібності, ідеї, потенціал та харизму вашої дитини. Вже після проходження 4-тижневого інтенсивного курсу ваша дитина зможе створити свій власний сайт, дізнається про особливості сучасного дизайну, покращить знання з англійської мови, розвине логічне мислення. Табір організовується для дітей шкільного віку, починаючи з 10 років. Заняття проходитимуть в комфортних, спеціально обладнаних аудиторіях і на природі в компанії креативних викладачів школи Хакерів. Навчання в таборі триватиме 4 тижні, 5 разів на тиждень, по 3 години в день. Це не нудні уроки в аудиторіях, а графіка і дизайн на природі в лісі, можливість дізнатись сучасні тенденції з дизайну, відео та фото. Англійська мова не лише з викладачами, а представниками ІТ-компаній та іноземцями. Не професорські лекції та зарозумілі слова, а квести з логіки і алгоритмізації та спортивні естафети з програмування та верстки, пізнавальні екскурсії в ІТ-компанії. Кожне заняття — насичене та нестандартне. Дружня атмосфера допоможе дитині розкрити свою особистість, розвинути здібності і проявити себе в ІT вже у ранньому віці. В групі до 15 дітей, тому поспішайте забронювати місце в таборі. Це шанс для вашої дитини вже цього літа почати програмувати своє майбутнє! Реєструйтесь на сайті Вінницької ІТ-Академії: ita.in.ua тел. 067-431-19-21<br />\r\nПосилання на джерело: <a href=\"https://vn.20minut.ua/IT-novyny/litniy-it-tabir-vid-shkoli-hakeriv-10612569.html\">https://vn.20minut.ua/IT-novyny/litniy-it-tabir-vid-shkoli-hakeriv-10612569.html</a></p>\r\n','1496836500_300х250.gif','2017-06-01 07:15:26','2017-06-07 12:55:00',1),(12,'Всеукраїнський проект \"День кар’єри “PROFIT DAY\"','<p><strong><strong>Вже третій рік поспіль ВМГО &ldquo;Молодіжний центр працевлаштування&rdquo; спільно з Міністерством молоді та спорту реалізовують Всеукраїнський проект &quot;День кар&rsquo;єри &ldquo;PROFIT DAY&quot;.</strong></strong></p>\r\n\r\n<p><strong>Даний проект - це серія заходів по всій Україні, які поєднують у собі ярмарок вакансій, тренінги, майстер-класи та презентації від роботодавців.</strong></p>\r\n\r\n<p><strong>Основною цільовою аудиторією проекту є молодь та внутрішньо переміщені особи. Для молоді участь в проекті дає можливість знайти місце роботи чи підробітку, місце проходження практики, стажування або пройти профорієнтаційне тестування. Для компаній - можливість знайти потрібний працівників, напрацювати кадровий резерв та більше розповісти про свої цінності, продукцію чи послуги.</strong></p>\r\n\r\n<p><strong>В 2017 році заходи найбільші заходи проекту відбулися у Луцьку, Харкові, Тернополі, Львові, Вінниці, Харкові, Дніпрі, Мелітополі, Маріуполі та Сумах.</strong></p>\r\n\r\n<p><strong>В цьому році в проекті взяло участь більше:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>250 компаній-роботодавців</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>4500 відвідувачів</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>80 тренерів та спікерів</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Найбільше кількість роботодавців, які взяли участь в проекті, представляють сферу ІТ. Вона залишається одною з найпріоритетніших &nbsp;сфер розвитку в Україні. Пропозиції щодо вакансій, представлені ІТ-компаніями, користуються неабиякою популярністю серед роботошукачів завдяки гарним умовам оплати праці та можливостям професійного розвитку. </strong></p>\r\n\r\n<p><strong>В 2017 році до організації проекту долучилось близько 50 організацій-партнерів з числа громадських та держаних організацій. Це, зокрема, Державна служба зайнятості, ГО &ldquo;Клуб Ділових Людей&rdquo;, молодіжні центри праці, молодіжні центри, навчальні заклади тощо. </strong></p>\r\n\r\n<p><strong>Проект підтримало і чимало соціально відповідальних бізнес-компаній, серед яких, зокрема, національні партнери: група компаній &ldquo;Метінвест&rdquo; та аутсорсинговий контакт-центр &ldquo;Simply Сontact&rdquo;</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><em>Більше про подію на сайті: </em><a href=\"http://www.profitday.info/\"><em>profitday.info</em></a><em> </em></strong></p>\r\n\r\n<p><strong><em>Сторінка у соцмережах: </em><a href=\"https://www.facebook.com/profitday.info/?fref=ts\"><em>FB</em></a><em>.</em></strong></p>\r\n','1496835317_18766730_1900001843572956_223802807363957673_o.jpg','2017-06-07 12:35:17','2017-06-07 12:35:17',1),(13,'Senior Developer, але Intermediate English? Так не буває!','Один з викладачів Вінницької ІТ-Академії\r\nпочинає усі свої вступні уроки з досить цікавого\r\nзапитання: “Яку мову потрібно знати, щоб\r\nпрограмувати?”. Нескладно здогадатись, що\r\nстуденти починають називати найпопулярнішу\r\nJava, традиційну C чи стрімко набираючу\r\nобертів Java Script. Проте викладач завжди\r\nдивує правильною відповідю: мовою, яку треба\r\nзнати щоб програмувати, є англійська.\r\nАнглійська присутня в більшості кодів, цією\r\nмовою виходить найновіша і найактуальніша\r\nлітература, і в часи глобалізації співпраці з\r\nіноземними фірмами є обов’язковою.\r\nЧесно кажучи, зараз нікого не здивуєш фразою\r\n“Англійська - це must-have спеціаліста у будь-\r\nякій галузі. Зараз без неї нікуди”. Саме тому\r\nсьогодні існує так багато курсів та шкіл, які\r\nобіцяють навчити англійської кожного.\r\nМолодий айтішник записується на уроки,\r\nпроходить курс і отримує свій Intermediate, з яким його резюме виглядає в рази\r\nпривабливіше для роботодавця, а зарплатня тішить душу. І рибка в сітці!\r\nПроте йдуть роки, а мова — явище динамічне, вона постійно розвивається і\r\nзмінюється. Наприклад, щодня з\'являється 14 нових англійських слів! Що робити, як\r\nвстигнути за тенденціями? Просто. Потрібно поновлювати свої знання та покращувати\r\nскіли на додаткових курсах, тренінгах з професіоналами своєї справи, котрі йдуть в\r\nногу з часом і завдяки своїм методикам перетворюють урок на захоплюючий процес.\r\nКожна солідна фірма, котра піклується про розвиток та імідж, як свій, так і своїх\r\nпрацівників, запрошує спеціалістів проводити тренінги з англійської мови. І ось у\r\nкомпанії є час, бажання та можливість організувати зустріч колективу з\r\nвузькоспеціалізованим викладачем англійської. Але виявляється, що не так легко\r\nзнайти людину, яка настільки обізнана в ІТ англійській, що може відкрити щось нове\r\nпрацівникам у цій сфері, котрі читають спеціалізовану літературу цією мовою та\r\nспілкуються з іноземними замовниками.\r\nОднак запевняємо, що знайти таку людину можливо. Що стосується ІТ напряму,\r\nу нашому місті Вінницька ІТ-Академія пропонує співпрацю своїх викладачів англійської\r\nз ІТ компаніями. В академії працює 4 викладачі, котрі довгий час жили за кордоном і\r\nотримали там безцінний досвід. Кожен викладач володіє своїми унікальними\r\nрозробленими методиками викладання та користується спеціально створеними для\r\nакадемії підручниками. Протягом навчання в ІТ-Академії студенти підвищують свою\r\nанглійську на два рівні (наприклад, з Pre-Intermediate до Upper-Intermediate), і це\r\nвідкриває безліч можливостей для успішного працевлаштування.\r\nОтже, якщо ви хочете щоб ваші підлеглі знали не лише те, що “London is the\r\ncapital of Great Britain”, а й як співпрацювати і спілкуватись із замовниками з того\r\nсамого Лондону, дзвоніть та пишіть у Вінницьку ІТ-Академію.\r\nВеб-сайт: https://intita.com/','1502112415_FESS6669.jpg','2017-08-07 14:19:21','2017-08-07 14:26:55',1),(14,'Захопливе літо в ІТ-Таборі Школи Хакерів','Хто зараз найкраще проводить літо? Той, хто відпочиває на природі і грає прикольні ігри? Чи, можливо, той, хто вивчає щось пізнавальне, нове, неординарне та захоплююче? Або той, хто знайшов нових друзів? Все це вдало поєднує в собі Літній ІТ-табір Школи Хакерів при Вінницькій ІТ-Академії!\r\nВ таборі вдало переплелись відпочинок та навчання. Сформувались дві команди, які мають своїх капітанів та щодня змагаються у різних конкурсах. Це неймовірно цікаво! Створюючи свій сайт, учні вчаться логічно мислити, дізнаються багато нового про дизайн та його тенденції, вивчають англійську мову для ІТ. Вже відбулись тематичні зустрічі з іноземцями — носіями англійської мови, поїздка в ІТ-компанію Ciklum, похід на природу, в мотузковий парк, а також Логічний квест. І це ще не все! Найголовнішим є те, що наші команди стали дружніми, вони навчились розкривати свої здібності в процесі навчання та змагань, попрактикувались в командній роботі. Це дуже важливі навички для  майбутнього та формування особистості.\r\nУчні активно готуються до останнього дня в таборі, коли кожен буде презентувати свій перший власний сайт. В цьому їм допомагають професійні викладачі-практики. Вже у віці 9-16 років учні роблять свої перші впевнені кроки в сфері ІТ. Учасники нашого табору вже почали програмувати своє майбутнє. А ти?','1502112629_плакат а4.jpg','2017-08-07 14:30:29','2017-08-07 14:30:29',1),(15,'Як почати заробляти під час навчання - 5 порад студентам.','Упереджена думка про те, що без вищої освіти неможливо отримати престижну роботу, поступово зникає зі свідомості людей. А на запитання: “Коли слід починати кар`єру?” більшість впевнено відповідає: “Якомога раніше”. Що це? Вплив історій успіху Ілона Маска, Стіва Джобса чи Марка Цукерберга, спроба реалізувати себе як особистість в професії, чи результат фінансової кризи в країні? Не виключено, що всі ці фактори разом змусили молодь переглянути свої пріоритети і будувати кар`єру вже в свої “sweet 18”. І найчастіше вибір падає на найпопулярнішу професію нашого покоління - ІТ-ішник. Це не дивно, адже робота програмістом поєднує в собі цікаві, креативні завдання, ціуавий колектив, постійну самоосвіту і самовдосконалення, комфортні умови праці та високу зарплатню. Вінницька ІТ-Академія вже 7 років готує програмістів-професіоналів з “нуля”, які лише за рік навчання отримують усі необхідні знання та навички та починають працювати в ІТ-компаніях. В чому полягає секрет такого успіху? Читай 5 порад, які демонструють ключові концепції навчання в ІТ-Академії. \r\n\r\nПорада 1. Поглиблено вивчай основи \r\nЯкщо ти вирішуєш стати спеціалістом, ти повинен досконало знати свою справу і вміти її виконувати. \r\nОбравши програмування, не слід вивчати лише певну мову, популярну на той момент. В ІТ-сфері тенденції змінюються неймовірно швидко, а заручник однієї технології ризикує разом із нею залишитись в минулому. В ІТ-Академії перший етап навчання спрямований на вивчення базових мов програмування та виховання необхідного типу мислення. Отримавши ці навички, студенти легко опановують інші мови, адже вони знають основні принципи програмування.  \r\n\r\nПорада 2. Наполеглива праця сьогодні обов`язково принесе свої плоди завтра\r\nБудь-яке уміння вимагає постійного вдосконалення, тому під час опанування нової професії, а особливо програмування, працювати потрібно плідно та регулярно. Дисципліна, вихована під час навчання в ІТ-Академії, стає корисною звичкою і високо цінується потім на роботі. Тому наші студенти одразу після випуску працюють в ІТ-компаніях і в багатьох випадках без додаткового стажування. \r\n\r\nПорада 3. 80 на 20 \r\nНа превеликий жаль, класична система освіти не спрямована на виховання практичних навичок. Звідси і проблема пошуку роботи після закінчення ВУЗу — не вистачає досвіду. Світові ІТ-гіганти Google, Apple, IBM давно не дивляться на диплом, їх цікавить, що людина вміє робити і чи готова вчитись далі. Все більше вінницьких ІТ-компаній переймають цей підхід. А Вінницька ІТ-Академія ще на початку свого існування, 7 років тому обрала такий напрям навчання. Курс включає в собі орієнтовно 20% теорії і 80% практики. Саме завдяки цьому усі наші випускники впевнені в своїх силах і не бояться писати код і вирішувати нові для них задачі.  \r\n\r\nПорада 4. Навчись презентувати себе \r\nТвоя мета - показати, що не тобі потрібна робота, а роботі потрібен ти! Створити такий імідж допомагають участі в конференціях, знайомства з людьми які працюють в ІТ-сфері та публікації якісного резюме. Вакансії для айтішників щодня з`являються на work.ua, djinni.co та robotamolodi. А правильно складене резюме підвищує шанси отримати роботу на 80%! Студенти ІТ-Академії складають резюме українською та англійською мовою, і допомагають їм в цьому професіонали з досвідом роботи в менеджменті в ІТ-компаніях. Крім цього, академія регулярно організовує ProfITime - відвідування ІТ-компаній і спілкування з їх працівниками. Ось і ще один секрет стовідсоткового працевлаштування випускників ІТА.  \r\n\r\nПорада 5. Відвідуй  різноманітні “job fairs” (ярмарки вакансій та дні кар`єри) \r\nПодібні заходи спрямовані на працевлаштування молоді. У Вінниці навесні та восени проходzть дні кар`єри для початківців - Prof IT day. Там ти можеш відвідати тренінги практикуючих програмістів, веб-дизайнерів, QA-ів, викладачів іноземних мов та HR-менеджерів. Також ти ознайомлюєшся з відкритими вакансіями компаній-партнерів, спілкуєшся з їх представниками та залишаєш своє резюме. Цієї весни на Prof IT day у Вінниці було представлено близько 20 компаній, серед них Ciklum, RIA, Sky IT Group Ukraine, Аstamobi, IT Sanes. Відвідування таких заходів підвищує шанс працевлаштування в декілька разів. Не прогав найближчий Prof IT day, деталі на https://profitday.info. \r\n\r\nВисновок напрошується сам: якщо поставити собі конкретну ціль та обрати правильний шлях її реалізації — тоді вже до 20 років можна займатись справді достойною справою, стати фінансово незалежним та бути господарем свого життя. Головне — правильно розставити пріоритети та відкинути застарілі стереотипи. Не витрачай час і почни програмувати своє майбутнє власноруч прямо зараз - вступай до Вінницької ІТ-Академії.  Вінницька ІТ-Академія Адреса: вул. Ващука, 20-а, м. Вінниця Веб-сайт: ita.in.ua моб: (067)431-19-21 e-mail: ita.in.ua@gmail.com','1506169439_thumb_675567_news_m.jpeg','2017-09-23 13:23:59','2017-09-23 13:23:59',1),(16,'ІТ-ішник зі шкільної лави - це круто!','Час минає дуже швидко. І можна “прогавити” той момент, коли були сили, натхнення і бажання вчити щось нове. В старшій школі пора замислитись про своє майбутнє. Вже легко визначитись з своїми захопленнями та уподобаннями. Є безліч можливостей використовувати інформаційні технології. Але значно крутіше їх створювати, отримуючи від цього задоволення і гідну заробітну плату. \r\nБути айтішником дуже круто, та не просто. Але якщо будуть навчати і допомагати спеціалісти в цій галузі, то вже до закінчення школи можна стати на перший щабель справжнього ІТ-спеціаліста. Настає той момент, коли потрібно направити свої зусилля на те, щоб стати кращим.\r\n\r\nВже починаючи з 4-го класу, можна почати навчатись в Школі Хакерів Вінницької ІТ-Академії. Адже саме в ній учень зможе після уроків познайомитись з останніми тенденціями ІТ-галузі, а також навчитись чомусь новому та цікавому. Крім того, є викладачі, які допоможуть і підкажуть правильний шлях у вивченні нового та цікавого світу. Адже Інтернет не завжди дає потрібну відповідь. Під час навчання програмуванню, важливо, щоб складний матеріал засвоювався легко. Тому в Школі Хакерів заняття проходять весело та різноманітно. Немає стандартного уроку, як у школі. Є ігри, цікаві практичні завдання, змагання між учнями, різного роду проектні роботи та багато іншого.\r\nДля учнів вікової групи 9-12 років заняття проходять 3-4 рази на тиждень. Складаються вони з п’яти занять, кожне з яких триває 1,5 год. Наші хакери вивчають такі предмети, як Інтернет-програмування, Основи веб-дизайну, Англійська мова і Логіка та алгоритмізація. Вже для учнів віком 13-17 років додається предмет Алгоритмізація та програмування на мовах С/С++.\r\nНа уроках інтернет-програмування учні дізнаються, як працює інтернет, як ним користуватися, а також брати участь у його розвитку. Діти зможуть не просто переглядати веб-сторінки, сидячи за комп’ютером — вони зрозуміють їхню будову та технології, що використовуються для їх створення. Будуть створювати свої власні сторінки і зможуть ділитись ними зі своїми друзями та рідними. Діти познайомляться з мовою розмітки — HTML, стилізують свій сайт за допомогою CSS та його фреймворків, а щоб сайт виглядав динамічно, можна додати трохи Java Script. \r\nДуже важливим є вивчення предмету Алгоритмізація та програмування на мові С. Чому саме мова С (сі)? Та тому, що згодом прийде час вивчати інші мови для програмування сучасних “крутих” іграшок, інтернет-додатків і всього іншого. І мови програмування, які сьогодні для цього застосовуються, в більшості своїй мають синтаксис (правила написання команд та інших програмних конструкцій), майже однаковий з мовою С (до переліку цих мов належать, без сумніву, С++, а також Java, C#, PHP, Java-script).\r\nЯким же чином ми даємо можливість сформувати навички майбутнього розробника програм? Перш за все, вивчаємо базовий синтаксис мови (основні слова, розділові знаки, інші службові символи і правила, щоб їх “ліпити докупи” :-). При цьому важливим буде навчитись правильно складати алгоритми (чіткі послідовності дій, які повинна виконувати програма). І коли вже будете “лускати як насіння” елементарні програмки (виведення на екран, введення з клавіатури, читання/запис у файл, виконання основних математичних та логічних операцій і т.п.) — почнеться розв’язання трохи складніших, але при цьому і цікавіших задач. Кожна з цих задач буде складовою майбутнього великого проекту у вигляді вашої власної версії деякої цікавої комп’ютерної іграшки. Спочатку кожна задача (ігрове поле, інтерфейс, алгоритм самої гри, реєстрація гравців та їх результатів) вирішується окремо. По мірі доведення їх до робочого стану — вони об’єднуються, і в кінці виростають в повнофункціональний (хоча і відносно простий) програмний проект.\r\nЗ чого починається вивчення основ веб-дизайну у Школі Хакерів? В першу чергу потрібно добре освоїти роботу з графічними редакторами. Найбільш поширеними програмними пакетами для роботи з графікою є програми Adobe Photoshop, Adobe Illustrator, Corel DRAW і Corel Paintshop. Звичайно, учні поступово освоюють всі перераховані програми для веб-дизайну і вчаться працювати з ними, але найчастіше використовуються все ж продукти від Adobe. Тому перш за все учні Школи Хакерів починають освоювати Adobe Photoshop. Заняття з веб-дизайну є дуже цікавими та веселими. Усім подобається експериментувати з власними шаблонами.\r\nТрадиційним вважається, що вивчення іноземної мови грунтується на прямій і постійній взаємодії викладача й студента, де першому відводиться роль ініціатора, а другому — статус “слухача” або “приймача”. Характерною особливістю вивчення іноземної мови в ІТ-Академії є те, що викладач бачить у кожному з вихованців добровільного і зацікавленого соратника, однодумця, рівноправного учасника навчання, відповідального за власні результати. Майстерність нашого вчителя іноземних мов полягає в тому, щоб створити в аудиторії умови, які вимагають від учнів творчого пошуку у розв’язанні поставленої проблеми. Тобто, евристичні методи навчання плюс інтерактивна взаємодія є формулою запоруки успіху у вивченні іноземної мови за професійним спрямуванням. Часто-густо на заняттях практикуються кейсові методи викладання, робота в парах, групах, що створює атмосферу конкурентності. Оскільки саме в таких умовах формуються почуття власної гідності й поваги до одногрупників, продуктивно запам’ятовується новий матеріал. Тематика занять є сучасною, багатоаспектною й цікавою: хакерство, гаджети, мікрокомп’ютери, історія комп’ютеризації, реклама в ІТ-сфері, віруси, кіберзлочинність, соціальні мережі, стартапи тощо.\r\nНаші викладачі вважають, що розвиток логічного мислення на парах Логіки та алгоритмізації є дуже важливим. Розум учня теж потребує тренування. У шкільному віці важливо вдосконалювати логічні прийоми для запам\'ятовування.  Потрібно навчити учнів швидко аналізувати та синтезувати матеріал, розуміти його зміст, робити висновки. Часто  в школі, в зв\'язку з браком часу,  вчать не розвитку логіки мислення, а шаблонного вирішення поставлених завдань.  Не маючи звички до логічного мислення, неможливо творчо підійти до вирішення проблеми. А без творчого підходу багато завдань здаються нерозв\'язними. Щоб заняття з логіки та алгоритмізації проходили ефективно, учні регулярно виконують логічні вправи, різні завдання, навчаються дивитися на життєві ситуації з точки зору логіки. Учні виробляють звичку мислити логічно і багато задач (в тому числі життєвих), які здавались раніше безвихідними, стануть легко вирішуватись і здаватимуться дріб\'язковими. \r\nСофія Рашкован, Володимир Білевич, Ярослав Виговський та Станіслав Присяжнюк – програмісти віком від 11 до 17 років. Вони вже отримали роботу в престижних IT-компаніях і створюють стартапи, за які отримують інвестиції на десятки тисяч доларів чи навіть більше! \r\nТому вирушай разом з Школою Хакерів Вінницької ІT-Академії у захопливий світ ІТ, починаючи зі школи!\r\n\r\nВінницька ІТ-Академія\r\nтел. 067-431-19-21, 073-20-99-743\r\nita.in.ua\r\n','1506692108_image5.JPG','2017-09-29 14:35:08','2017-09-29 14:35:08',1),(17,'This is your ProfIT Day!','<p><strong>Мрієш працювати в ІТ, але не маєш чіткого розуміння цієї сфери чи просто не знаєш, з чого почати? Шукаєш колег для співпраці або працівників у свою компанію? Чи пропонуєш навчання для майбутніх програмістів, веб-дизайнерів або тестувальників? Ми, запрошуємо тебе на провідний захід Вінниці, спрямований на працевлаштування молоді в cфері ІТ. Це - PROF IT Day!</strong></p>\r\n\r\n<p><strong>Основне завдання заходу ховається в його назві, адже з англійської слово PROFIT перекладається як користь, вигода та дохід. Тому, жоден учасник зустрічі не йде з неї з порожніми руками: будь то новий досвід, корисні знайомства чи навіть запрошення на роботу в одну з провідних ІТ-компаній. </strong></p>\r\n\r\n<p><strong>Отже, PROF IT Day &mdash; це інформаційний захід, призначений для тих, хто шукає роботу чи бажає визначитись із майбутніми сферами працевлаштування в ІТ-сфері.<br />\r\nКомпанії тут мають нагоду знайти собі фахівців. Навчальні заклади, які готують спеціалістів &mdash; презентувати себе та запросити потенційних абітурієнтів. А молодь &ndash; більше дізнатися про професії в ІТ, отримати актуальну інформацію про цей ринок або спробувати працевлаштуватись.</strong></p>\r\n\r\n<p><strong>Під час &laquo;PROF IT Day&raquo; викладачі Вінницької ІТ-Академії та інші представники передових компаній влаштовують презентації, проводять семінари, тренінги, майстер-класи та приймають резюме від кандидатів. Минулого року участь в Дні Кар&rsquo;єри брало понад 25 компаній та організацій нашого міста - EPAM, WinInteractive, memCrab, IT Sanes, Steel Kiwi, asta.mobi, Main Academy, Ciklum.<br />\r\nОсвітні заклади знайомлять з умовами вступу та навчання, перспективами напрямків, за якими вони готують фахівців, а також здійснюють попередній відбір анкет потенційних студентів.<br />\r\nГості заходу матимуть можливість &nbsp;побачити, як влаштована сфера ІТ &ldquo;зсередини&rdquo; та взяти участь у тренінгах та майстер-класах. Минулого року особливо популярними стали лекції про те, як почати свою кар&#39;єру з мовами програмування с#, c++ та Ruby. Також спікери пояснювали різницю між веб-дизайном та UI, розповідали про криптовалюти та особливості вивчення англійської для ІТ-шників. Учасники заходу отримали шанс дізнатися умови навчання в сучасних навчальних закладах, поспілкуватись із роботодавцями та навіть отримати роботу.</strong></p>\r\n\r\n<p><strong>Як потрапити на PROF IT Day?<br />\r\nУсе дуже просто, та безкоштовно. Потрібно зареєструватись на сайті <a href=\"http://profitday.info/\">http://profitday.info/</a>, заповнити форму і чекати на телефонний дзвінок або електронний лист із запрошенням.</strong></p>\r\n\r\n<p><strong>Коротко кажучи, якщо ти креативний, амбіційний початківець, повний бажання навчатись та працювати, впевнений в собі та своїх можливостях професіонал, готовий поділитись досвідом, чи представник ІТ компанії, яка шукає талановитих працівників &mdash; тобі до нас на PROF IT Day. Ми обіцяємо, що цей день - субота, 4 листопада (Готель &ldquo;Оптіма&rdquo;, Київська, 50а) стане для тебе особливим.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Контакти: Вінницька ІТ-Академія </strong></p>\r\n\r\n<p><strong>Адреса: вул. Ващука, 20-а, м. Вінниця </strong></p>\r\n\r\n<p><strong>Веб-сайт: https://profitday.info/ </strong></p>\r\n\r\n<p><strong>моб: (067)431-19-21 </strong></p>\r\n\r\n<p><strong>e-mail:robotamolodi@gmail.com</strong></p>\r\n','1508142323_FESS6512.jpg','2017-10-16 09:25:23','2017-10-16 09:25:23',1);
