INSERT INTO `resumes` VALUES (1,6,'Roman Melnyk','','romcom77@gmail.com','Директор','3','1',90000,'<p><strong><em>Можу керувати</em>...</strong></p>\r\n','2016-04-16 14:02:04','2017-06-26 14:21:01',1000000,1,0,1,''),(2,8,'Morgunov Igor','0637029948','morgunov.igor1990@gmail.com','Веб розробник','2','1',8000,'<h4>Освіта : </h4>\r\n<h5>2016р. Школа програмістів RIA.com 2016<br />\r\n2015-2016 рр. Вінницька ІТ-Академія<br />\r\n2012-2013 рр. Програма підвищення рівня транспортної дисципліни серед військовослужбовців<br />\r\n2007-2012 рр. денна форма навчання у Вінницькому національно-технічному Університеті, на факультеті радіотехніки та телекомунікацій за спеціальністю «Радіотехніка»  <br />\r\n2005-2007 рр, Фізико - Математична школа Інституту Довузівської підготовки ВНТУ<br />\r\n	</h5>\r\n<h4>Досвід роботи : </h4> <h5>\r\nWeb-проект для RIA.com(створення додаткового сайту RIA.carrier.com з можливістю адміністрування контенту,проходе стадію Альфа тестування) <br /><br />\r\nWeb-проект Робота Молоді - створення пошуку,створення та реалізація логіки роботи зі спеціалізаціями, валідація вхідних даних, пошук та усунення багів)<br />\r\n<a href=\"http://www.robotamolodi.org/\">http://www.robotamolodi.org/</a> <br /><br />\r\nWeb-проект INTITA – створення підсистеми моніторингу юзерів та викладачів,  пошук та усунення багів<br />\r\n<a href=\"http://intita.com/\">http://intita.com/</a> <br /><br />\r\nПроект \"Blocks\" на мові C/C++(гра на логіку з використанням графічної бібліотеки Allegro)<br /><br />\r\nСтажування на СБІ (Програмування МК на мові Ассемблер,пристрій для автоматичного керування рівнем заряду акумулятора під час зарядки) <br /><br />\r\nПАТ «Укртелеком»(вул..Соборна буд. 10)<br /><br />\r\nПАТ «Укртелеком»(вул..Збишко буд. 6) <br />\r\n</h5>\r\n<h4>Навички та вміння :</h4><h5>   \r\n- PHP,JS,C,C++,Java, Assembler,HTML,CSS,NodeJS,SQL<br />\r\n- обізнаний з роботою на: Linux, MySQL, Eclipse, Atom, QT, NetBeans, IntelliJ IDEA, XAMPP, OpenServer, Nginx, PHP Storm,Web Storm, Visual Studio, GIT, SVN, Rapid, ElasticSearch, Rabbit MQ ,KoaJS <br />\r\n</h5>\r\n<h4>Додаткові відомості :</h4><h5>\r\n-водійське посвідчення категорії А,В<br />\r\n-порядний, стресостійкий, комунікабельний, вимогливий до себе та підлеглих, відповідальний;<br /></h5>\r\n','2016-04-16 15:30:38','2016-04-16 16:02:52',20000,1,0,1,''),(3,16,'Інна Кочержук','0977820674','inna-kocherguk@mail.ru','Frontend developer','2','1',5000,'CSS\r\nHTML\r\nJavaScript\r\nBootstrap\r\njQuery\r\nGithub','2016-04-16 16:44:13','2016-04-16 16:48:44',10000,2,0,1,''),(4,60,'Віктор Літвак','09709471594','litvak.lv.30@gmail.com','Веб розробник','2','1',6000,'Junior developer C/C++','2016-04-17 07:25:16','2016-04-17 07:25:16',35000,1,0,1,''),(5,73,'Ірина Канєва','','kaneva.ita@gmail.com','Викладач','18','1',3000,'Освіта:\r\n2006 - ВДПУ, спеціальність \"Математика та основи інформатики\"\r\n2009 - НПУ ім. Драгоманова, спеціальність \"Математика та основи економіки\"\r\nШукаю роботу викладача математики. ','2016-04-17 14:07:40','2016-04-17 14:07:40',10000,1,0,1,''),(6,80,'Сторожук Юрій','','stoha27@gmail.com','Frontend developer','2','1',300,'<p><strong>Personal information:</strong></p>\r\n\r\n<p>Yurii&nbsp;Storozhuk</p>\r\n\r\n<p>Vinnytsia</p>\r\n\r\n<p>Phone: +38 097 9679621</p>\r\n\r\n<p>Date of birth: 07.12.1984</p>\r\n\r\n<p><strong>Objective:</strong></p>\r\n\r\n<p>Looking for works as the IT specialist that corresponds to my abilities and the got skills</p>\r\n\r\n<p><strong>Education:</strong></p>\r\n\r\n<p>Vinnytsya National Technical University, InITCE, FCI Artificial Intelligence, Software engineer, with additional studying of English language</p>\r\n\r\n<p><strong>Work experience and knowledge:</strong></p>\r\n\r\n<p>Ukrsibbank Vinnytsya Specialist IT Department, work with soft support and networks, 2007 &ndash; present</p>\r\n\r\n<p>Installing and configuration software, setup computer network, VPN, Psexec, Linux (basic knowlage)</p>\r\n\r\n<p>Working with HP OpenView Service Desk, customer support</p>\r\n\r\n<p>Active Directory</p>\r\n\r\n<p>Configuration and support peripheral equipment</p>\r\n\r\n<p>Assembly and complete configuration PC</p>\r\n\r\n<p><strong>Professional skills:</strong></p>\r\n\r\n<p>Fundamental knowledge: C/C++, HTML, CSS, Git, MySQL.</p>\r\n\r\n<p>Skilled in the installation, configuration and administration of Microsoft Windows (most), Linux (Ubuntu, Debian), UNIX (FreeBSD)</p>\r\n\r\n<p>Work with Microsoft Windows Server (03-) Network Infrastructure including Active Directory, Group Policy, VPN, DNS, DHCP, IP-Addressing, Remote-Assistance on client computers.</p>\r\n\r\n<p>Virtualization: VMware Workstation, VirtualBox, Hyper-V</p>\r\n\r\n<p>Ability work in team, customer communication experience, quickly trained, flexible, persistent and hardworking.</p>\r\n\r\n<p><strong>Languages:</strong></p>\r\n\r\n<p>English: pre-intermediate</p>\r\n\r\n<p>Ukrainian: native</p>\r\n\r\n<p>Russian: well enough</p>\r\n','2016-04-17 18:20:40','2016-09-27 19:50:56',400,1,0,2,''),(8,112,'Tatyana Maksimova','','maksimova.vin@gmail.com','QA manager','2','1',8000,'<p> <b>RESPONSIBILITIES:</b> </p>\r\n<p> - Ensuring that test strategies, plans, scenarios, and data reflected clients\' requirements; </p>\r\n<p> - Writing test cases and test plans and entering bugs into the internal wiki and Jira (Redmine) tracking systems; </p>\r\n<p> - Developing test case automation (Selenium IDE) and tracking quality assurance metrics; </p>\r\n<p> Working with the development team to identify and correct problems. </p>\r\n\r\n<p> <b> AREAS OF EXPERTISE </b></p>\r\n<p> Acceptability Tests - Functional Tests - Testing Hardware Integration Tests - Performance Tests - Smoke Tests  - Regression Tests - Usability Tests - Issue Identification - Issue Resolution -Test Plans - Test Cases - Test Reports - Collaboration</p>\r\n\r\n\r\n','2016-04-18 09:07:39','2016-04-19 12:38:08',20000,1,0,1,''),(9,120,'Nickolay Zorych','','neo.vsmu@gmail.com','Junior software developer','2','1',9000,'<p style=\"text-align: left;\">EDUCATION</p>\r\n<p style=\"text-align: left;\">2015 - present Student of Vinnitsya IT-Academy</p>\r\n<p style=\"text-align: left;\">2002-2007 National Pirogov Memmorial Medical University</p>\r\n<p style=\"text-align: left;\"> </p>\r\n<p style=\"text-align: left;\">SKILLS</p>\r\n<p style=\"text-align: left;\">● C/C++/C#</p>\r\n<p style=\"text-align: left;\">● HTML/CSS</p>\r\n<p style=\"text-align: left;\">● MySQL</p>\r\n<p style=\"text-align: left;\">● PHP</p>\r\n<p style=\"text-align: left;\">● OOP</p>\r\n<p style=\"text-align: left;\">● Git</p>\r\n<p style=\"text-align: left;\">● Other: System Administrating(Windows/FreeBSD, Cisco, DNS, DHCP, Active Directory)</p>\r\n<p style=\"text-align: left;\"> </p>\r\n<p style=\"text-align: left;\">PROJECTS</p>\r\n<p style=\"text-align: left;\">● ITA Course project Client for Social network Twitter(https://github.com/unix-admin/ita_course)</p>\r\n<p style=\"text-align: left;\">● Healthcare commission protocols (<a href=\"https://github.com/unix-admin/lkk\">https://github.com/unix-admin/lkk</a>)</p>\r\n<p style=\"text-align: left;\">● Test system for students</p>\r\n<p style=\"text-align: left;\">● IT-Academy course project - web site <a href=\"http://qa.profitday.intita.com\">http://qa.profitday.intita.com</a> (Technologies: Yii2, Bootstrap; Role: team lead, backend developer)</p>\r\n<p style=\"text-align: left;\">● IT-Academy course project - web site <a href=\"http://www.robotamolodi.org\">http://www.robotamolodi.org</a> (Technologies: Laravel5, Bootstrap Role: backend developer)</p>\r\n<p style=\"text-align: left;\"> </p>\r\n<p style=\"text-align: left;\">WORK EXPERIENCE</p>\r\n<p style=\"text-align: left;\">2012 – present Head of Information-analytical department in the National Pirogov Memorial Medical University.</p>\r\n<p style=\"text-align: left;\">                                   Executable functions:</p>\r\n<p style=\"text-align: left;\">-    