p>2010 р &ndash; власний інтернет-магазин годинників та аксесуарів на основі дропшипінгу</p>\r\n\r\n<p>2012 р&nbsp; - бізнес &ndash; зорбінг на дальньому пляжі в м.Тернопіль</p>\r\n\r\n<p>2013 р &ndash; бізнес &ndash; рециклінг</p>\r\n\r\n<p>2016 р :</p>\r\n\r\n<ul>\r\n	<li>Лютий&ndash; робота в Польщі, помічник майстра з утеплення мокрими фасадами</li>\r\n	<li>Березень, квітень -&nbsp; робота в Польщі, майстер з утеплення мокрими фасадами</li>\r\n	<li>Серпень, вересень - робота в Польщі, помічник майстра з вкладання бруківки та гранітного каменю</li>\r\n	<li>Жовень - майстер з вкладання бруківки та гранітного каменю</li>\r\n	<li>Листопад, грудень &ndash; в результаті великої кількості обєктів, добору працівників, поділення бригади н дві бригади і моїх професійних навичок та заслуг &ndash; обрано мене бригадиром другої бригади, в прямому підпорядкуванні було 7 чоловік, з них 3 поляки і 4 українці. Першим об&rsquo;єктом був великий водовідстійник для фабрики, глибиною 9 м. Виконували покриття дна та стін ажурними плитами. Після того деілька обєктів з укладання бруківки та гранітного каменя.</li>\r\n</ul>\r\n','2017-01-20 12:09:53','2017-01-20 12:09:53',123581321,2,0,1,''),(21,3957,'Журавська Людмила','+380635935451','liudon4ik@gmail.com','Менеджер','4','1',3200,'<p>Напишу шось гарне про себе &nbsp;</p>\r\n','2017-01-20 19:09:11','2017-01-20 19:10:16',10000,1,0,1,''),(22,4911,'ewqeqweqw','+380631140063','alpan@gmail.com','Frontend developer','9','1',12,'<p>sadaqdas</p>\r\n','2017-01-31 09:07:40','2017-01-31 09:07:40',13,1,0,1,''),(23,4911,'dewqewqewqeq','+380631140063','alpan@gmail.com','empty','9','1',12,'<p>ewqewqewq</p>\r\n','2017-01-31 09:08:56','2017-01-31 09:08:56',13,1,0,1,''),(24,4911,'ewqeqwwqe','+380631140063','alpan@gmail.com','empty','9','1',11,'<p>ewqewqewqewq</p>\r\n','2017-01-31 09:12:55','2017-01-31 09:12:55',13,1,0,1,''),(25,4911,'dassad','+380631140063','alpan@gmail.com','empty','9','1',12,'<p>ewqewqqweeq</p>\r\n','2017-01-31 09:18:53','2017-01-31 09