INSERT INTO `vacancies` VALUES (3,'Програміст (стажер)',53,'2','0000-00-00',100,'<p>Знання принаймні однієї процедурної мови та основ ООП. Приймаються студенти ІТ-спеціальностей технічних навчальних закладів та фізиком-математичних + інформатика &mdash; педагогічних навчальних закладів 2 курс і старші. В резюме описувати проекти, які писали чи вказувати посилання на готові проекти. Зайнятість 3&minus;4 дні на тиждень по 4 год. Графік гнучкий. Стажування в основному на ІНТЕРНЕТ-ПРОЕКТАХ (PHP, JS, HTML, CSS, Java). Досвід ПРОГРАМУВАННЯ ОБОВ&rsquo;ЯЗКОВИЙ!</p>\r\n','romcom77@gmail.com',NULL,'2016-04-16 14:10:25','2017-08-08 08:36:47',6000,1,0,1,''),(4,'Викладач ІТ-технологій і мов програмування',53,'2','0000-00-00',12000,'Викладач ІТ технологій з обов’язковим досвідом програмування та бажаним досвідом викладання\r\n\r\nМови програмування: С/C++, C#, Java, PHP, Java Script, SQL та інші.\r\nБази даних: MySQL.\r\nТехнології: J2SE, J2EE, J2ME, .NET та інші.\r\nДискретна математика, комбінаторика… Пропонуємо повну чи часткову зайнятість залежно від кваліфікації спеціаліста.\r\n\r\nЧасткова зайнятість — залежно від кваліфікації. (Зайнятість від 3 год. на тиждень)\r\n\r\nВикладання класичних та сучасних знань з програмування.\r\n\r\nБажано: Програміст-практик.','romcom77@gmail.com',NULL,'2016-04-16 14:14:30','2017-08-07 14:06:28',18000,1,0,1,''),(5,'Менеджер з продажу ІТ-послуг та послуг ІТ освіти',53,'2','0000-00-00',5000,'<p><strong>Вимоги: </strong></p>\r\n\r\n<p>Бажання працювати, розвиватись та заробляти. Комунікабельність, наполегливість, грамотність.</p>\r\n\r\n<p><strong>Умови:</strong></p>\r\n\r\n<p>Робота в ІТ Академії (освітня сфера та ІТ). Комунікація із потенційними студентами, навчальними закладами та ІТ-компаніями і іншими суб&#39;єктами ІТ сфери.</p>\r\n','romcom77@gmail.com',NULL,'2016-04-16 14:17:52','2017-09-01 07:07:33',15000,1,0,1,''),(6,'Менеджер відділу турботи про клієнтів',53,'2','0000-00-00',5000,'<p>Менеджер відділу турботи про клієнтів ІТ-Академії. Робота в освітній сфері та ІТ. Комунікація із абітурієнтами та студентами ІТ-Академії, їх супровід від реєстрації до працевлаштування. Бажання працювати, розвиватись та заробляти. Комунікабельність, наполегливість, грамотна та приємна мова. Інтерес до ІТ сфери та освіти. Бажаний досвід у відділах підтримки чи call-центрах.</p>\r\n','romcom77@gmail.com',NULL,'2016-04-16 14:19:59','2017-09-01 07:05:19',12000,1,0,1,''),(7,'Викладач англійської мови в ІТ-Академію',53,'18','0000-00-00',6000,'Умови роботи:\r\n\r\nЧасткова зайнятість - залежно від кваліфікації. (Зайнятість від 3 год. на тиждень)\r\n \r\nОбов\'язки:\r\nВикладання англійської мови (загальної і спеціалізованих тем) для студентів, які вивчають програмування.\r\n \r\nВік викладача від 30 років і знання програмування не потрібне.','romcom77@gmail.com',NULL,'2016-04-16 14:24:58','2016-05-01 18:33:10',18000,1,0,1,''),(8,'Викладач англійської мови в ІТ-Академію',55,'9','0000-00-00',13,'<p>sfd</p>\r\n','igor@gmail.com',NULL,'2016-07-05 09:45:48','2016-07-05 09:46:10',243,1,0,1,''),(9,'Менеджер з продажу по телефону',57,'9','0000-00-00',4000,'<p>На&nbsp;роботу потрібна цілеспрямована, позитивна, енергійна, комунікабельна людина. Стать та вік значення не&nbsp;має. Тільки Тернопіль.</p>\r\n\r\n<p>Основні вимоги:</p>\r\n\r\n<p>&mdash;&nbsp;вміння та&nbsp;бажання продавати по&nbsp;телефону;</p>\r\n\r\n<p>&mdash;&nbsp;висока комунікабельність;</p>\r\n\r\n<p>&mdash;&nbsp; вміння швидко сприймати інформацію;</p>\r\n\r\n<p>&mdash;&nbsp;вміння аналізувати як&nbsp;свої вчинки так і роботу в цілому;</p>\r\n\r\n<p>&mdash;&nbsp;приємний, впевненний голос (це&nbsp;важливо для телефонних розмов);</p>\r\n\r\n<p>&mdash;&nbsp;мінімальні навики роботи в інтернеті, майкрософт офіс, електронна пошта.</p>\r\n\r\n<p>Робота на&nbsp;дому тому потрібно підключення до інтернету та&nbsp;тиха обстановка (наприклад відсутність дітей).</p>\r\n\r\n<p>Основна робота&nbsp;&mdash; продаж наших послуг по&nbsp;телефону (не&nbsp;МЛМ, кредити і т.д.).</p>\r\n\r\n<p>Зарплата&nbsp;&mdash; відсотки від продаж.</p>\r\n\r\n<p>Графік роботи з&nbsp;10 до&nbsp;17 крім сб. та&nbsp;нд.</p>\r\n','ar-osad@yandex.ua',NULL,'2016-11-21 12:20:29','2016-11-21 12:24:09',8000,1,0,1,''),(10,'Викладач QA',53,'2','0000-00-00',5000,'<p>Вимоги:</p>\r\n\r\n<p>Викладач QAз обов&rsquo;язковим досвідом роботи та <strong>бажаним досвідом менторства.</strong></p>\r\n\r\n<p>Пропонуємо повну чи&nbsp;часткову зайнятість залежно від кваліфікації спеціаліста.</p>\r\n\r\n<p>Умови роботи:</p>\r\n\r\n<p>Часткова зайнятість&nbsp;&mdash; залежно від кваліфікації. (Зайнятість від 3 год. на&nbsp;тиждень)</p>\r\n\r\n<p>Обов&rsquo;язки:</p>\r\n\r\n<p>Викладання класичних та&nbsp;сучасних знань .</p>\r\n\r\n<p>Бажано: <strong>Практик.</strong></p>\r\n','romcom77@gmail.com',NULL,'2016-12-08 08:38:46','2017-08-07 14:07:11',18000,1,0,1,''),(11,'Викладач Web-дизайну',53,'2','0000-00-00',5000,'<p>Вимоги:</p>\r\n\r\n<p>Викладач Веб-дизайну з&nbsp;обов&rsquo;язковим досвідом програмування та <strong>бажаним досвідом викладання чи&nbsp;менторства.</strong></p>\r\n\r\n<p>Пропонуємо повну чи&nbsp;часткову зайнятість залежно від кваліфікації спеціаліста.</p>\r\n\r\n<p>Умови роботи:</p>\r\n\r\n<p>Часткова зайнятість&nbsp;&mdash; залежно від кваліфікації. (Зайнятість від 3 год. на&nbsp;тиждень)</p>\r\n\r\n<p>Обов&rsquo;язки:</p>\r\n\r\n<p>Викладання класичних та&nbsp;сучасних знань .</p>\r\n\r\n<p>Бажано:<strong>Практик.</strong></p>\r\n','romcom77@gmail.com',NULL,'2016-12-08 08:48:21','2017-04-20 09:19:44',18000,1,0,1,''),(12,'dsaasdaasd',58,'9','0000-00-00',11,'<p>dsadasdsadadasda</p>\r\n','alpan@gmail.com',NULL,'2017-01-31 09:06:44','2017-01-31 09:06:44',12,1,0,1,''),(13,'full-stack Developer',58,'18','0000-00-00',12,'<p>eqwewqewqewqewqeqeqe</p>\r\n','alpan@gmail.com',NULL,'2017-03-22 20:03:01','2017-03-22 20:03:01',123123,1,0,1,''),(14,'Менеджер з продажу по телефону',60,'23','0000-00-00',100,'<p><strong>Комунікабельний</strong></p>\r\n','robotamolodi@gmail.com',NULL,'2017-03-23 16:25:33','2017-03-23 16:25:33',10000,1,0,1,''),(15,'Менеджер з продажу послуг онлайн та по телефону',60,'2','0000-00-00',5000,'<p>Має мати велике бажання працювати і розвиватись.</p>\r\n','robotamolodi@gmail.com',NULL,'2017-03-28 14:50:05','2017-04-20 15:34:47',12000,1,0,1,''),(16,'Event Manager',61,'4','0000-00-00',4000,'<p>Потрібен прогресивний працівник із знанням англійської мови та зацікавлений сферою інформаційних технологій.</p>\r\n\r\n<p>Організація навчальних, профорієнтаційних заходів тощо.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-04-20 09:13:12','2017-05-01 18:25:59',14000,1,0,1,''),(17,'Junior QA',61,'2','0000-00-00',1,'<p><strong>Requirements:</strong></p>\r\n\r\n<ul>\r\n	<li><em>Familiar with mobile application testing checklist; </em></li>\r\n	<li><em>Strong knowledge of client-server architecture, SQL, SDLC;</em></li>\r\n	<li><em>Strong knowledge of testing theory, QA processes, methodologies, standards and practices;</em></li>\r\n	<li><em>Good knowledge of Android and iOS: features, UI/UX, ecosystem, guidelines, limitations; Test cases and bug reports creation. Requirements analysis. Functional and non-functional testing; </em></li>\r\n	<li><em>Familiar with any bug-tracking system (Redmine, Jira, etc.), web testing tools;</em></li>\r\n	<li><em>Basic knowledge of Linux; Location in Kyiv. Remote candidates are not considered; </em></li>\r\n	<li><em>English &mdash; intermediate. Will be a plus Experience in the Agile and iterative development processes; </em></li>\r\n	<li><em>Additional classes/courses;</em></li>\r\n	<li><em>Familiar with any programming language. </em></li>\r\n</ul>\r\n\r\n<p><strong>We offer our employees </strong></p>\r\n\r\n<ul>\r\n	<li><em>Interesting projects; </em></li>\r\n	<li><em>Great friendly professional team with passion to create; </em></li>\r\n	<li><em>20 working days of annual paid vacation; </em></li>\r\n	<li><em>8-hour working day and 5-day working week; </em></li>\r\n	<li><em>State holidays celebration; </em></li>\r\n	<li><em>Paid sick leaves; </em></li>\r\n	<li><em>Compensation depends on experience and skills, regular salary reviews and assessments; </em></li>\r\n	<li><em>Comfortable office facilities; </em></li>\r\n	<li><em>Office near the center of Kiev (Lybidska Subway Station).</em></li>\r\n</ul>\r\n\r\n<p><em>​</em></p>\r\n','mail@sannacode.com',NULL,'2017-04-20 10:37:25','2017-04-20 10:55:00',2,1,0,1,''),(18,'empty',62,'22','0000-00-00',3000,'<p>Потрібна няня для дітей. Двоє дітей дівчинка і хлопчик ( 7 і 5 рочків). Основний обовязок-приготувати їсти, тому робота не на повний день, іноді потрібно буде посидіти з дітьми. Деталі за телефоном 0972166901 Люда.</p>\r\n','matilda32@ukr.net',NULL,'2017-04-24 09:33:50','2017-04-24 09:33:50',3001,1,0,1,''),(19,'Python Developer',61,'2','0000-00-00',1,'<p>We&rsquo;re seeking an&nbsp;python developer to&nbsp;join our growing Data &amp; Infrastructure group.</p>\r\n\r\n<p>Be&nbsp;a&nbsp;part of&nbsp;a&nbsp;small team using state of&nbsp;the art technologies and help us&nbsp;architecting and building the next generation of&nbsp;our distributed application running on&nbsp;a&nbsp;massive cloud deployment.</p>\r\n\r\n<p>Our technology stack includes Python (Django, Cellery, SupervisorD, Tornado, AsyncIO ,etc.), AWS (including Spot Instances) ,MYSQL, Git, Jenkins and much more.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>MUST</strong>: Deep knowledge of&nbsp;Python,&nbsp;<strong>3+</strong>&nbsp;years of&nbsp;industry experience</p>\r\n	</li>\r\n	<li>\r\n	<p>Knowledge of&nbsp;back end system and server side development</p>\r\n	</li>\r\n	<li>\r\n	<p>Good knowledge of&nbsp;SQL and experience with MYSQL</p>\r\n	</li>\r\n	<li>\r\n	<p>Experience with REST and external API connections</p>\r\n	</li>\r\n	<li>\r\n	<p>Good knowledge HTML, CSS and Javascript</p>\r\n	</li>\r\n	<li>\r\n	<p>Knowledge of&nbsp;Linux</p>\r\n	</li>\r\n	<li>Fast learner</li>\r\n</ul>\r\n','ita.in.ua@gmail.com',NULL,'2017-04-25 08:48:08','2017-04-26 07:15:21',20000,1,0,1,''),(20,'Android Developer (middle)',61,'2','0000-00-00',3200,'<p>В&nbsp;возрастной категории до&nbsp;35 лет 72% жителей Украины активно пользуются смартфонами. Поддерживая тренд &laquo;mobile first&raquo;, мы&nbsp;расширяем наш Mobile Development в&nbsp;компании RIA.com. Готовы принять в&nbsp;свою команду Android-разработчика!</p>\r\n\r\n<p><strong>Требования:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Понимание принципов ООП</p>\r\n	</li>\r\n	<li>\r\n	<p>Опыт разработки под Android от&nbsp;2-х лет</p>\r\n	</li>\r\n	<li>\r\n	<p>Уверенное знание Java и&nbsp;Android SDK</p>\r\n	</li>\r\n	<li>\r\n	<p>Понимание архитектуры мобильных приложений, применение принципов ООП и&nbsp;шаблонов проектирования при решении задач</p>\r\n	</li>\r\n	<li>\r\n	<p>Опыт работы с&nbsp;GCM, FCM (Firebase), SQLite</p>\r\n	</li>\r\n	<li>\r\n	<p>Уверенная работа с&nbsp;git, mercurial</p>\r\n	</li>\r\n	<li>\r\n	<p>Опыт в&nbsp;работе с&nbsp;API (JSON)</p>\r\n	</li>\r\n	<li>\r\n	<p>Опыт интеграции внешних API (facebook, google, etc)</p>\r\n	</li>\r\n	<li>\r\n	<p>Чтение и&nbsp;понимание документации на&nbsp;английском</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Желательно:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Навыки работы с&nbsp;RxJava, Data Binding, Service</p>\r\n	</li>\r\n	<li>\r\n	<p>Умение писать unit-тесты</p>\r\n	</li>\r\n	<li>\r\n	<p>Опыт работы с&nbsp;Google Maps, GPS</p>\r\n	</li>\r\n	<li>\r\n	<p>Опыт командной работы по&nbsp;методике Agile</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Условия работы:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Высокая заработная плата с&nbsp;возможностью &laquo;вырасти&raquo; до&nbsp;позиции тимлида;</p>\r\n	</li>\r\n	<li>\r\n	<p>гибкий график: 8&nbsp;&mdash; часовой рабочий день, пн-пт, начало работы с 8:00&mdash;10:00;</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>45 дней оплачиваемого отпуска;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p>социальный пакет: досуг, корпоративы, тимбилдинги с&nbsp;кучей ентертеймента:)</p>\r\n	</li>\r\n	<li>\r\n	<p>индивидуальный подход в&nbsp;развитии сотрудника как профессионала: внутреннее обучение, доступ к&nbsp;корпоративной библиотеке, обучение на&nbsp;всеукраинских и&nbsp;международных Интернет-конференциях, мастер-классах, тренингах;</p>\r\n	</li>\r\n	<li>\r\n	<p>бесплатные курсы английского.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Обязанности:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>реализация алгоритмов;</p>\r\n	</li>\r\n	<li>\r\n	<p>разработка компонентов по&nbsp;подготовленным техническим требованиям;</p>\r\n	</li>\r\n	<li>\r\n	<p>отладка кода.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Мы&nbsp;&mdash; компания &laquo;RIA.com&raquo;. Мы&nbsp;&mdash; молоды (средний возраст сотрудников&nbsp;&mdash; 25 лет), но&nbsp;достаточно зрелые, чтобы быть лидерами в&nbsp;Украине. С&nbsp;нами знаком каждый третий украинский пользователь Интернета. AUTO.RIA, DOM.RIA, RIA.com, MARKET.RIA приносят пользу всем, помогая продавать и&nbsp;покупать автомобили, недвижимость, товары.</p>\r\n\r\n<p>Именно Вы&nbsp;можете вскоре стать частью нашей команды!</p>\r\n\r\n<p>Отправляйте резюме и&nbsp;знакомьтесь с&nbsp;нами по&nbsp;хештегу #риавместевеселей</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-04-26 11:00:06','2017-04-26 11:00:06',30000,1,0,1,''),(21,'iOS Developer (middle)',61,'2','0000-00-00',3200,'<p>В&nbsp;возрастной категории до&nbsp;35 лет 72% жителей Украины активно пользуются смартфонами. Поддерживая тренд &laquo;mobile first&raquo;, мы&nbsp;расширяем наш Mobile Development в&nbsp;компании RIA.com. Готовы принять в&nbsp;свою команду iOS-разработчика!</p>\r\n\r\n<p><strong>Требования:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Понимание принципов объектно-ориентированного программирования</p>\r\n	</li>\r\n	<li>\r\n	<p>Опыт разработки под iOS от&nbsp;2-х лет</p>\r\n	</li>\r\n	<li>\r\n	<p>Опыт разработки на&nbsp;Objective-C, Swift</p>\r\n	</li>\r\n	<li>\r\n	<p>Понимание архитектуры мобильных приложений, применение принципов ООП и&nbsp;шаблонов проектирования при решении задач</p>\r\n	</li>\r\n	<li>\r\n	<p>Опыт 