и&nbsp;покупать автомобили, недвижимость, товары.</p>\r\n\r\n<p>Именно Вы&nbsp;можете вскоре стать частью нашей команды!</p>\r\n\r\n<p>Отправляйте резюме и&nbsp;знакомьтесь с&nbsp;нами по&nbsp;хештегу #риавместевеселей</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-04-27 10:57:11','2017-04-27 10:57:11',30000,1,0,1,''),(22,'HTML-верстальщик',61,'2','0000-00-00',1,'<p>Компанія:&nbsp;<a href=\"https://www.work.ua/ua/jobs/by-company/942745/\"><strong>Рыбка А.А., ФЛП</strong></a>&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Контактна особа: Наталья Наткина</p>\r\n\r\n<p>Телефон: +380951482221</p>\r\n\r\n<p>Місто: Вінниця</p>\r\n\r\n<p>Вид зайнятості: повна зайнятість, дистанційна робота</p>\r\n\r\n<p>Вимоги: досвід роботи від 2 років</p>\r\n\r\n<p>ОПИС ВАКАНСІЇ:&nbsp;</p>\r\n\r\n<p>Мы&nbsp;верстаем интернет-проекты, которые номинируются на&nbsp;премии &laquo;Золотой Сайт&raquo;, &laquo;Рейтинг Рунета&raquo;, &laquo;Tagline&raquo; и &laquo;Премию Рунета&raquo;. Только интересные, необычные, крутые проекты!</p>\r\n\r\n<p>Что нужно знать и&nbsp;уметь чтобы работать с&nbsp;нами:</p>\r\n\r\n<ul>\r\n	<li>Опыт работы на&nbsp;должности HTML-верстальщик от&nbsp;2 лет (фриланс, офис, компания&nbsp;&mdash; опишите)</li>\r\n	<li>Уверенные знания HTML5, CSS3</li>\r\n	<li>БЭМ</li>\r\n	<li>CSS-препроцессор (less, scss)</li>\r\n	<li>jQuery на&nbsp;уровне подключения готовых библиотек, написание функций, допиливание готовых плагинов под себя</li>\r\n	<li>Наличие готовых проектов, которыми вы&nbsp;гордитесь</li>\r\n	<li>Будет плюсом:</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>опыт работы в&nbsp;команде с&nbsp;использованием Git. Если такого опыта нет&nbsp;&mdash; не&nbsp;страшно, будем учиться вместе</li>\r\n	<li>умение работать с&nbsp;Illustrator, Sketch, InDesign</li>\r\n	<li>знание jQuery выше среднего уровня</li>\r\n</ol>\r\n\r\n<p>Вам предстоит:</p>\r\n\r\n<ul>\r\n	<li>познакомиться и&nbsp;перенять наш внутренний стандарт верстки</li>\r\n	<li>если вы&nbsp;прошли все стадии отбора:</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>верстать адаптивные сайты различной сложности по&nbsp;утвержденным дизайн-макетам;</li>\r\n	<li>верстать новые разделы для уже существующих сайтов;</li>\r\n	<li>верстать адаптивные HTML-макеты.</li>\r\n</ol>\r\n\r\n<p>Условия работы:</p>\r\n\r\n<ul>\r\n	<li>Работа в&nbsp;команде профессионалов</li>\r\n	<li>Перспективы профессионального и&nbsp;карьерного роста</li>\r\n	<li>Уровень заработной платы определяется после собеседования</li>\r\n	<li>Удаленная от&nbsp;8 часов в&nbsp;день с&nbsp;9:00 до&nbsp;19:00</li>\r\n</ul>\r\n\r\n<p>Дополнительные инструкции:</p>\r\n\r\n<p>Первой строкой при подаче заявки на&nbsp;вакансию обязательно указывайте ваш опыт работы:</p>\r\n\r\n<ol>\r\n	<li>где работали/работаете?</li>\r\n	<li>какой практический опыт верстки?</li>\r\n	<li>сколько проектов свёрстано вами лично?</li>\r\n</ol>\r\n\r\n<p>Рассматриваем кандидатов только с&nbsp;опытом от&nbsp;1 года на&nbsp;должности HTML-верстальщик!</p>\r\n\r\n<p>Похоже вы&nbsp;внимательный (-ая) и&nbsp;прочитали до&nbsp;конца. Любим таких. В&nbsp;сопроводительном письме попросите нас прислать вам тестовое задание (это первый этап отбора на&nbsp;вакансию). Ваша внимательность поможет Вам получить желаемую должность.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-05-10 09:01:57','2017-05-10 09:01:57',10000,1,0,1,'NULL'),(23,'Front-end Developer',61,'2','0000-00-00',1,'<p>Компанія:&nbsp;Astound Commerce.</p>\r\n\r\n<p>Вид зайнятості: повна зайнятість.</p>\r\n\r\n<p>Вимоги: Досвід роботи від 2 років, вища освіта.</p>\r\n\r\n<p><strong>Who we&nbsp;are and what we&nbsp;do:</strong></p>\r\n\r\n<p><strong>Astound Commerce</strong>&nbsp;is&nbsp;a&nbsp;global ecommerce agency headquartered in&nbsp;the&nbsp;US. With over 600 professionals in&nbsp;7 countries, we&nbsp;are one of&nbsp;the world&rsquo;s largest teams of&nbsp;ecommerce experts. Top brands like Adidas, Puma, Versace, Jimmy Choo, Tommy Hilfiger, Hugo Boss and Crocs are among our clients. Company centers in&nbsp;Eastern Europe are focused on&nbsp;the development of&nbsp;ecommerce solutions on&nbsp;Salesforce Commerce Cloud (Demandware), Hybris, IBM WebSphere Commerce, Intershop, Kibo, Magento, NetSuite.</p>\r\n\r\n<p>Brief description of&nbsp;the open position</p>\r\n\r\n<p>The&nbsp;<strong>Frontend Developer</strong>&nbsp;will be&nbsp;part of&nbsp;a&nbsp;high-performance feature driven development team responsible for building complex ecommerce solutions. You must have a&nbsp;proven track record of&nbsp;solving various business and technical problems while taking responsibility for meeting business objectives. This job requires solid technical skills to&nbsp;provide coding expertise throughout the entire software development lifecycle. You should have expertise with software development lifecycle methodologies, solid experience and knowledge of&nbsp;web development, and use of&nbsp;standard design and development tools.</p>\r\n\r\n<p><strong>You will:</strong></p>\r\n\r\n<ul>\r\n	<li>Work with Development Lead and project leads in&nbsp;understanding business needs, defining technical issues, and proposing solutions;</li>\r\n	<li>Help ensure accuracy and completeness of&nbsp;technical documentation and team communications;</li>\r\n	<li>Analyze business and technical specifications/requirements and develop enterprise-level ecommerce solutions;</li>\r\n	<li>Work in&nbsp;collaboration with Graphic Designers &amp; UX&nbsp;Designers to&nbsp;turn their vision into functional HTML templates;</li>\r\n	<li>Work with web development team to&nbsp;ensure proper implementation of&nbsp;website&rsquo;s functionality;</li>\r\n	<li>Provide updates to&nbsp;effort estimates and status of&nbsp;assigned tasks, and identify development-related risks on&nbsp;assigned projects;</li>\r\n	<li>Provide the best technical solutions for tasks utilizing the best practices and design patterns;</li>\r\n	<li>Support and help developers come up&nbsp;with the best technical solutions;</li>\r\n	<li>Provide recommendations to&nbsp;Development Lead and functional managers on&nbsp;ways to&nbsp;improve processes, systems, tools and role definitions based on&nbsp;program or&nbsp;project-specific experience;</li>\r\n	<li>Actively contribute to&nbsp;continuous improvements to&nbsp;development methodology and underlying processes;</li>\r\n	<li>Help with managing projects through making suggestions for design design, development and&nbsp;QA processes;</li>\r\n	<li>Participate in&nbsp;project team meetings and brainstorming activities related to&nbsp;the project issues.</li>\r\n</ul>\r\n\r\n<p><strong>You have:</strong></p>\r\n\r\n<ul>\r\n	<li>3+ year of&nbsp;frontend development;</li>\r\n	<li>Expert level hand-coding in&nbsp;CSS and HTML (including HTML5, CSS3);</li>\r\n	<li>Experience with frontend grid systems;</li>\r\n	<li>Experience with preprocessors (LESS, Sass, etc.);</li>\r\n	<li>Working knowledge of&nbsp;JavaScript, and related libraries in&nbsp;cross-platform development;</li>\r\n	<li>Experience with task runners (Grunt, Gulp, etc.);</li>\r\n	<li>Base knowledge of&nbsp;accessibility, SEO and&nbsp;UX aspects of&nbsp;frontend development;</li>\r\n	<li>Experience with client-side code performance optimization, debugging and debugging tools (Firebug, etc.);</li>\r\n	<li>Experience with responsive web design approach and/or mobile solutions;</li>\r\n	<li>Common understanding of&nbsp;cross-browser/platform issues;</li>\r\n	<li>Knowledge of&nbsp;Adobe Photoshop;</li>\r\n	<li>Must be&nbsp;an&nbsp;independent, self-motivated team player that is&nbsp;meticulous and methodical in&nbsp;creating solutions;</li>\r\n	<li>Ability to&nbsp;learn and adapt quickly in&nbsp;a&nbsp;dynamic environment;</li>\r\n	<li>Pre-intermediate spoken and written English communication skills.</li>\r\n</ul>\r\n\r\n<p><strong>Good to&nbsp;have:</strong></p>\r\n\r\n<ul>\r\n	<li>Personal portfolio of&nbsp;completed projects/products or&nbsp;link to&nbsp;GitHub/CodePen/JSFiddle/StackOverflow etc. accounts;</li>\r\n	<li>Experience with CMS;</li>\r\n	<li>Experience working in&nbsp;geographically distributed teams;</li>\r\n	<li>Experience in&nbsp;developing multiple ecommerce solutions;</li>\r\n	<li>Analytical and time management skills;</li>\r\n	<li>Excellent written and verbal communication skills, as&nbsp;exemplified by&nbsp;writing clear technical specifications, documentation of&nbsp;knowledge, and effective intra- and inter-group communications.</li>\r\n</ul>\r\n\r\n<p><strong>We&nbsp;offer:</strong></p>\r\n\r\n<ul>\r\n	<li>Knowledgebase of&nbsp;the world&rsquo;s largest ecommerce delivery team;</li>\r\n	<li>Trainings and certifications;</li>\r\n	<li>A&nbsp;constant inflow of&nbsp;ecommerce projects with global outreach;</li>\r\n	<li>Well set SDLC process with use of&nbsp;Agile, Scrum, Waterfall depending on&nbsp;a&nbsp;project;</li>\r\n	<li>Coaching and reviews to&nbsp;support your career development;</li>\r\n	<li>Internal/external engineering and business training and conferences and time for self-education;</li>\r\n	<li>Extensive technical library with option to&nbsp;order books and English classes;</li>\r\n	<li>A&nbsp;network-style culture with geographically distributed teams, easy communications and access to&nbsp;clients;</li>\r\n	<li>Possible international on-site visits;</li>\r\n	<li>Work-life balance approach and healthy lifestyle programs.</li>\r\n</ul>\r\n','ita.in.ua@gmail.com',NULL,'2017-05-12 13:54:38','2017-05-12 13:54:38',20000,1,0,1,'NULL'),(24,'Front-end Developer',64,'9','0000-00-00',100,'<p>Дана вакансія не актуальна.</p>\r\n','bodik92.ua@gmail.com',NULL,'2017-05-15 17:24:56','2017-05-15 17:25:10',1000,1,0,1,'NULL'),(25,'UX Designer',61,'2','0000-00-00',1,'Компанія: Astound Commerce\r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: Досвід роботи від 2 років, вища освіта\r\n\r\nIf you’re skilled Web designer, who is ready to dive into User Experience Design — you’re welcome to explore this opportunity!\r\n\r\nResponsibilities:\r\nWork in international team on Astounding ecommerce projects for major brands like Adidas, Crocs, L’Oreal, etc;\r\nDirect communication with clients and project members abroad (US, UK, Germany);\r\nBe a part of projects from conception to completion;\r\nResearch and analyze best cases and patterns of UX design globally;\r\nRequired skills:\r\n\r\nUser-centered design approach;\r\nExperience in creating wireframes;\r\nInterest in contemporary UX trends;\r\nIntermediate level of English (both verbal and written);\r\nPortfolio of completed web projects.\r\nDesired skills:\r\n\r\nExperience in ecommerce area — if you worked with Magento, you’re almost hired :)\r\nExperience in working with personas, task analysis and scenario / story creation is an advantage;\r\nExperience in human factors, human behavior, field observations & ethno research is an advantage;\r\nWords people use to describe You:\r\n\r\nStrategic, passionate and creative;\r\nPro-active, trustworthy and self-motivated;\r\nTask-driven and people oriented;\r\nGood listener and convincing speaker.\r\nWe offer:\r\n\r\nKnowledgebase of #1 global ecommerce delivery in Ukraine;\r\nTrainings and certifications;\r\nA constant inflow of ecommerce projects with global outreach;\r\nWell set SDLC process with use of Agile, Scrum, Waterfall depending on a project;\r\nCoaching and reviews to support your career development;\r\nInternal/external engineering and business training and conferences and time for self-education;\r\nExtensive technical library with option to order books and English classes;\r\nA network-style culture with geographically distributed teams, easy communications and access to clients;\r\nPossible international on-site visits;\r\nWork-life balance approach and healthy lifestyle programs.\r\n\r\nКонтактна особа: Анна\r\nВеб-сайт: www.astoundcommerce.com','ita.in.ua@gmail.com',NULL,'2017-05-23 09:52:10','2017-05-23 09:52:10',20000,1,0,1,'NULL'),(26,'Front-end Developer',61,'2','0000-00-00',1,'Компанія: Playtika UA   \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: Досвід роботи від 2 років, вища освіта\r\n\r\nRight now Playtika is looking for a Front End JavaScript developer for Back office team. Back Office is a complex dynamically developing CRM system that manages world-class social games, including Slotomania (top place on Facebook) & Caesars Casino.\r\n\r\nRequirements:\r\n\r\nWork experience with commercial projects over 3 years.\r\nProven Native JavaScript (ES5+) knowledge.\r\nExperience with JavaScript frameworks (e.g. Angular, ReactJS, Node JS, jQuery).\r\nStrong knowledge of prototype based programming model in JavaScript.\r\nExperience in code performance analysis.\r\nSoftware architecture and design pattern knowledge.\r\nA natural flair for writing well-structured code.\r\nGood communication and teamwork skills.\r\nPre-Intermediate English skills (read/write/speak).\r\nKnowledge of HTML5 APIs and CSS.\r\n\r\nExperience with VCS (Git).\r\n\r\nAdvantages:\r\n\r\nKnowledge of framework ExtJS (versions 5+).\r\nExperience in tests creation with Jasmine.\r\nUnderstanding of DBMS and SQL.\r\nFamiliarity with Java and other programming languages.\r\nExperience working with Scrum or other Agile processes.\r\nWe offer to all our employees:\r\n\r\nWork with creative friendly team at interesting projects using cutting-edge technologies;\r\nComfortable office easy to reach from any spot of the city;\r\nAnnual salary review and performance bonus paid twice a year;\r\n20 working days paid vacation and sick leave;\r\nSport compensation (Sport Life is our partner);\r\nMedical insurance (Ukraine and travel);\r\nProfessional trainings and conferences;\r\nFree corporate English lessons;\r\nHelp and support if you from other cities;\r\nExciting company and team events — like this unforgettable party https://www.youtube.com/watch?v=Z8r9aBLCRY0 Visit our page and feel us here — http://www.facebook.com/playtikaua\r\n\r\nКонтактна особа: Alisa\r\nТелефон: 044 259 05 60\r\nВеб-сайт: playtika.com','ita.in.ua@gmail.com',NULL,'2017-05-25 08:09:29','2017-05-25 08:09:29',20000,1,0,1,'NULL'),(27,'UI Designer',61,'2','0000-00-00',1,'Компанія: Astound Commerce \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: Досвід роботи від 2 років, вища освіта\r\n\r\nIf you aspire to make web design world more stunning, Astound is just the right place for you!\r\n\r\nYou have:\r\n\r\n3+ years of experience designing outstanding web-based products;\r\nProficiency in industry standard design tools (e.g. Photoshop, Illustrator);\r\nKnowledge of Web site structure and functionality;\r\nGreat communication skills, including verbal English on Intermediate level;\r\nExcellent interpersonal skills and ability to build good working relationships;\r\nPortfolio of completed web projects that displays your level of expertise.\r\nYou will:\r\n\r\nDesign and build the UI for our Client’s web stores;\r\nWork closely with UX team to better inform designs through users\' point of view;\r\nCollaborate with the development team to ensure the design meets specifications;\r\nBe flexible and able to cope with several projects at any given time;\r\nShow proactive attitude and seek innovative ways to incorporate new ideas into the designs.\r\nWe offer:\r\n\r\nKnowledgebase of #1 global ecommerce delivery in Ukraine;\r\nTrainings and certifications;\r\nA constant inflow of ecommerce projects with global outreach;\r\nWell set SDLC process with use of Agile, Scrum, Waterfall depending on a project;\r\nCoaching and reviews to support your career development;\r\nInternal/external engineering and business training and conferences and time for self-education;\r\nExtensive technical library with option to order books and English classes;\r\nA network-style culture with geographically distributed teams, easy communications and access to clients;\r\nWork-life balance approach and healthy lifestyle programs.\r\n\r\nКонтактна особа: Анна\r\nВеб-сайт: www.astoundcommerce.com','ita.in.ua@gmail.com',NULL,'2017-05-26 11:28:08','2017-05-26 11:28:08',20000,1,0,1,'NULL'),(28,'Intern QA',61,'2','0000-00-00',1,'Компанія: SteelKiwi   \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість, готові взяти студента.\r\n\r\nREQUIRED SKILLS:\r\n\r\nknowledge and understanding of the overall testing process;\r\nunderstanding of Agile/Scrum development methodologies and the role of the QA expert in them;\r\nunderstanding of web services architecture;\r\nclear understanding of architecture of Client-Service architecture;\r\nKnowledge of end-to-end mobile application;\r\nstrong desire to grow and improve in the field of Quality Assurance;\r\ngood grasp of the IT industry and applications testing in particular;\r\nEnglish language proficiency at a level sufficient for correspondence with the client and working with technical documentation;\r\nPursuing Bachelor’s degree in Computer Science or related major.\r\nWHAT SHOULD YOU DO:\r\n\r\nmanual testing of web and mobile applications;\r\nclient’s requirements analysis and creation of test cases/check-lists;\r\nconducting test sessions;\r\nproviding description of located bugs and submitting them to the issue tracker;\r\ncooperation with the development team, Project Manager and the client.\r\nMORE AND MORE BENEFITS:\r\n\r\nTalented colleagues with a good sense of humor;\r\nThe exchange of experience;\r\nThe feeling of the importance of what you do;\r\nGrowth prospects for this position;\r\nFree of charge English classes, paid events attendance;\r\nPurchase the necessary software, release-party, pizza-party;\r\nPeriodic review of the salary every six months;\r\nPurchase a laptop or PC.','ita.in.ua@gmail.com',NULL,'2017-05-30 08:35:47','2017-05-30 08:35:47',10000,1,0,1,'NULL'),(29,'Касир торгового залу',65,'1','0000-00-00',4500,'<p>Побажання до кандидатів на посаду: Користувач ПК Досвід роботи у торгівлі бажаний, але не обов&rsquo;язковий Привітність, відповідальність, працелюбність Умови: Безкоштовно проводимо попереднє навчання Офіційне працевлаштування Можливість працювати близько від місця проживання Молодий і дружній колектив Гнучкий графік ЗП від 4400 грн</p>\r\n','mariana.yavorska@gmail.com',NULL,'2017-05-30 12:07:03','2017-05-30 12:07:51',6000,1,0,1,'NULL'),(30,'Web - дизайнер',61,'2','0000-00-00',1,'<p>Компанія: Oscorp Місто: Вінниця Вид зайнятості: повна зайнятість Вимоги: Досвід роботи від 1 року Требования: &bull; Опыт работы web-дизайнером от 1 года &bull; Наличие портфолио включающего: web-сайты и/или Landing pages &bull; Профессиональное владение Adobe Photoshop, Adobe Illustrator &bull; Отличное понимание принципов типографики и композиции &bull; Умение быстро делать мокапы, интерактивные прототипы, пилоты &bull; Понимание основ UI и UX &bull; Интерес к новым западным трендам в дизайне и умение их применять Обязанности: &bull; Дизайн интерфейсов, web-сайтов и Landing Page &bull; Разработка инфографики &bull; Создание материалов для маркетинговых активностей в Интернете: баннера, e-mail-рассылки &bull; Порезка графики для передачи HTML девелоперу на верстку &bull; Совмещать качественный дизайн и дедлайны.</p>\r\n\r\n<p>Контактна особа: В&#39;ячеслав</p>\r\n\r\n<p>Телефон: 0936849063</p>\r\n\r\n<p>Веб-сайт:&nbsp;<a href=\"http://oscorp.pro/\" target=\"_blank\">oscorp.pro</a></p>\r\n','ita.in.ua@gmail.com',NULL,'2017-05-31 07:45:25','2017-05-31 07:47:15',20000,1,0,1,'NULL'),(31,'Middle QA',61,'2','0000-00-00',1,'Компанія: SteelKiwi   \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість, готові взяти студента\r\nВимоги: досвід роботи від 2 років\r\n\r\nREQUIRED SKILLS:\r\nexperience in testing several projects at the same time\r\nexperience in testing of Android and iOS mobile applications\r\nexperience in testing modern web applications and clear understanding of their architecture\r\nknowledge and understanding of the overall testing process\r\nunderstanding of Agile/Scrum development methodologies and the role of the QA expert in them\r\nstrong desire to grow and improve in the field of Quality Assurance\r\ngood grasp of the IT industry and applications testing in particular\r\nsolid analytical skills and good sequential thinker\r\nEnglish- intermediate\r\nWHAT SHOULD YOU DO:\r\nmanual testing of web and mobile applications\r\nclient’s requirements analysis and creation of test cases/check-lists\r\nconducting test sessions\r\nproviding description of located bugs and submitting them to the issue tracker\r\nability to cooperate with the development team, Project Manager and the client\r\nleading demo to customer\r\nwork with Postman, JIRA, Jmeter, ZAP\r\nMORE AND MORE BENEFITS:\r\nTalented colleagues with a good sense of humor\r\nThe exchange of experience\r\nThe feeling of the importance of what you do\r\nGrowth prospects for this position\r\nFree of charge English classes, paid events attendance\r\nPurchase the necessary software, release-party, pizza-party\r\nPeriodic review of the salary every six months\r\nPurchase a laptop or PC.\r\nCONDITIONS:\r\nOur HR can help the person who has decided to work with us to move from another city.\r\nPaid 2 months trial period.\r\nRelax zone with kitchen, a hammock and table football — all of these are at your disposal.\r\nWe believe that work can be as a pleasure, so we are waiting for someone who shares our views.\r\n\r\nINTERVIEW STAGE:\r\nStage 1. Interview with HR (Skype or in person, if you want to see our office).\r\nStage 2. Test task (no restrictions on the implementation, but the faster you do — the faster we`ll give you feedback).\r\nStage 3. Interview with the head of the department (Team Lead).\r\nAnd then we make a decision within 5 days (approximately).\r\n\r\nIf you are reading this to the end and found yourself in these lines — we are looking forward to your CV.\r\n\r\nВеб-сайт:\r\nsteelkiwi.com','ita.in.ua@gmail.com',NULL,'2017-06-01 10:02:18','2017-06-01 10:02:18',20000,1,0,1,'NULL'),(32,'Junior QA',61,'2','0000-00-00',1,'Компанія: Davintoo Ukraina   \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість, готові взяти студента\r\nВимоги: незакінчена вища освіта\r\n\r\nКоманда платформи дистанційного навчання та розвитку персоналу «Collaborator» (http://collaborator.com.ua) оголошує конкурс на вакансію Junior QA Engineer\r\n\r\nМи створюємо нові технології електронного навчання і за допомогою веб-рішень дозволяємо розвивати знання компаній, покращувати професіоналізм і ефективність співробітників.\r\n\r\nЗапрошуємо приєднатися до нашої команди!\r\n\r\nВимоги:\r\n\r\nЗнання основ HTML, CSS.\r\nРозуміння HTTP, WS, etc.\r\nРозуміння роботи Клієнт-Сервер архітектури.\r\nРозуміння основ тестування: Тест-план, Тест-кейс, баг-репорт, види і рівні тестування.\r\nЗнання англійської мови на рівні вміння читати документацію з Google Translate.\r\nУміння вникнути в складну систему і описати її простою мовою.\r\nДосвід роботи в команді.\r\nГотовність приймати самостійні рішення і распределять свій робочий час\r\nБажання вчитися і здобувати нові навички (ми віримо в принцип «неможливо навчити, можна тільки навчитися»).\r\nБуде плюсом.\r\n\r\nДосвід тестування.\r\nЗнання основ програмування (PHP, JS, MySql, Сodeigniter, Git і т.п.).\r\nДосвід роботи з PHP5.\r\nНавички роботи з системами автоматизованого управління браузерами (Selenium та ін.).\r\nДосвід роботи з системами управління проектами і баг-трекінгу (Redmine, Jira, YouTrack, etc.).\r\nОбов’язки:\r\n\r\nРучне функціональне і регресійне тестування Web платформи\r\nТестування вимог\r\nСтворення тестової документації, проектування та виконання тестів\r\nПошук і документування баг-репортів\r\nКомунікація з командою розробників\r\nЩо ми пропонуємо:\r\n\r\nЗарплату за підсумками співбесіди.\r\nМожливість займатися розвитком нашого продукту, реалізовувати власні ідеї.\r\nРобочий день з 9:00 до 18:00. Перерва на обід. П’ятиденний робочий тиждень\r\nОфіційне оформлення та відпустка.\r\nЩо зробити?\r\n\r\nЗаповнити Анкету і виконати Тестове завдання.\r\nПройти співбесіду.\r\nЗареєструйтесь на http://qa2.davintoo.com і Вам будуть призначені Анкета і Тестове завдання. Разом з ними Ви отримаєте допоміжну інформацію.\r\n\r\nПісля виконання Тестового завдання ми зв’яжемося з Вами.\r\n','ita.in.ua@gmail.com',NULL,'2017-06-02 11:09:04','2017-06-02 11:09:04',20000,1,0,1,'NULL'),(33,'Middle Java Script developer',61,'2','0000-00-00',1,'Компанія: Miratech   \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: Досвід роботи від 2 років, вища освіта\r\n\r\nThe customer is the world’s leading provider of customer service and contact center software, with more than 4,500 customers in 80 countries. Drawing on its more than 20 years of customer service innovation and experience. This project is uniquely positioned to help companies bring their people, insights, and customer channels together to effectively drive today’s customer conversation. Our software directs more than 100 million interactions every day, maximizing the value of customer engagement and differentiating the experience by driving personalization and multi-channel customer service, as well as extending customer service across the enterprise to optimize processes and performance of customer-facing employees.\r\n\r\nWe are looking for Middle Java Script developers (extension of the current teams)\r\n\r\nProject Tech Stack\r\n\r\nBackEnd: Java Core, Spring (Core Container, Web), Unit Testing, Any REST Client, Hibernate\\JPA, ElasticSearch, Kibana, Spark.\r\nFrontEnd: JavaScript, AMD, RequireJS, HTML\\CSS, jQuery, Underscore, Angular, Unit Testing, UI and Visualisation Libraries.\r\nTools: Maven, Mercurial/GIT, Jira.\r\n2−3+ years\' experience in software engineeringwith real project\r\nHire Requirements:\r\n\r\nExperience JavaScript, AMD, RequireJS, HTML\\CSS\r\nExperience in OOP, OOD, Functional Programming\r\nGood written and reading English skills\r\nWe are proposing:\r\n\r\nCompetitive salary with regular pay and yearly bonus\r\n24 days paid vacation and sick leave\r\nMedical Insurance\r\nGood working environment\r\nEnglish courses\r\nOpportunity to improve English skills by regular communication with native speakers and project team\r\n\r\nКонтактна особа: Recruiting department\r\nТелефон: (044) 206-40-98\r\nВеб-сайт: miratechgroup.com','ita.in.ua@gmail.com',NULL,'2017-06-03 10:28:00','2017-06-03 10:28:00',20000,1,0,1,'NULL'),(34,'General QA engineer (strong middle)',61,'2','0000-00-00',1,'Компанія: RIA.com   \r\nКонтактна особа: Милослава Черний\r\nТелефон: 0432 555 206\r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: Досвід роботи від 2 років\r\n\r\nЕлси ты нашол ошыбки в етом тексте, костантируем факт — у тебя есть задатки тестировщика)\r\nМы как раз ищем одного) Универсального, умного, талантливого. С желанием работать в крутой команде проекта AUTO.RIA.\r\n\r\nПридется учиться. Придется тестировать и ручками, и клавишами. Будьте внимательны — мы ищем человека-general-QA, знающего и manual, и automated testing.\r\n\r\nИ так.\r\n\r\nТребования:\r\n\r\nmanual testing — теория и практика, опыт bag-reporting\r\nопыт работы в ОС Linux — must have;\r\nосновы ООП и знание java (pre-intermediate);\r\nSelenium и системы контроля версий;\r\nплюсом будет опыт мобильного тестирования;\r\nжелание развиваться и изучать новые технологии.\r\nБОЛЬШАЯ ПРОСЬБА НЕ ПОДАВАТЬ РЕЗЮМЕ, ЕСЛИ НЕТ БАЗОВЫХ ЗНАНИЙ, УКАЗАННЫХ ВЫШЕ.\r\n\r\nусидчивость;\r\nориентация на результат;\r\nорганизованность;\r\nпунктуальность;\r\nвнимательность.\r\nУсловия работы:\r\n\r\nграфик — с 9:00 до 18:00 (после прохождения испытательного — «гибкое утро» — начало рабочего дня с 8:00/9:00 или 10:00);\r\nсоц. пакет, включающий оздоровление, проф. обучение, изучение английского языка;\r\nразвитие по системе грейдов;\r\nкорпоративы и тимбилдинги;\r\nвыездные кемпы.\r\nОбязанности:\r\n\r\nПокрытие проекта тестами: manual и automated;\r\nТест-кейсы, баг-репортинг;\r\nПроведения разных видов automated testing (редко — нагрузочное тестирование);\r\nПостоянная коммуникация с командой;\r\nРабота в команде по Agile.\r\nЖдем тебя, внимательный человек!','ita.in.ua@gmail.com',NULL,'2017-06-05 07:03:22','2017-06-05 07:03:22',14000,1,0,1,'NULL'),(35,'QA Automation engineer',61,'2','0000-00-00',1,'The customer is the world\'s leading provider of customer service and contact center software, with more than 4,500 customers in 80 countries. Drawing on its more than 20 years of customer service innovation and experience.\r\nThis project is uniquely positioned to help companies bring their people, insights, and customer channels together to effectively drive today’s customer conversation. Our software directs more than 100 million interactions every day, maximizing the value of customer engagement and differentiating the experience by driving personalization and multi-channel customer service, as well as extending customer service across the enterprise to optimize processes and performance of customer-facing employees.\r\n\r\nWe are looking for QA Automation engineer (extension of the current teams):\r\n\r\nProject Tech Stack\r\n- BackEnd: Java Core, Spring (Core Container, Web), Unit Testing, Any REST Client, Hibernate\\JPA, ElasticSearch, Kibana, Spark.\r\n- FrontEnd: JavaScript, AMD, RequireJS, HTML\\CSS, jQuery, Underscore, Angular, Unit Testing, UI and Visualisation Libraries.\r\n- Tools: Maven, Mercurial/GIT, Jira.\r\n\r\nMain responsibilities:\r\n- Developing and support of Automation test suite for continues delivery project.\r\n- Communication with remote team, test environment customization, working with cutting edge technology.\r\n\r\nSuccessful candidates should have:\r\n- Practical experience in test automation/design\r\n- Experience with test automation tools\r\n- Practical experience with Java and JavaScript\r\n- Practical experience with MSSQL, Oracle and Cassandra databases\r\n- Experience with Junit, Jenkins and JIRA\r\n- Knowledge in Docker is a benefit.\r\n- English - intermediate\r\n\r\nWe are offering:\r\n- Competitive salary with regular pay and yearly bonus\r\n- 24 days paid vacation and sick leave\r\n- Medical Insurance\r\n- Good working environment\r\n- English courses\r\n- Opportunity to improve English skills by regular communication with native speakers and project\r\n\r\nteam','ita.in.ua@gmail.com',NULL,'2017-06-05 07:28:03','2017-06-05 07:28:03',20000,1,0,1,'NULL'),(36,'Middle Java Develeoper',61,'2','0000-00-00',1,'<p>The customer is the world&#39;s leading provider of customer service and contact center software, with more than 4,500 customers in 80 countries. Drawing on its more than 20 years of customer service innovation and experience. This project is uniquely positioned to help companies bring their people, insights, and customer channels together to effectively drive today&rsquo;s customer conversation. Our software directs more than 100 million interactions every day, maximizing the value of customer engagement and differentiating the experience by driving personalization and multi-channel customer service, as well as extending customer service across the enterprise to optimize processes and performance of customer-facing employees. We are looking for Middle Java developer (extension of the current teams) Project Tech Stack - BackEnd: Java Core, Spring (Core Container, Web), Unit Testing, Any REST Client, Hibernate\\JPA, ElasticSearch, Kibana, Spark. - FrontEnd: JavaScript, AMD, RequireJS, HTML\\CSS, jQuery, Underscore, Angular, Unit Testing, UI and Visualisation Libraries. - Tools: Maven, Mercurial/GIT, Jira. Hire Requirements: - 2-3+ years&rsquo; experience in software engineeringwith real project - Experience Java Core, Spring (Core Container, Web) - Experience in OOP, OOD, Functional Programming - Good written and reading English skills We are offering: - Competitive salary with regular pay and yearly bonus - 24&nbsp;days paid vacation and sick leave - Medical Insurance - Good working environment - English courses -Opportunity to&nbsp;improve English skills by&nbsp;regular communication with native speakers and project team</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-06-07 09:29:16','2017-06-07 09:42:49',20000,1,0,1,'NULL'),(37,'Oracle BI, SQL Developer',61,'2','0000-00-00',1,'We are looking for a Oracle BI, SQL Developer to join our team on full-time basis. The project involves development of custom applications to handle the full range of work that arrives in a contact center.\r\n\r\nResponsibilities:\r\n- Oracle BI Integration\r\n- Create OBIEE metadata/reports and dashboards\r\n\r\nFormal Education &amp; Certification\r\n- Bachelor degree or equivalent in related field or equivalent experience.\r\n- Oracle certifications are a plus.\r\n\r\nKnowledge &amp; Experience \r\n- 3+ years IT experience.\r\n- Well versed in advanced query development and design using SQL.\r\n- Experience with one or more of the following: Oracle Business Intelligence Enterprise Edition (OBIEE),\r\n\r\nOracle BI Application, Oracle Daily Business Intelligence, Informatica Power Center, Oracle Data integrator (ODI), Oracle Warehouse Builder or a similar set of tools.\r\n- Experience with Oracle BI Applications, a plus.\r\n- Experience with MDX, XQuery, XML/A, a plus.\r\n- Experience with XML development and design including XML Schema, and XSLT are a plus\r\n- Experience with web services integration architectures including SOAP and REST, a plus\r\n- Knowledge of scripting languages including Korn/Bourne Shell, Perl, Python, Ruby, a plus\r\n- Experience with Java development is a plus','ita.in.ua@gmail.com',NULL,'2017-06-08 07:40:17','2017-06-08 07:40:17',20000,1,0,1,'NULL'),(38,'Junior PHP Developer',61,'2','0000-00-00',1,'Компанія: Ciklum \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: Досвід роботи від 2 років, вища освіта\r\n\r\nClient’s website: fbg.dk/\r\n\r\nFBG Medier A/S has a very long and proud history in the Danish society and has always had a big influence through all the national, regional and local titles. Next year the group has its 100 year birthday. FBG Medier A/S has both national and regional dailies; newspapers and magazines; more than 12 web sites, web services; online shop; several digital newsletters; mobile sites; digital newspapers and several apps for iOS, Android and Windows.\r\n\r\nOn behalf of FBG Medier A/S company, Ciklum is looking for dedicated and ambitious application developer to join Vinnitsa team on full-time basis.\r\n\r\nAn exciting and unique opportunity to become a part of Agile team that develops high-loaded websites, web applications and native apps for iOS and Android, using modern technologies for FBG Medier A/S — One of Denmarks most modern media companies and a market leader in producing content for print, web, web-TV and mobiles (mobile phones).\r\n\r\nAs a junior developer you have the motivation, talent and energy to learn and at the same time you have already been doing web development for some time. You don’t see obstacles only solutions. You are very interested in both backend and frontend development.\r\n\r\nResponsibilities:\r\nDevelop state of the art and compliant software through best practice and modern technology delivering exceptional value to the end user.\r\nBrowser and functional testing of websites and web application for desktop and mobile devices. This includes exploratory testing with a close cooperation with business as well as definition of test plans and test cases for iterative testing.\r\nBe business oriented and be able to mitigate understanding of business requirements\r\nRequirements:\r\n\r\nExperienced PHP developer with good OOP knowledge\r\nExperience with PHP frameworks, preferable YII v. 1.x and YII v. 2.0, MVC patterns\r\nStrong experience with MySQL\r\nExperience with RWD and mobile first technology\r\nExperience with and high interest in frontend development, e.g. HTML5, CSS3, JavaScript\r\nBeing familiar with agile development frameworks, e.g. SCRUM or XP\r\nFluent in English, both spoken and written\r\nAcademic IT education on master level in Computer Science or Engineering\r\nStrong interest in new technologies is a prerequisite for this position\r\nPersonal skills:\r\n\r\nWorking well autonomously, without close supervision, readiness to take responsibility\r\nActing as a Team player and having highly developed communication skills, both toward coprogrammers and project manager\r\nBeing committed to timely delivery of quality results\r\nInnovative in his/her work\r\nKnowledge seeking, updated with regards to latest SDK and technological directions in general\r\nUsing best practice for backend and development coding\r\nDocumenting his/her code and general functionality\r\nDesirable:\r\n\r\nExperience with and high interest in frontend development, e.g. HTML5, CSS3, JavaScript\r\nWhat’s in it for you?\r\n\r\nVariety of knowledge sharing, training and self-development opportunities\r\nCompetitive salary\r\nState of the art, cool, centrally located office with warm atmosphere which creates really good working conditions\r\nAbout Ciklum:Ciklum is a top-five global Software Engineering and Solutions Company. Our 3,000+ IT professionals are located in the offices and delivery centres in Ukraine, Belarus, Poland and Spain.\r\n\r\nAs Ciklum’s employee, you’ll have the unique possibility to communicate directly with the client when working in Extended Teams. Besides, Ciklum is the place to make your tech ideas tangible. The Vital Signs Monitor for the Children’s Cardiac Center as well as Smart Defibrillator, the winner of the IoT World Hackathon in the USA, are among the cool things Ciklumers have developed.\r\n\r\nCiklum is a technology partner for Google, Intel, Micron, and hundreds of world-known companies. We are looking forward to seeing you as a part of our team!','ita.in.ua@gmail.com',NULL,'2017-06-09 10:56:07','2017-06-09 10:56:07',20000,1,0,1,'NULL'),(39,'UI/UX designer',61,'2','0000-00-00',1,'Компанія: Ibud.ua   \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: Досвід роботи від 2 років, вища освіта\r\n\r\nibud.ua — це платформа з вибору та купівлі будівельних матеріалів.\r\n\r\nЩомісячна аудиторія платформи — 1 млн. відвідувачів. Партнери платформи — найбільші вітчизняні та іноземні виробники будівельних матеріалів, їх представництва та дилери, а також компанії, що реалізують товари для облаштування дому та саду.\r\n\r\nibud.ua — це продуктова IT-компанія, заснована в 2007 році. Офіси компанії знаходяться в Києві та Вінниці.\r\n\r\nПро проект: http://promo.ibud.ua/\r\n\r\nВ зв’язку із розширенням штату запрошуємо до своєї команди Web-дизайнера/ UI/UX-спеціаліста.\r\n\r\nНеобхідні навички:\r\n\r\nзнання та розуміння принципів дизайну інтерфейсів з урахуванням UX, e-commerce UX;\r\nзнання та розуміння принципів компонентного дизайну та responsive web design, а також практичний досвід розробки responsive web design;\r\nдосвід розробки складних інтерфейсів та дизайну e-commerce;\r\nзнання HTML5 та CSS3 (базовий рівень);\r\nплюсом буде досвід роботи з Google Analytics, Яндекс Метрика;\r\nплюсом буде досвід проведення А/Б тестування інтерфейсів;\r\nнаявність портфоліо — обов’язкова.\r\nОсобисті якості:\r\nстресостійкість, готовність виконувати роботу в стислі терміни;\r\nнавички тайм-менеджменту, уміння організовувати свою роботу та прогнозувати часозатрати;\r\nуміння працювати з великими обсягами інформації;\r\nвисокий рівень відповідальності;\r\nвміння працювати в команді;\r\nпунктуальність.\r\nОсновні завдання нової посади:\r\nрозробка дизайну нових та редизайн існуючих сторінок веб-сайтів та листів розсилок;\r\nрозробка дизайну нових та редизайн існуючих інтерфейсів з урахуванням UX;\r\nнаписання пояснюючих записок по реалізації та використанню розробленого дизайну / інтерфейсів;\r\nпроведення аналізу поведінки користувачів, А/Б-тестування користувацьких інтерфейсів з метою підвищення конверсії сторінок та форм.\r\nУмови роботи:\r\nробота в комфортному офісі в м. Вінниця;\r\nграфік роботи — Пн.-.Пт., з 9:00 до 18:00;\r\nоплачувана відпустка;\r\nвипробувальний термін — 3 місяці;\r\nдостойна заробітна плата за результатами співбесіди;\r\nможливість особистісного та професійного зростання в дружньому колективі однодумців.\r\nЧекаємо на Ваші резюме!','ita.in.ua@gmail.com',NULL,'2017-06-12 07:56:47','2017-06-12 07:56:47',20000,1,0,1,'NULL'),(40,'Web - developer',61,'2','0000-00-00',1,'<p>Компанія: Dynamica Labs Місто: Вінниця Вид зайнятості: дистанційна робота Вимоги: Досвід роботи від 1 року Ищем на долгосрочное сотрудничество Web Developer в компанию Dynamica Labs (Microsoft Silver Partner). Требования к соискателю: Обязательные Опыт работы не менее одного года с С#, JavaScript (DOM, jQuery), AJAX, JSON, Web services, API Хорошое знание MS SQL Пунктуальность и качество в выполнении работы Готовность и желание изучать сопутствующие технологии Знание английского на техническом уровне Нацеленность на результат и успешное закрытие проектов Условия работы: Англиская компания с офисом в Лондоне, Microsoft Partner Интегратор бизнес-систем Интерестные и разнообразные проекты Прозрачная схема начисления и оплаты труда Хорошая бонусная система за количесто часов и качество работы Молодой и профессиональный коллектив, возможен рост внутри компании Гибкий график работы, удаленная работа Постоянное обучение и развитие. Менторская поддержка со стороны старших менеджеров. Веб-сайт: www.dynamicalabs.com</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-06-13 09:22:32','2017-06-13 09:34:16',16000,1,0,1,'NULL'),(41,'Junior QA, QC Tester',61,'2','0000-00-00',1,'Компанія: Ubisoft Kiev Ukraine \r\nМісто: Київ\r\nВид зайнятості: повна зайнятість, готові взяти студента\r\n\r\nDo you want to see your name in credits of Ubisoft’s PC game? Do you think that PC is the future of gaming? Are you excited by the idea of communicating with IT professionals from all over the world? Are you obsessed by continuously improving what you’re doing? Are you passionate about technology and video games? Come and meet us!\r\n\r\nOur team in Kiev, together with teams from multiple foreign Ubisoft studios, works on PC and next-gen versions of future AAA Ubisoft titles. We are driven by our desire to ship and constantly take on greater challenges.\r\n\r\nIn case you feel confident that you match the vacancy below, please address us: [надіслати резюме]\r\n\r\nRequirements:\r\n\r\nAs part of Ubisoft’s QC Department, you will be the main player in a complex process of quality control.\r\n\r\nOne of your main responsibilities will be to make sure that millions of end-users will enjoy high quality and bug-free products. You will perform a detective work for the development team by using scientific and logic methods.\r\nYou will assure the fact that the product you are responsible of raises itself to the high internal and external standards of the company, by checking that a sum of well-defined criteria are fulfilled.\r\nComputers, video game consoles and controllers will be your main tools for this purpose.\r\nRequirements:\r\n\r\nPrevious experience in QA / QC is a plus;\r\nVery good written and verbal English skills;\r\nKnowledge of Microsoft Office (Word, Excel, Outlook);\r\nPatience and calm;\r\nGood interpersonal and communication skills;\r\nAbility to work as part of a team;\r\nCreativity, initiative and curiosity;\r\nPassion for games (knowledge of game styles and gaming experiences)\r\nBasic knowledge in the areas of PC gaming and hardware\r\nWhat we offer:\r\n\r\nInternational AAA game projects;\r\nAccess to cutting-edge hardware;\r\nExperience using hottest internally developed game engines;\r\nProficient and fun-to-work-with colleagues;\r\nOpportunity to travel abroad to meet your colleagues from other studios or to participate in international conferences;\r\nMedical / Life insurance;\r\nEnglish / French courses.\r\nDue to the high number of applications which we regularly receive, regrettably we only respond to successful candidates. If you haven’t heard from us within 14 days then please assume that you have not been selected on this occasion, but don’t worry. We’ll retain your details with the intention of keeping you informed of other suitable opportunities that may arise.\r\n\r\nКонтактна особа: Сергей Мелешко\r\nТелефон: (044) 584 49 28\r\nВеб-сайт:\r\nwww.ubisoftgroup.com\r\nUbisoft, one of the top companies specialized in game development worldwide offers you a great opportunity to join Kiev office of a stable, fast-developing company. We invite motivated, dynamic people who will be a great asset for our team. You will benefit from a competitive salary as well as profit from a learning environment allowing you to get hands-on experience with the opportunity to constantly collaborate with other Ubisoft studios all over the world.\r\n\r\nFollow us on Facebook: https://www.facebook.com/UbisoftKiev','ita.in.ua@gmail.com',NULL,'2017-06-14 10:08:45','2017-06-14 10:08:45',20000,1,0,1,'NULL'),(42,'Junior PHP developer',61,'2','0000-00-00',1,'Компанія: WebbyLab   \r\nМісто: Київ\r\nВид зайнятості: повна зайнятість, готові взяти студента\r\n\r\nКомпания WebbyLab (https://webbylab.com/), специализирующаяся на разработке сложных и высоконагруженных Web и мобильных приложений, открывает вакансию младшего PHP программиста.\r\n\r\nНеобходимые навыки:\r\n\r\nопыт работы с реляционными базами данных (MySQL или Postgres);\r\n\r\nвладение HTML, CSS, JavaScript;\r\n\r\nумение использовать ООП в PHP;\r\n\r\nпонимание концепции MVC;\r\n\r\nзнание ОС Linux.\r\n\r\nПлюсом будет:\r\n\r\nопыт работы в команде;\r\n\r\nумение работать с системами контроля версий;\r\n\r\nопыт работы с PHP7, Slim3, ORM/Propel2;\r\n\r\nзнание и понимание современной Web-разработки (ES6, webpack, eslint, React).\r\n\r\nМы предлагаем:\r\n\r\nсвободный график;\r\n\r\nработу в центре Киева (3 мин. от ст. м. Лыбедская — БЦ «Палладиум Сити»)\r\n\r\nиспытательный срок 2 месяца;\r\n\r\nдружный коллектив;\r\n\r\nоплачиваемый отпуск 4 недели;\r\n\r\nИ ещё\r\n\r\nзаработная плата — по результатам собеседования;\r\n\r\nогромным плюсом будет, если в Вашем резюме есть ссылки на реальные проекты и/или на исходные коды, расположенные на одном из хостингов проектов (A la GitHub, Bitbucket, SourceForge и т. п.).\r\n\r\nВАЖНО!\r\n\r\nЧтобы Вас пригласили на собеседование, вместе с резюме отправьте решение тестового задания:\r\n\r\nНаписать класс Cat, который наследуется от класcа Animal. Класс Animal имеет метод getName (name можно передать в конструктор). Класс Cat имеет метод meow (возвращает строку «Cat {catname} is sayig meow».\r\n\r\nПример использования:\r\n\r\n$cat = new Cat (\'garfield\');\r\n\r\n$cat->getName () === \'garfield\' // true;\r\n\r\n$cat->meow () === \'Cat garfield is saying meow\' // true;\r\n\r\nПрисылайте Ваше резюме с тестовым заданием. Без выполненного задания резюме не рассматриваются!\r\n\r\nЕсли Ваше резюме заинтересует нас, то мы обязательно свяжемся с Вами в течение 10 дней.\r\n\r\nКонтактна особа: Лиана Патлякевич\r\nТелефон: +38 (044) 599-10-51; +38 (097) 975-10-51\r\nВеб-сайт: webbylab.com\r\n','ita.in.ua@gmail.com',NULL,'2017-06-15 09:52:41','2017-06-15 09:52:41',20000,1,0,1,'NULL'),(43,'Front-end Developer',61,'2','0000-00-00',1,'Компанія: IT Room \r\nКонтактна особа: Анастасия \r\nТелефон: 0934070504\r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: Досвід роботи від 2 років\r\n\r\nТребования:\r\n\r\nОпыт работы с JavaScript больше 2-х летAngular 2 или React — опыт не менее одного года\r\n\r\nЗнание ES6Понимание MVCBootstrapОпыт работы с Gulp, Bower, npmНавыки работы с GitПлюсом будет:Node.js, Socket.ioRedisCSSSASS/SCSS, LESS\r\n\r\nУсловия работы:\r\n\r\nПредлагаем комфортные условия работы в офисе на Подолье, достойную заработную плату и отличный колектив в придачу!\r\n\r\nРабочий график с 9:00 до 18:00. Суббота, воскресенье выходные.\r\n\r\nIT Room молодая и активно развивающаяся IT компания из Винницы, специализирующаяся на разработке качественного ПО для веб, десктоп и мобильных платформ.\r\n\r\nВ связи с постоянным ростом и увеличением потока проектов, а также запуском собственных стартапов, нуждаемся в квалицированных кадрах.\r\n\r\nВ нашей команде найдется место как для новичков, желающих развиваться, так и для опытных синиоров, способных вести комплексные долгосрочные проекты.','ita.in.ua@gmail.com',NULL,'2017-06-16 17:21:51','2017-06-16 17:21:51',20000,1,0,1,'NULL'),(44,'UX/UI designer',61,'2','0000-00-00',1,'Компанія: TapOk   \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: досвід роботи від 2 років\r\n\r\nПриглашаем в свою команду опытного UX/UI designer-а\r\n\r\nТребования:\r\n\r\nработа с ТЗ, создание скетчей, прототипов интерфейсов, графических решений;\r\nзнание типографики, актуальных тенденций в web и mobile, чувство стиля;\r\nопыт в юзабилити, прототипировании и разработке интерфейсов;\r\nпрофессиональный уровень владения графическими редакторами (Sketch, Photoshop, Illustrator);\r\nнавыки проектирования масштабируемых, адаптивных интерфейсов;\r\nуверенные знания и навыки работы в современной веб-индустрии, понимание принципов работы HTML‚ CSS, JavaScript;\r\nбыть в курсе мировых тенденций дизайна;\r\nтворческий подход к работе, желание совершенствовать свои знания и умения.\r\nПлюсом будет опыт создания:\r\n\r\nрекламных креативов;\r\nинфорграфики;\r\nиллюстраций.\r\nВаши задачи:\r\n\r\nсоздание комфортной среды взаимодействия интерфейса и пользователя;\r\nпроектирование и дизайн интерфейсов;\r\nдизайн как с нуля, так и в рамках существующих фирменных стилей;\r\nграфический дизайн;\r\nвзаимодействие с командой разработчиков и маркетологов;\r\nработа в команде по Agile (Kanban) методологии.\r\nМы предлагаем Вам:\r\n\r\nработу в динамично развивающейся компании и перспективных сегментах;\r\nмолодой, дружный и сильный коллектив единомышленников;\r\nдостойную заработную плату (по результатам собеседования, привязка к USD);\r\nудобное месторасположение комфортного офиса класса «А»;\\\r\nкорпоративную мобильную связь;\r\nпитание, включая полноценный обед (чай, кофе, сладости, фрукты, а также прочие плюшки и вкусности за счёт компании:)\r\nграфик работы —5/2, 09.00−18.00 или с 10.00−19.00;\r\nпосещение тематических мероприятий, обучение и тренинги за счет компании.\r\n\r\nВАЖНО! Полная занятость в нашей команде —НЕ удаленная!\r\nРезюме без портфолио рассматриваться не будут!\r\nЖдем Ваши резюме здесь [надіслати резюме]','ita.in.ua@gmail.com',NULL,'2017-06-19 11:08:16','2017-06-19 11:08:16',20000,1,0,1,'NULL'),(45,'Web-developer',61,'2','0000-00-00',1,'Компанія: WebLiana \r\nКонтактна особа: Майя Назаренко\r\nТелефон: 098 781 24 28\r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: досвід роботи від 2 років, вища освіта\r\n\r\nТребования:\r\n- Знание HTML5, CSS3, JavaScript (jQuery, Ajax), PHP, MySQL, Smarty\r\n- Умение разбираться в чужом коде и писать свой так, чтобы его понимали коллеги. Документирование проектов.\r\n- Адаптивная верстка из psd-макетов;\r\n-Знание английского языка на среднем уровне. Необходимо уметь читать англоязычную документацию, разбираться с API сторонних сервисов, библиотек.\r\n- Использование Git;\r\n\r\nОбязанности:\r\n- Разработка, развитие, оптимизация web-сайтов на основе СMS: MODX, Wordpress, PrestaShop;\r\n- Адаптивная верстка;\r\n- Своевременность выполнения работы;\r\n- Работа в команде;\r\n\r\nПриветствуется:\r\n- Хорошее знание английского языка;\r\n- Знание фреймворков;\r\n- Опыт работы с шаблонизатором Smarty;\r\n- Опыт создания собственных решений на чистом PHP, JavaScript;\r\n- Наличие портфолио или опыт участия в проектах;\r\n\r\nУсловия:\r\n- Работа в Виннице;\r\n- Гибкий график;','ita.in.ua@gmail.com',NULL,'2017-06-20 07:31:36','2017-06-20 07:31:36',20000,1,0,1,'NULL'),(46,'PHP Developer (junior)',61,'2','0000-00-00',8000,'Компанія:YarMel   \r\nКонтактна особа:Майовець Василь\r\nТелефон:098 262 36 30\r\nМісто:Львів\r\nВид зайнятості:повна зайнятість\r\nВимоги: досвід роботи від 1 року\r\n\r\nУ зв’язку із розширенням компанії та відкритті нових напрямків і проектів, компанія оголошує конкурс на вакансію PHP програміста.\r\n\r\nШукаємо талановитих, працьовитих, та відповідальних.\r\n\r\nВимоги до кандидата:\r\n- вміння адекватно оцінювати терміни виконання завдань;\r\n- знання української та російської мов, знання англійської на рівні читаня документації;\r\n- Пунктуальність;\r\n\r\nВимоги до знань:\r\n- Досвід роботи із сучасними PHP Frameworks\r\n- PHP 5/7 (ООП);\r\n- знання PHP паттернів;\r\n- знання сучасних PHP фреймворків та принципів їх роботи;\r\n- зняння PostgreSQL;\r\n- зняння Ajax / jQuery;\r\n- зняння XML;\r\n- знання HTML5/CSS/LESS;\r\n- GIT, BOWER, GULP, COMPOSER! \r\nРезюме програмістів із знаннями Phalcon PHP будуть розглядатись першочергово.\r\n\r\nОбов’язки:\r\n- створення нового та вдосконалення існуючого коду;\r\n- розробка модульних компонентів;\r\n- створення документації по зробленій роботі;\r\n\r\nПропонуємо:\r\n- Участь в цікавому проекті;\r\n- Можливість вдосконалюватись;\r\n- Офіційне працевлаштування;\r\n\r\nГрафік роботи:\r\n- графік роботи: з 9:30 до 18:30 (40 годинний робочий тиждень)','ita.in.ua@gmail.com',NULL,'2017-06-21 08:17:34','2017-06-21 08:17:34',20000,1,0,1,'NULL'),(47,'Front-end Developer',61,'2','0000-00-00',1,'<p>Компанія: Astound Commerce Місто: Вінниця Вид зайнятості: повна зайнятість Вимоги: досвід роботи від 2 років, вища освіта Who we are and what we do: Astound Commerce is a global ecommerce agency headquartered in the US. With over 600 professionals in 7 countries, we are one of the world&rsquo;s largest teams of ecommerce experts. Top brands like Adidas, Puma, Versace, Jimmy Choo, Tommy Hilfiger, Hugo Boss and Crocs are among our clients. Company centers in Eastern Europe are focused on the development of ecommerce solutions on Salesforce Commerce Cloud (Demandware), Hybris, IBM WebSphere Commerce, Intershop, Kibo, Magento, NetSuite. Brief description of the open position The Frontend Developer will be part of a high-performance feature driven development team responsible for building complex ecommerce solutions. You must have a proven track record of solving various business and technical problems while taking responsibility for meeting business objectives. This job requires solid technical skills to provide coding expertise throughout the entire software development lifecycle. You should have expertise with software development lifecycle methodologies, solid experience and knowledge of web development, and use of standard design and development tools. You will: Work with Development Lead and project leads in understanding business needs, defining technical issues, and proposing solutions; Help ensure accuracy and completeness of technical documentation and team communications; Analyze business and technical specifications/requirements and develop enterprise-level ecommerce solutions; Work in collaboration with Graphic Designers &amp; UX Designers to turn their vision into functional HTML templates; Work with web development team to ensure proper implementation of website&rsquo;s functionality; Provide updates to effort estimates and status of assigned tasks, and identify development-related risks on assigned projects; Provide the best technical solutions for tasks utilizing the best practices and design patterns; Support and help developers come up with the best technical solutions; Provide recommendations to Development Lead and functional managers on ways to improve processes, systems, tools and role definitions based on program or project-specific experience; Actively contribute to continuous improvements to development methodology and underlying processes; Help with managing projects through making suggestions for design design, development and QA processes; Participate in project team meetings and brainstorming activities related to the project issues. You have: 3+ year of frontend development; Expert level hand-coding in CSS and HTML (including HTML5, CSS3); Experience with frontend grid systems; Experience with preprocessors (LESS, Sass, etc.); Working knowledge of JavaScript, and related libraries in cross-platform development; Experience with task runners (Grunt, Gulp, etc.); Base knowledge of accessibility, SEO and UX aspects of frontend development; Experience with client-side code performance optimization, debugging and debugging tools (Firebug, etc.); Experience with responsive web design approach and/or mobile solutions; Common understanding of cross-browser/platform issues; Knowledge of Adobe Photoshop; Must be an independent, self-motivated team player that is meticulous and methodical in creating solutions; Ability to learn and adapt quickly in a dynamic environment; Pre-intermediate spoken and written English communication skills. Good to have: Personal portfolio of completed projects/products or link to GitHub/CodePen/JSFiddle/StackOverflow etc. accounts; Experience with CMS; Experience working in geographically distributed teams; Experience in developing multiple ecommerce solutions; Analytical and time management skills; Excellent written and verbal communication skills, as exemplified by writing clear technical specifications, documentation of knowledge, and effective intra- and inter-group communications. We offer: Knowledgebase of the world&rsquo;s largest ecommerce delivery team; Trainings and certifications; A constant inflow of ecommerce projects with global outreach; Well set SDLC process with use of Agile, Scrum, Waterfall depending on a project; Coaching and reviews to support your career development; Internal/external engineering and business training and conferences and time for self-education; Extensive technical library with option to order books and English classes; A network-style culture with geographically distributed teams, easy communications and access to clients; Possible international on-site visits; Work-life balance approach and healthy lifestyle programs.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-06-23 09:53:33','2017-06-23 09:55:06',20000,1,0,1,'NULL'),(48,'Junior/Middle PHP Developer',61,'2','0000-00-00',1,'Компанія: WSG   \r\nКонтактна особа: Константин\r\nТелефон: 067 640-17-40\r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість, дистанційна робота, готові взяти студента\r\nВимоги: досвід роботи від 2 років, вища освіта\r\n\r\nIT компании требуется разработчик PHP (Yii Framework) / Back-end Developer\r\n\r\nТребования профессиональные:\r\n- знание и опыт работы с PHP5 на высоком уровне\r\n- знания и понимание ООП / MVC на высоком уровне\r\n- опыт работы с MVC-фреймворками (обязателен опыт работы с Yii1 / Yii2 Framework, опыт работы с Zend, Symfony, CodeIgniter, Kohana и другими будет несомненным преимуществом)\r\n- уверенное знание SQL (MySQL и/или PostgreSQL — создание/изменение схем, транзакции, множественные JOIN, внешние ключи, индексы, способность оптимизировать запросы)\r\n- уверенное знание JavaScript (обязательно опыт работы с jQuery и с AJAX)\r\n- уверенное владение системами контроля версий Git\r\n- опыт работы с Jira / Redmine\r\n- опыт работы с Twig\r\n- знание HTML (приветствуется HTML5), CSS / SCSS\r\nбазовые знания HTML / CSS-фреймворков — Foundation, Twitter Bootstrap\r\n- базовое знание UNIX-подобных ОС (базовые команды консоли,\r\nперезапуск сервисов, написание элементарных bash-скриптов)\r\n- приветствуется опыт работы с web-серверами (Apache, nginx)\r\n- приветствуется опыт работы по TDD, Scrum\r\n- опыт работы с PHPUnit, Selenium, Codeception\r\n- приветствуется опыт работы с высоко нагруженными проектами -\r\n (оптимизация кода и запросов, кеширование, разбитие на сервисы и т. д.)\r\n\r\nТребования личные :\r\n- любовь к своему делу\r\n- высокая личная ответственность\r\n- желание создавать качественные программные продукты\r\n- здоровые амбиции\r\n- желание самосовершенствования в профессиональном и личном плане\r\n- ориентация на результат\r\n\r\nЧто мы предлагаем взамен :\r\n- сложные и интересные проекты\r\n- достойную з/п (по результатам собеседования)\r\n- высокие требования к качеству кода и