 write test cases, bug reports and test documentation;\r\n• Understanding of Agile methodology\r\n• Must have the ability to work independently in a fast-paced environment.\r\n• Ability to learn new tools & technologies quickly is a must\r\n• English level — pre-intermediate level\r\n\r\nWill be a plus:\r\n• Experience in mobile testing (iOS and Android)\r\n• Experience in Version Control System (SVN, GIT, etc.);\r\n\r\nResponsibility:\r\n• Perform web applications testing\r\n• Perform mobile application testing (iOS and Android)\r\n• Perform manual functional and regression testing\r\n• Test design: preparing Test Plan, Test Scenarios, Test Cases\r\n• Defect Tracking\r\n• Working with requirements and technical documentation\r\n\r\nWe offer:\r\n• Friendly and highly professional team;\r\n• The competitive salary depending on your skills;\r\n• 18 working days paid vacation;\r\n• Flexible schedule;\r\n• Modern Office;\r\n• Professional & personal growth.\r\n\r\nКонтактна особа: Anatoliy Halochkin\r\nВеб-сайт: loomlogic.com/','ita.in.ua@gmail.com',NULL,'2017-07-10 07:40:38','2017-07-10 07:40:38',20000,1,0,1,'NULL'),(55,'Ruby on Rails Developer',61,'2','0000-00-00',1,'Компанія: Softhouse   \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість, неповна зайнятість, дистанційна робота\r\nВимоги: досвід роботи від 2 років, вища освіта\r\n\r\nИщем программиста Ruby on Rails для работы над проектами.\r\nРабота как на удаленной основе так и можно в офисе г. Винница\r\n\r\nОбязательные требования:\r\n- отличное знание Ruby для веб от двух лет.\r\n- отличное знание JavaScript, HTML, CSS\r\n- знание фреймворка hobo будет плюсом.\r\n- английский: чтение спецификаций и документации\r\n- ЗП в $\r\nЖдем Ваших резюме.\r\n\r\n\r\nПро нас:\r\nIT компания Softhousegroup, больше 10 -ти лет на рынке. Офисы в Канаде и Дании.\r\nРаботаем с зарубежными проектами.','ita.in.ua@gmail.com',NULL,'2017-07-11 09:38:10','2017-07-11 09:38:10',20000,1,0,1,'NULL'),(56,'C++ Developer',68,'2','0000-00-00',1,'Компанія: Miratech   \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість\r\nВимоги: досвід роботи від 2 років\r\n\r\nWe are looking for a C++ Developer who will take a part in a new Sweden project. Our client is a software development company that produces the software related to account management, account receivable, invoice purchasing, factoring and debt collection — all-in-one or standalone.\r\n\r\nResponsibilities:\r\n- Requirements analysis and estimation of implementation\r\n- Development of software with using of C++\r\n- Preparation of SQL queries for required data fetching\r\n\r\nTechnical requirements:\r\n- Collection industry subject-matter expertise is required\r\n- 3−5 years\' experience in software engineering as a C++ developer\r\n\r\nExtensive knowledge of:\r\n- Microsoft Visual Studio\r\n- Standard Template Library (STL)\r\n- SQL\r\n- Multithreading \r\n- multi-language components\r\n- client-server\r\n- SVN, GIT, TFS (at least one of this)\r\n\r\nExperience (desirable) with: MS SQL DB, C#\r\nBase-level skills in the following: HTML, CSS, XML\r\nKnowledge of SOAP and OLE DB would be a plus\r\nEnglish: upper intermediate.','ita.in.ua@gmail.com',NULL,'2017-07-12 12:14:10','2017-07-12 12:14:10',20000,1,0,1,'NULL'),(57,'QA Engineer',69,'2','0000-00-00',1,'Мы — компания «RIA.com». Мы — молоды (средний возраст сотрудников — 25 лет), но достаточно зрелые, чтобы быть лидерами в Украине. С нами знаком каждый третий украинский пользователь Интернета. AUTO.RIA, DOM.RIA, RIA.com, MARKET.RIA приносят пользу всем, помогая продавать и покупать автомобили, недвижимость, товары.\r\n\r\nМы готовы принять в свою команду специалиста по ручному тестированию!\r\n\r\nТРЕБОВАНИЯ:\r\n- знание основных принципов, методологий и методов проведения -\r\nтестирования;\r\n- составление тестовой документации — планов тестирования, тест-кейсов и т.д;\r\n- умение работать в команде;\r\n- аналитический состав ума;\r\n- усидчивость;\r\n- скрупулезность;\r\n- настойчивость.\r\n\r\nУсловия работы:\r\n- стабильная заработная плата (7500 на испытательный период) -\r\n- после прохождения — 9000 грн.\r\n- нормированный 8 — часовой рабочий день, пн-пт (после прохождения испытательного периода возможно «гибкое утро» — начало рабочего дня с 8−9−10:00);\r\n- 46 дней оплачиваемого отпуска!\r\n- социальный пакет: досуг, корпоративы, тимбилдинги с кучей ентертеймента:)\r\n- индивидуальный подход в развитии сотрудника как профессионала: - внутреннее обучение, доступ к корпоративной библиотеке, обучение на всеукраинских и международных Интернет-конференциях, мастер-классах, тренингах;\r\n\r\nОБЯЗАННОСТИ:\r\n- анализ требований к мобильным приложениям составление и сопровождение тест-кейсов;\r\n- составление баг-репортов.\r\n- тестирование мобильных приложений.','ita.in.ua@gmail.com',NULL,'2017-07-21 10:28:30','2017-07-21 10:28:30',9000,1,0,1,'NULL'),(58,'UX/UI designer',70,'2','0000-00-00',1,'<p>Компанія: Gemicle Місто: Вінниця Вид зайнятості: повна зайнятість Вимоги: досвід роботи від 1 року Required skills: - Опыт проектирования интерфейсов (UХ Design &mdash; от 1 года); - Понимание принципов UX; - Умение генерировать идеи; - Навыки в разработки информационной архитектуре; - Понимание возможностей и ограничений верстки (HTML5, CSS3); - Владение основными векторными и растровыми редакторам; - Pixel Perfect в работах; - Портфолио обязательно. We offer: - Возможность реализовывать идеи; - Работа с опытными и профессиональными коллегами; - Официальное оформление, оплачиваемый отпуск и больничный; - Праздники, тимбилдинги и много разных активностей; - Высокую заработную плату. Responsibilities: В обязанности на позиции UX/UI-дизайнера будет входить проектирование интерфейсов для B2C/B2B/SaaS-продуктов (мобильных и веб-приложений). Также предстоит взаимодействовать с командой разработчиков на всех этапах создания продукта: определять наиболее эффективные дизайнерские решения с учетом бизнес-требований клиента.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-07-22 10:18:27','2017-07-22 10:18:53',18000,1,0,1,'NULL'),(59,'Android Developer',71,'2','0000-00-00',1,'We are the company of professionals who have outstanding IT expertise and enjoy working together for more than 15 years.\r\nThe solutions we created vary from home-oriented educational software to huge multi-tiered distributed systems; from low-level embedded apps to fancy Web sites; from intelligent speech processing to advanced real-time analytics. For today, our technology focus is Enterprise Solutions, Mobile / Embedded Development and Web Design.\r\n\r\nRequirements:\r\n- 1+ year experience as Android Developer\r\n- Experience with Java, Android SDK, REST API\r\n- Experience with Git\r\n- Strong Object Oriented Programming understanding\r\n\r\nResponsibilities:\r\n- Design, development and support of existing Android applications\r\n- Direct communication with QA team and customers\r\n\r\nWe offer:\r\n- Decent compensation\r\n- Friendly environment and comfortable working conditions\r\n- 24-day paid vacation and 100% paid sick leave\r\n- Professional, language and soft skills training\r\n- Health insurance coverage: individual and family\r\n- Fitness plan','ita.in.ua@gmail.com',NULL,'2017-07-24 07:51:52','2017-07-24 07:51:52',16000,1,0,1,'NULL'),(60,'Junior Developer (Trainee)',72,'2','0000-00-00',1,'<p>Requirements: - Technical education (related to computer science) - Understanding of OOP - Knowledge of basic pattern design - Good Algorithmic knowledge - Good theoretical knowledge of Databases - Understanding of the basic principles of networks - English Intermediate level or above We offer: - Professional and career growth - Paid trainings, conferences - Paid vacations and sick leave - Friendly atmosphere - Flexible working schedule - Corporate and team building events, juices, cookies, fruits &amp; vegetables and much more&hellip; - Comfortable office About us: We are specializing in delivering customized services and solutions, using only trendy and modern technologies in the product development. Now are looking for talented junior/Trainee developers who desire to grow professionally and improve on their skills and technical know-how while working with a professional and friendly team.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-07-25 13:59:43','2017-07-25 14:00:07',10000,1,0,1,'NULL'),(61,'Project Manager',73,'2','0000-00-00',1,'Вид зайнятості: повна зайнятість, дистанційна робота\r\nВимоги: досвід роботи від 1 року, вища освіта\r\n\r\nWeb Design Sun®, established in 2012, provides huge range of different web development solutions.\r\n\r\nWe are a friendly, well-knit team of devoted and results-oriented professionals. The founders of the company have changed multiple job places themselves before they established the company. Probably, at the dawn of our work we didn’t know how to do everything right, but we did know what we shouldn’t do. We always work as a single whole and never leave a teammate one on one with a problem. We don’t have a comfortable office with cheap coffee and cookies, but we surely have the final goals, we have numerous achievements that we take pride in. What is the most important, our team is like a real big family where everyone supports and encourages each other!\r\n\r\nOur company is currently looking for a Project Wizard (Project Manager)\r\n\r\nRequirements:\r\n- Knowledge of English on Upper-Intermediate/Advanced level (Reading/Writing/Speaking);\r\n- Real experience in project management for at least 6 months!\r\n- Experience in project management to the foreign clients;\r\n- Good understanding of the web development process;\r\n- Knowledge of software development methodology / -ies;\r\n- Basic knowledge of Adobe Photoshop / Adobe Illustrator / Sketch;\r\n- A well-functioning desktop or laptop with high-speed Internet connection.\r\n\r\nWill be a plus:\r\n- Providing own clients\' database;\r\n- Participation in students\' exchange programs or internship/work abroad;\r\n- Basic knowledge of programming languages;\r\n- Experience in IT sales and product sales to the foreign clients;\r\n- Knowledge of any other language used in Western Europe.\r\n\r\nDuties:\r\n- Management of Outsourced Web Development (Web Sites, Web Applications, Social Networks, eCommerce Platforms, Landing Pages);\r\n- Communicating with clients, analysis of their needs, primary interaction;\r\n- Participation in estimation of a project cost;\r\n- Full arrangement of the relations with the Client;\r\n- Control over the Project Development.\r\n\r\nWork conditions:\r\n- Work in the best team!\r\n- Remote full-time work (no freelance, no part-time);\r\n- Loyal and friendly management;\r\n- A total absence of bureaucracy;\r\n- Chances for professional growth;\r\n- Well-established online office;\r\n- Really flexible schedule, so you can easily combine job with your private life.\r\n\r\nCompensation package:\r\n- Salary mostly based on commission of contract, basic fixed rate is included;\r\n- Smooth start;\r\n- Salary is paid according to the actual currency exchange rates;\r\n- Bonuses.\r\n\r\nAdditionally:\r\n- You will work with the principal Ask-Anyone-Anytime;\r\n- Support of the PM and Dev departments.\r\n\r\nExtra bonuses:\r\n- Refill of your mobile account;\r\n- Coverage of Internet costs;\r\n- Advanced training within the company;\r\n- Business trips to seminars and workshops;\r\n- Ability to work in co-workings in different Ukrainian cities;\r\n- Corporate parties.\r\n\r\nAttention! Send us your resume ONLY WITH PHOTO!\r\nAlso, you can fill in the form on our website\r\nhttp://www.webdesignsun.com/join-the-team/','contact@webdesignsun.com',NULL,'2017-07-26 09:57:14','2017-07-26 09:57:14',16000,1,0,1,'NULL'),(62,'PHP developer',61,'2','0000-00-00',1,'Компанія: IncoreSoft   \r\nМісто: Вінниця\r\nВид зайнятості: повна зайнятість, готові взяти студента\r\nВимоги: досвід роботи від 2 років, вища освіта\r\n\r\nИщем PHP-разработчика в команду.\r\nСтабильно развивающаяся компания, находится на рынке IT-индустрии более 5 лет. Более подробно о проектах компании Вы узнаете на собеседовании в нашем офисе.\r\n\r\nТребования:\r\n- PHP от 2−2.5 года, знание принципов OOП\r\n- JavaScript/jQuery\r\n- Умение верстать\r\n- MySQL / noSQL\r\n- английский на уровне\r\n- High load\r\n- знание Unix-подобных систем (Ubuntu)\r\n- Nginx / Apache\r\n- Jira\r\n- основные принципы работы с командной строкой\r\n- самостоятельность в принятии решений\r\n\r\nБудет плюсом:\r\n- Опыт разработки проектов под SmartTV/Roku\r\n\r\nОбязанности:\r\n- разработка и сопровождение PHP web-решений (сайты и сервисы)\r\nинтеграция web-решений с другими подсистемами (базы данных, сетевое оборудование, датчики и пр.)\r\n- участие в общем и техническом развитии команды\r\n\r\nУсловия работы:\r\n- полный рабочий день, обсуждаемый график работы\r\n- оплачиваемый отпуск и больничные\r\n- обустройство рабочего места\r\n- молодой дружный коллектив\r\n- интересные мероприятия и корпоративные праздники\r\n- Ссылки на аккаунты в GitHub, LinkedIn, oDesk помогут нам узнать больше о Вас и принять правильное решение.','ita.in.ua@gmail.com',NULL,'2017-07-27 10:01:00','2017-07-27 10:01:00',14000,1,0,1,'NULL'),(63,'QA Engineer',75,'2','0000-00-00',1,'<p>Who we are. SteelKiwi is a US outsourcing company with two development centers in two beautiful Ukrainian cities: Odessa and Vinnytsia. Our products are modern mobile and web applications. We use Python/Django stack as a core of web development and all possible front- end tools to make our products shine. We are always looking to expand our team with people who share the same passion for delivering the best results and for resting together after the effective performance. Are you ready? What do we need? - experience in testing several projects at the same time - experience in testing of Android and iOS mobile applications - experience in testing modern web applications and clear understanding of their architecture - knowledge and understanding of the overall testing process - understanding of Agile/Scrum development methodologies and the role of the QA expert in them - strong desire to grow and improve in the field of Quality Assurance - good grasp of the IT industry and applications testing in particular - solid analytical skills and good sequential thinker - English- intermediate What should you do? - manual testing of web and mobile applications - client&rsquo;s requirements analysis and creation of test cases/check-lists - conducting test sessions - providing a description of located bugs and submitting them to the issue tracker - ability to cooperate with the development team, Project Manager and the client - leading demo to the customer - work with Postman, JIRA, Jmeter, ZAP Our benefits: - talented colleagues with a good sense of humor - the exchange of experience - the feeling of the importance of what you do - growth prospects for this position - free of charge English classes, paid events attendance - purchase the necessary software, release-party, pizza-party - periodic review of the salary every six months - purchase a laptop or PC Interview stages: Stage 1. Interview with HR (Skype or in person, if you want to see our office). Stage 2. Test task (no restrictions on the implementation, but the faster you do &mdash; the faster we`ll give you feedback). Stage 3. Interview with the head of the department (Tech Lead). And then we make a decision within 5 days (approximately). If you found yourself in these lines &mdash; we are looking forward to your CV.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-07-28 07:48:48','2017-07-28 07:49:08',14000,1,0,1,'NULL'),(64,'Ruby on Rails developer',76,'2','0000-00-00',1,'<p>Вид зайнятості: повна зайнятість. Вимоги: В зв&rsquo;язку з відкриттям повноцінного R&amp;D center у м.Вінниці, ІТ компанія Addeesoft шукає Ruby on Rails розробників всіх рівнів (junior, middle, senior) на різноманітні проекти, переважно у сфері фінансових, аграрних технологій та Smart city. Для junior developers &mdash; це прекрасна можливість розпочати кар&#39;єру, а для middle та senior &mdash; вийти на новий рівень Team lead або Project manager. Ми швидко розвиваємося, і прагнемо бачити в нашій команді таких самих людей! Буде плюсом: - досвід роботи та рекомендації; - знання англійської; Умови роботи: - гідна та вчасна оплата вашої праці (залежно від співбесіди і проекту); - зручний офіс у центрі міста (коворкінг); - постійна робота (нові проекти, залежно від Вашого бажання працювати); - можливість розвитку, як кар&#39;єрного, так і особистого; - підтримка Ваших ідей (стартапів). Обов&rsquo;язки: - Найголовніше &mdash; це якісне виконання завдань у відповідні строки. Про проект: - Проекти різного спрямування (переважно фінтех, агротех та смарт сіті) різної складності. - Більшість проектів потрібно реалізовувати з нуля.</p>\r\n','az@addeesoft.com',NULL,'2017-07-31 10:56:37','2017-07-31 10:57:09',14000,1,0,1,'NULL'),(65,'Frontend developer',77,'9','0000-00-00',1,'Вид зайнятості: повна зайнятість, готові взяти студента\r\nВимоги: досвід роботи від 1 року\r\n\r\nНаша компания (mijndev.com) занимается разработкой и поддержкой существующих Веб проектов. Клиенты компании — компании из Нидерландов, Германии, Бельгии, США, Маврикия.\r\n\r\nИщем программистов на frontend разработку, берем так же студентов на неполный рабочий день, возможна удаленная работа.\r\n\r\nНеобходимы твердые знания:\r\n- JavaScript ES6, HTML5, CSS3;\r\n- Git;\r\n- Английский на уровне переписки с менеджером — обязательно!;\r\n\r\nКрайне желательно:\r\n- Опыт работы с Cordova / React Native;\r\n- Angular.JS;\r\n- Кросс-браузерная, кросс-платформенная вёрстка;\r\n- PHP (Laravel, Symphony), MySQL;\r\n- GitHub, Jira, Linux, grunt (gulp), bower.\r\n\r\nЧто мы предлагаем:\r\n- Кофе, печеньки, дартс, дружелюбная атмосфера, пятничное пиво за счет компании;\r\n- Работа в в офисе в центре города, в Виннице;\r\n- Государственные праздники — выходные;\r\n- 20 отпускных в год;\r\n- Возможность гибкого графика;\r\n- Работа с европейскими заказчиками.\r\n\r\nИспытательный срок — 4 недели.\r\nНачальная зарплата $500−1000 по результатам испытательного срока в гривневом эквиваленте. Зарплата повышается с ростом производительности. Возможна система бонусов.','contact@mijndev.com',NULL,'2017-08-02 09:40:31','2017-08-02 09:40:31',25000,1,0,1,'NULL'),(66,'QA Automation engineer',78,'2','0000-00-00',1,'Обязанности:\r\n- Написание TestCase\r\n- Тестирование ПО\r\n- Ведение задач и регистрация багов в BugTracking System\r\n\r\nТребования:\r\n- Высшее образование (профильное)\r\n- Опыт работы в качестве тестировщика ПО от 2-х лет\r\n- Знание какого-либо языка программирования и использование его в создании автоматизированных тестов (Java, C#, Python)\r\n- будет плюсом опыт работы с БД и знание любого скриптового языка\r\n- уровень знания английского языка не ниже pre- intermediate\r\n- опыт работы с системами СІ (continuous integration), таких как: Jenkins або TeamCity, Microsoft Azure ітд.','personal@fozzy.ua',NULL,'2017-08-03 07:23:17','2017-08-03 07:23:17',14000,1,0,1,'NULL'),(67,'Web, mobile-designer',79,'2','0000-00-00',1,'Описание:\r\nИщем дизайнера, который хотел бы заниматься сложными сайтами и долгосрочными проектами.\r\n\r\nТехнические требования:\r\nPhotoshop, Illustrator, Sketch (можем научить), понимание принципов верстки и возможностей CSS.\r\n\r\nНетехнические требования:\r\nЖелание продумывать мелочи, делать удобные интерфейсы и крутые анимации.\r\n\r\nОбязанности в простых шагах:\r\n1. Проектирование десктопных и мобильных интерфейсов;\r\n2. Обсуждение;\r\n3. Базовая прорисовка;\r\n4. Доработка деталей;\r\n5. Анализ получившейся от программистов верстки, доработка нюансов.\r\n\r\nНе рассматриваем удаленную работу','office@memcrab.com',NULL,'2017-08-07 06:55:08','2017-08-07 06:55:08',10000,1,0,1,'NULL'),(68,'PHP-developer',80,'2','0000-00-00',1,'Усиленно ищем PHP-разработчика для плодотворной работы! Если Вы готовы к интересным задачам, хотите развиваться в стабильной компании — свяжитесь с нами! \r\nОсновные требования к кандидатам:\r\n- PHP/MySQL\r\n- HTML, CSS, Javascript, Ajax, jQuery, Bootstrap;\r\n- Опыт работы с MVC-фреймворками (Laravel, Yii2, CodeIgniter);\r\n- Опыт работы с Linux;\r\n- Базовое знание UNIX-подобных ОС (базовые команды консоли, перезапуск сервисов, написание элементарных bash-скриптов);\r\n- GIT;\r\n- Умение самостоятельно находить решение задач.\r\n\r\nПросьба при отклике на вакансию ответить на такие вопросы:\r\n1. Как давно работаете с PHP;\r\n2. Примеры нескольких проектов которыми Вы гордитесь;\r\n3. С какого числа Вы готовы приступить к работе?\r\n\r\nПриветствуется (не является обязательным):\r\n- Наличие портфолио.\r\n\r\nОбязанности:\r\n- Своевременность выполнения работы;\r\n- Исправление багов на созданном проекте;\r\n- Участие в выработке концепции проекта, анализ задач клиента и предложение идей, оценка реальности исполнения элементов.\r\n\r\nПредлагаем:\r\n- Комфортные условия для работы;\r\n- Интересные проекты;\r\n- Достойную оплату труда — по договоренности;\r\n- Работа в офисе;\r\n- Стабильность и возможность развиваться.\r\n\r\nМы ждем Ваше резюме с указанием желаемой заработной платы :)','contact@premiumcall.com.ua',NULL,'2017-08-08 08:14:25','2017-08-08 08:14:25',14000,1,0,1,'NULL'),(69,'Web Developer',77,'2','0000-00-00',1,'Requirements:\r\n1. Soft skills:\r\n- English — IMPORTANT. You should be able to have Skype conversations with product owners;\r\n- Understanding of agile methodologies (Scrum, Kanban)\r\n- Jira\r\n\r\n2. Hard skills:\r\nImportant:\r\n- PHP (5.6.*, 7.1.*), Javascript, MySQL, OOP;\r\n- CSS (3), HTML (5), DOM;\r\n- Laravel, Codeigniter;\r\n- Composer, Git, Linux;\r\n\r\n3. Nice to have:\r\n- CSS (3), HTML (5), DOM;\r\n- Gulp (Grunt), npm, Angular;\r\n\r\nWhat we offer:\r\n- Flexible working hours; \r\n- Work office in the city centre; \r\n- Coffee, cookies, darts, Friday beers (on us); \r\n- Laptop + Monitor; \r\n- 20 holidays (+ national Ukrainian holidays); \r\n- Up to $1k beginning salary with regular reviews and no limits of future growth; \r\n- Bonus system.','contact@mijndev.com',NULL,'2017-08-09 08:50:31','2017-08-09 08:50:31',12000,1,0,1,'NULL'),(70,'Junior/Middle PHP Developer',81,'2','0000-00-00',1,'IT компании требуется разработчик PHP (Yii Framework) / Back-end Developer\r\n\r\nТребования профессиональные:\r\n- знание и опыт работы с PHP5 на высоком уровне;\r\n- знания и понимание ООП / MVC на высоком уровне;\r\n- опыт работы с MVC-фреймворками (обязателен опыт работы с Yii1 / Yii2 Framework, опыт работы с Zend, Symfony, CodeIgniter, Kohana и другими будет несомненным преимуществом);\r\n- уверенное знание SQL (MySQL и/или PostgreSQL — создание/изменение схем, транзакции, множественные JOIN, внешние ключи, индексы, способность оптимизировать запросы);\r\n- уверенное знание JavaScript (обязательно опыт работы с jQuery и с AJAX);\r\n- уверенное владение системами контроля версий Git;\r\n- опыт работы с Jira / Redmine;\r\n- опыт работы с Twig;\r\n- знание HTML (приветствуется HTML5), CSS / SCSS;\r\n- базовые знания HTML / CSS-фреймворков — Foundation, Twitter Bootstrap;\r\n- базовое знание UNIX-подобных ОС (базовые команды консоли, перезапуск сервисов, написание элементарных bash-скриптов)\r\nприветствуется опыт работы с web-серверами (Apache, nginx)\r\nприветствуется опыт работы по TDD, Scrum;\r\n- опыт работы с PHPUnit, Selenium, Codeception;\r\n- приветствуется опыт работы с высоко нагруженными проектами (оптимизация кода и запросов, кеширование, разбитие на сервисы и т. д.).\r\n\r\nТребования личные:\r\n- любовь к своему делу;\r\n- высокая личная ответственность;\r\n- желание создавать качественные программные продукты;\r\n- здоровые амбиции;\r\n- желание самосовершенствования в профессиональном и личном плане;\r\n- ориентация на результат.\r\n\r\nЧто мы предлагаем взамен:\r\n- сложные и интересные проекты;\r\n- достойную з/п (по результатам собеседования);\r\n- высокие требования к качеству кода и срокам;\r\n- работа в команде с ориентацией на результат;\r\n- возможность развития знаний и навыков.','info@websoftgroup.net',NULL,'2017-08-10 07:28:11','2017-08-10 07:28:11',14000,1,0,1,'NULL'),(71,'QA Engineer',82,'2','0000-00-00',1,'Who we are and what we do:\r\nAstound Commerce is a global ecommerce agency headquartered in the US. With over 600 professionals in 7 countries, we are one of the world’s largest teams of ecommerce experts. Top brands like Adidas, Puma, Versace, Jimmy Choo, Tommy Hilfiger, Hugo Boss and Crocs are among our clients. Company centers in Eastern Europe are focused on the development of ecommerce solutions on Salesforce Commerce Cloud (Demandware), Hybris, IBM WebSphere Commerce, Intershop, Kibo, Magento, NetSuite.\r\n\r\nBrief description of the open position:\r\n\r\nThe QA Engineer will be part of a high-performance feature-driven QA team responsible for building and testing complex ecommerce solutions. Entry level of proficiency (Junior, Middle or Senior QA Engineer) will be determined on the interview.\r\n\r\nYou will:\r\n- Work in a QA team to analyze business requirements, create and execute test cases, report and verify bugs\' to guarantee the quality of the developed enterprise-level ecommerce solutions;\r\n- Keep all project QA-related documents/files up-to-date. Ensure that developed QA-related documentation and other artifacts of testing meet the agreed standards/guidelines;\r\n- Actively participate in daily project team meetings and brainstorming activities related to the project;\r\n- Provide updates to the task estimates and status of assigned tasks;\r\nCollaborate with project team;\r\n- Provide recommendations to the QA Lead and/or Project Manager to improve QA-related procedures, systems and tools.\r\n\r\nYou have:\r\n- Minimum 2 year of software testing experience;\r\n- Strong theoretical knowledge base in software testing;\r\n- Practical experience in testing of web-based applications or/and ecommerce solutions;\r\n- Experience in analyzing the requirements, creation, and execution of test cases and reporting of test results;\r\n- Experience with bug tracking systems, as well as with bug reports creation and verification;\r\n- Intermediate spoken and written English;\r\nAbility to learn and adapt quickly in a dynamic environment.\r\n\r\nGood to have:\r\n- Experience in testing web-based applications and ecommerce solutions;\r\n- Experience in integration, performance/load, and security testing;\r\n- Experience in different testing tools;\r\n- Experience working in geographically distributed teams;\r\n- Knowledge in HTML, CSS, XML;\r\n- Experience in Jira and Confluence systems;\r\n- Team player.\r\n\r\nWe offer:\r\n- Knowledgebase of the world’s largest ecommerce delivery team;\r\n- Trainings and certifications;\r\n- A constant inflow of ecommerce projects with global outreach;\r\nWell set SDLC process with use of Agile, Scrum, Waterfall depending on a project;\r\n- Coaching and reviews to support your career development;\r\n- Internal/external engineering and business training and conferences and time for self-education;\r\n- Extensive technical library with option to order books and English classes;\r\n- A network-style culture with geographically distributed teams, easy communications and access to clients;\r\n- Possible international on-site visits;\r\n- Work-life balance approach and healthy lifestyle programs.','jobs@astoundcommerce.com',NULL,'2017-08-11 10:04:02','2017-08-11 10:04:02',14000,1,0,1,'NULL'),(72,'Викладач Java',61,'2','0000-00-00',6000,'<p>Викладач ІТ технологій з обов&rsquo;язковим досвідом програмування та бажаним досвідом викладання Мова програмування: Java. Технології: J2SE, J2EE, J2ME. Пропонуємо повну чи часткову зайнятість залежно від кваліфікації спеціаліста. Часткова зайнятість &mdash; залежно від кваліфікації. (Зайнятість від 3 год. на тиждень) Викладання класичних та сучасних знань з програмування. Обов&#39;язково: Програміст-практик. Бажано: З досвідом менторства, викладання але без досвіду викладання в класичних навчальних закладах.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-08-17 11:41:28','2017-08-17 11:45:10',18000,1,0,1,'NULL'),(73,'Trainee QA Engineer',83,'2','0000-00-00',1,'Infopulse Ukraine welcomes talented professionals to join our project and to work as a Trainee QA Engineer in our Vinnytsia office. We are looking for a highly passionate and results-oriented Trainee QA Engineer to be a part of our BI-team on a full-time basis. This is a great chance to join our Technology Delivery Studio team and to work for challenging and dynamic business projects.\r\n\r\nOur customer is one of the worldwide known Big Four audit companies providing audit, tax, consulting, and financial advisory services.\r\n\r\nYou will get\r\nDynamic and interesting projects, professional and career development, the opportunity to work in a friendly and self-motivated team\r\nA team structure that is standard across different projects, allowing easy switching between them and intensive sharing of knowledge and best practices\r\nAreas of Responsibility\r\nManual testing of applications\r\nCreating testing documentation: test cases, test plan, testing reports, release note\r\nAnalyzing and clarification of requirements\r\nQualifications\r\nGood knowledge of SQL\r\nIntermediate level in English is a must\r\nUnderstanding test design techniques\r\nUnderstanding quality assurance and software testing theory\r\nExperience in test documentation design (check list, test cases, bug reports, etc.)\r\nUnderstanding software development life cycle and process for quality assurance\r\nKnowledge of bug tracking tools (e.g., Jira,Redmine, HP QC, Mantis)\r\nKnowledge of QA methodologies (e.g. types of testing, definition of QA, QC)\r\nStrong analytical skills and attention to details\r\nSoftware testing experience will be an advantage\r\nSoftware development experience will be an advantage\r\nKnowledge of agile methodologies (SCRUM etc.) will be an advantage.\r\nTo apply (in English only) please use the \"Apply now\" form below and provide your full career details as an attachment. You are asked to include the detailed description of your skills and technologies mastered, working experience and projects description. Please, be sure that all information you provide us will be accepted and kept in the strictest confidence.','ita.in.ua@gmail.com',NULL,'2017-08-17 19:32:20','2017-08-17 19:32:20',7,1,0,1,'NULL'),(74,'INTERN ANDROID DEVELOPER',75,'2','0000-00-00',1,'INTERN ANDROID DEVELOPER\r\n\r\nREQUIRED SKILLS:\r\n\r\nknowledge of Java (OOP, Design patterns, multithreading)\r\nexperience in programming using Android SDK (Application components, Networking)\r\nknowledge of most common algorithms and data structures\r\nexperience in building client-server application using REST and JSON\r\ngreat teamwork skills\r\nability to write clean code\r\nEnglish — intermediate\r\nBONUS SKILLS:\r\n\r\nbasic knowledge of Google Play Services API, Retrofit, RxJava, RxAndroid, MVP Architecture\r\nknowledge of development patterns\r\nknowledge of social SDK Integration\r\nJIRA, GIT\r\nWHAT SHOULD YOU DO:\r\n\r\ndevelop and support mobile applications\r\nwrite working, clean and easy-to-read code\r\nanalyze and correct defects\r\ncooperate with the teams on the project\r\nOUR BENEFITS:\r\n\r\ntalented colleagues with a good sense of humor\r\nthe exchange of experience\r\nthe feeling of the importance of what you do\r\ngrowth prospects for this position\r\nfree of charge English classes, paid events attendance\r\npurchase the necessary software, release-party, pizza-party\r\nperiodic review of the salary every six months\r\npurchase a laptop or PC\r\nINTERVIEW STAGES:\r\n\r\nStage 1. Test task (no restrictions on the implementation, but the faster you do — the faster we`ll give you feedback).​\r\n\r\nStage 2. Interview with HR (Skype or in person, if you want to see our office).​\r\n\r\nStage 3. Interview with the head of the department (Tech Lead).\r\n\r\nAnd then we make a decision within 5 days (approximately).\r\n\r\nIf you`ve found yourself in these lines — we are looking forward to your CV.','ita.in.ua@gmail.com',NULL,'2017-08-18 09:46:15','2017-08-18 09:46:15',5,1,0,1,'NULL'),(75,'стажування Full Stack (.NET + JS).',84,'2','0000-00-00',1,'Вимоги до кандидатів: \r\nАнглійська (розмовний, письмовий) на рівні intermediate або близький до нього;\r\nЗнання OOP / OOD;\r\nЗнання C # і платформи .NET;\r\nВміння користуватися середовищем розробки MS Visual Studio;\r\nЗнання SQL та баз даних;\r\nМати уявлення про ORM;\r\nЗнання ASP.NET MVC / Web API.\r\nЯк потрапити: надіслати резюме на job-vinnitsa@exadel.com , пройти співбесіду.\r\nУмови: стажування під керівництвом досвідченого ліда для 2 осіб в офісі компанії, тривалість — 3 місяці.\r\nДеталі: надсилайте запитання на пошту разом з резюме.','ita.in.ua@gmail.com',NULL,'2017-08-21 08:23:30','2017-08-21 08:23:30',5,1,0,1,'NULL'),(77,'QA Engineer',85,'8','0000-00-00',1,'<p>Requirements: &nbsp;Higher education in IT (Computer Science or Electrical Engineering); At least 0.5 years of commercial experience in software quality assurance/control/test automation; Strong knowledge in QA domain, QA processes, Test management; Understanding of full Software Development Life Cycle (SDLC) and Agile, Scrum process; Experience in writing and executing test cases with using different testing tools; Pre-intermediate/Intermediate English; Ability to learn and adapt quickly in a dynamic environment; Flexibility to support various team needs and be a team player;</p>\r\n\r\n<p>Will be a plus: Experience in usage of Test Management tools and Defect tracking systems (Jira, Redmine, TestLink, etc.); Experience in usage of Virtual machines (VM VirtualBox or VMware Workstation) and Version Control System (SVN, GIT, etc.); Knowledge of different platforms (*nix, windows).</p>\r\n\r\n<p>We offer: Friendly and highly professional team; The competitive salary depending on your skills; 24 working days paid vacation; Medical insurance and paid sick days; Flexible schedule; Professional &amp; personal growth.</p>\r\n\r\n<p>Please send your CV in English. We guarantee the privacy of all the correspondence.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-08-22 09:25:51','2017-08-22 10:04:15',5,1,0,1,'NULL'),(78,'Quality Assurance (QA) Engineer',86,'2','0000-00-00',200,'<p>1. Англійська мова - Intermediate (відеоінтерв&#39;ю англійською з роботодавцем); 2. Базове знання БД и SQL; 3. Особисті якості: уважність і наполегливість; 4. Бажання навчатися новим технологіям і знанням; 5. Бажання працювати.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-08-22 19:05:05','2017-08-23 08:53:46',400,2,0,1,'NULL'),(79,'Business Intelligence Engineer',86,'2','0000-00-00',200,'1. Англійська мова - Intermediate (відеоінтерв\'ю англійською з роботодавцем); \r\n2. Базове знання БД и SQL; \r\n3. Особисті якості: уважність і наполегливість; \r\n4. Бажання навчатися новим технологіям і знанням; \r\n5. Бажання працювати.','ita.in.ua@gmail.com',NULL,'2017-08-22 19:07:07','2017-08-22 19:07:07',400,2,0,1,'NULL'),(80,'Full Stack W⁢eb Developer',73,'2','0000-00-00',8000,'Requirements:\r\nReal experience in Full Stack Web Development at least 6 months!\r\nExamples of your works;\r\nKnowledge of Front-End: HTML/CSS/Bootstrap/JS/jQ/AJAX;\r\nKnowledge of Back-End: PHP/SQL;\r\nExperience in Responsive, Cross-Browser and Pixel-Perfect Front-End creation;\r\nKnowledge of CMS Wordpress;\r\nBasic Knowledge of Adobe Photoshop or Sketch;\r\nA well-functioning desktop or laptop with high-speed Internet connection;\r\nKnowledge of English on the Pre-Intermediate / Intermediate level (Read/Write).\r\n\r\nWill be a plus:\r\nKnowledge of Any Dynamic Stylesheet Languages;\r\nKnowledge of Angular React, Gulp or Grunt;\r\nKnowledge of Parallax or SVG;\r\nKnowledge of Any other CMS or Ecommerce Platform;\r\nTranslating clients\' ideas into the project.\r\nDuties:\r\nDevelopment of Web Sites, Web Applications, Social Networks, eCommerce Platforms, Landing Pages;\r\nDevelopment of custom solutions;\r\nSupport and Bug Fixing of existing projects;\r\nWorking with Internal Projects;\r\nWork conditions:\r\nWork in the best team!\r\nRemote full-time work (no freelance, no part-time);\r\nLoyal and friendly management;\r\nA total absence of bureaucracy;\r\nChances for professional growth;\r\nWell-established online office;\r\nReally flexible schedule, so you can easily combine job with your private life.\r\nAdditionally:\r\nYou will work with the principal Ask-Anyone-Anytime;\r\nSupport of Code Guru Department;\r\nLead Code Guru Control.\r\nCompensation package:\r\nSalary based on commission of contract;\r\nAverage monthly amount guaranteed;\r\nSalary is paid according to the actual currency exchange rates;\r\nBonuses.\r\nExtra bonuses:\r\nRefill of your mobile account;\r\nCoverage of Internet costs;\r\nAdvanced training within the company;\r\nBusiness trips to seminars and workshops;\r\nAbility to work in co-workings in different Ukrainian cities;\r\nCorporate parties.\r\nAttention! Send us your resume ONLY WITH PHOTO!','ita.in.ua@gmail.com',NULL,'2017-08-26 09:26:55','2017-08-26 09:26:55',14000,1,0,1,'NULL'),(81,'PHP developer',87,'2','0000-00-00',1,'<p>Потрібен талановитий PHP розробник з будь-яким досвідом (від 3 місяців до 3+ років) для роботи в великому колективі в сучасному Хай-Тек офісі у центрі в м. Винниці. Ми пропонуємо роботу над цікавими проектами у дружньому колективі. Можливість професійного і кар&#39;єрного росту. Оплата залежить від рівня кваліфікації та узгоджується індивідуально. Умови роботи: Графік роботи з 10.00 до 19.00, сб-нд + офіційні свята - вихідні Високий рівень заробітної плати. Навчання і тренінги за рахунок компанії. Робота в зручному офісі в центрі. Перспектива динамічного кар&#39;єрного росту</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-08-28 09:44:23','2017-08-28 09:45:35',50000,1,0,1,'NULL'),(82,'MIDDLE .NET DEVELOPER',83,'2','0000-00-00',1,'