тпуск</li>\r\n	<li>удобное рабочее место</li>\r\n	<li>сплоченный коллектив единомышленников</li>\r\n	<li>постоянный профессиональный и личностный рост</li>\r\n</ul>\r\n\r\n<p>Если вы считаете, что эта работа для вас, отправляйте ваше резюме.</p>\r\n\r\n<p>Нет опыта работы? Приходите на стажировку: www.uni2biz.org</p>\r\n','robota@visk.dp.ua',NULL,'2017-08-29 13:51:39','2017-08-29 13:59:34',2,1,0,2,'NULL'),(84,'Administrative Assistant',88,'9','0000-00-00',1,'<p>IT company VISK is looking for an <strong>administrative assistant proficient in English.</strong></p>\r\n\r\n<p>This is a unique opportunity to develop incomparable communication and translation skills in a fast-paced multinational environment.</p>\r\n\r\n<p><strong>Location:</strong> in Dnepr office, Ukraine</p>\r\n\r\n<p><strong>Conditions: </strong>full-time job in office</p>\r\n\r\n<p>Our ideal candidate is a creative individual who is passionate about languages and proficient in copywriting and translation.</p>\r\n\r\n<p><strong>Responsibilities: </strong></p>\r\n\r\n<ul>\r\n	<li>Assist departments in daily operations</li>\r\n	<li>Research, write, edit and proofread online and offline content</li>\r\n	<li>Translations from/into English</li>\r\n</ul>\r\n\r\n<p><strong>Skills and qualifications: </strong></p>\r\n\r\n<ul>\r\n	<li>University degree in translation, languages or other</li>\r\n	<li>Strong knowledge of principles of internet, web interfaces, and search engines</li>\r\n	<li>Excellent written and verbal presentation skills</li>\r\n	<li>Solid analytical skills</li>\r\n	<li>Excellent organizational skills</li>\r\n	<li>Extensive experience with translation and/or copywriting</li>\r\n	<li>Excellent English &amp; Russian, other languages will be your advantage</li>\r\n</ul>\r\n\r\n<p>Send your CV with your motivation letter en English if you feel this job is for you. Please note: we are not looking for remote or part-time employee.</p>\r\n','robota@visk.dp.ua',NULL,'2017-08-29 13:58:01','2017-08-29 13:59:18',2,1,0,2,'NULL'),(85,'Стажер веб-программист',89,'9','0000-00-00',1,'<p>Приглашаем программистов PHP на стажировку Uni2Biz в ИТ-компанию.</p>\r\n\r\n<p>В Uni2Biz ты получишь:</p>\r\n\r\n<p>- помощь и совет при выборе карьеры;</p>\r\n\r\n<p>- навыки, необходимые для успешной карьеры в сфере IT;</p>\r\n\r\n<p>- умение работать в команде;</p>\r\n\r\n<p>- опыт международных экспертов в сфере IT;</p>\r\n\r\n<p>- умение справляться с новой работой и задачами;</p>\r\n\r\n<p>- бесконечные возможности профессионального и личностного роста;</p>\r\n\r\n<p>- языковые навыки.</p>\r\n\r\n<p>Платформа Uni2Biz используется для тренировки, а также для:</p>\r\n\r\n<p>- симуляции реального бизнеса;</p>\r\n\r\n<p>- связи между участниками и их будущими работодателями;</p>\r\n\r\n<p>- опыта использования делового языка;</p>\r\n\r\n<p>- приобретения навыков, которые будут полезны в будущей работе;</p>\r\n\r\n<p>- выражения креативности подхода и образа мышления участников;</p>\r\n\r\n<p>- интеграции в международный бизнес;</p>\r\n\r\n<p>- развития чувства корпоративной ответственности, находчивости, гибкости, восприимчивости мышления и других жизненно необходимых для бизнеса навыков;</p>\r\n\r\n<p>- изучения принципов работы в команде в реальных условиях с ответственностью за выполнение настоящей работы.</p>\r\n\r\n<p>Чтобы присоединиться к нам, необходимо следующее:</p>\r\n\r\n<p>- зарегистрируйся на<strong>&nbsp;<a href=\"http://forums.uni2biz.org\">сайте Uni2Biz</a></strong></p>\r\n','robota@visk.dp.ua',NULL,'2017-08-29 14:04:25','2017-08-29 14:07:04',2,1,0,1,'NULL'),(86,'Junior — Middle Front-End developer',90,'2','0000-00-00',1,'Необхідні навички:\r\nEcmaScript 6\r\nReact, Redux (or analogues like MobX) \r\nWebpack, Grunt or Gulp \r\nGit, NPM\r\nGood markup skills, BEM or analogues, (we use BEM + CSS modules babel plugin).\r\n\r\nБуде плюсом:\r\nTypescript or flow (we use typescript)\r\nProblem-solving skill\r\nKnow frontend framework (angular, vue).\r\n\r\nПропонуємо:\r\nFlexible 8-hour working day and 5-day working week\r\nPaid vacation and sick leave\r\nProviding financial support to enhance professional growth (trainings, courses and seminars)\r\nThe most tasty Italian coffee in any amount\r\nOpportunity for professional growth\r\nYoung and friendly team\r\nComfortable and modern office\r\nSalary based on the interview results','ita.in.ua@gmail.com',NULL,'2017-08-31 11:22:47','2017-08-31 11:22:47',5,1,0,1,'NULL'),(87,'Training for Junior Microsoft CRM Consultants with Employment',91,'2','0000-00-00',1,'Main requirements\r\nBachelor’s Degree or equivalent in a technically related field (i.e. computer science, engineering, IT, etc.)\r\n1 – 3 years’ experience in a technical capacity preferred, but not required\r\nTechnical English communications skills\r\n\r\nDetails\r\n\r\nFee – Free\r\nDuration – 3 weeks\r\nSchedule – from Monday till Friday, 9am – 1pm\r\nGroup size – 10 students\r\nLanguage – Russian, English\r\nAfter training 3 students will be selected for employment on competitive basis\r\nConditions for employment will be discussed individually','ita.in.ua@gmail.com',NULL,'2017-09-03 08:52:49','2017-09-03 08:52:49',2,1,0,1,'NULL'),(88,'QA Engineer',92,'2','0000-00-00',8500,'Умови:\r\nУ зв\'язку із зростанням в компанію SMYT потрібні уважні, відповідальні люди, які хочуть отримати розвиток в сфері тестування ПЗ і взяти участь в забезпеченні якості програмних продуктів.\r\nSMYT - компанія, що спеціалізується на розробці і впровадженні складних ІТ рішень. Основні напрямки діяльності компанії - великі веб-проекти, автоматизація бізнесу і мобільні додатки.\r\nНаші умови роботи:\r\nможливий вид співпраці в режимі work from home, але з повною зайнятістю без можливості суміщення з іншою трудовою або нетрудовою діяльністю (ми готові надати достатнє завантаження по роботі над серйозними завданнями);\r\nробота з наставником з метою навчання специфіці роботи над нашими проектами;\r\nрелевантне і систематичне підвищення на посаді і оплаті праці безпосередньо залежить від зростання Вашого професіоналізму. \r\nЯк невелике тестове завдання, просимо Вас в супровідному листі описати, як би Ви вирішили наступний кейс:\r\n\"Під час проведення тестування ПО Ви виявляєте баг. У ТЗ немає опису даної функціональності. Менеджер стверджує, що даний баг є несуттєвим. Розробник стверджує, що це фіча.\r\nЯкі будуть Ваші дії?\"\r\nОбов\'язки\r\nУ ваші обов\'язки буде входити:\r\nвиконання завдань по забезпеченню якості;\r\nдопомога в управлінні процесом розробки складних IT проектів у фінансовій сфері;\r\nорганізація і проведення ручного тестування наших програмних продуктів;\r\nробота в баг-трекінговій системі;\r\nоформлення супутньої документації.\r\nНаші вимоги:\r\nбути цілеспрямованим, організованим і уважним до деталей фахівцем (ми приділяємо особливу увагу якості наших розробок).\r\nволодіння англійською мовою на рівні intermediate і вище;\r\nвпевнене знання теорії тестування;\r\nбажано мати практичні навички в області тестування;','ita.in.ua@gmail.com',NULL,'2017-09-05 10:35:38','2017-09-05 10:35:38',16000,1,0,1,'NULL'),(89,'стажування PHP',93,'2','0000-00-00',1,'<p>Вимоги до кандидатів: вік &mdash; починаючи з студентів останніх курсів ВНЗ ( 4 курса і старше) і далі. Вища освіта, знання початкової бази в даному напрямку.</p>\r\n\r\n<p>Як потрапити: прислати своє резюме з чітким формуванням напрямку в якому хочете пройти стажування.</p>\r\n\r\n<p>Умови: повний робочий день.&nbsp;</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-09-06 09:58:42','2017-09-06 10:06:27',5,1,0,1,'NULL'),(90,'Junior JavaScript Developer (Trainee)',94,'2','0000-00-00',1,'Requirements:\r\nTechnical education (related to computer science)\r\nUnderstanding of OOP\r\nKnowledge of basic pattern design\r\nGood Algorithmic knowledge\r\nGood theoretical knowledge of Databases\r\nUnderstanding of the basic principles of networks\r\nEnglish Intermediate level or above\r\nWe offer:\r\nProfessional and career growth\r\nPaid trainings, conferences\r\nPaid vacations and sick leave\r\nFriendly atmosphere\r\nFlexible working schedule\r\nCorporate and team building events, juices, cookies, fruits & vegetables and much more…\r\nComfortable office\r\nAbout us:\r\nWe are specializing in delivering customized services and solutions, using only trendy and modern technologies in the product development. Now are looking for talented junior/Trainee developers who desire to grow professionally and improve on their skills and technical know-how while working with a professional and friendly team.','ita.in.ua@gmail.com',NULL,'2017-09-11 11:15:05','2017-09-11 11:15:05',2,1,0,1,'NULL'),(91,'Junior Javascript Developer',95,'2','0000-00-00',1,'Стартап-компанія по розробці мобільного додатку для інформаційної дошки служби таксі у пошуку Android розробника!\r\n\r\nЯкщо знаєш Angular, Vue.js, React.js, вмієш писати на Angular 4, не боїшся труднощів — відгукуйся і отримаєш тестове завдання для перевірки самого себе!\r\n\r\nДружній колектив завжди готовий допомогти і навчити, головне бажання.\r\n\r\nДля початку робота буде віддаленою.','ita.in.ua@gmail.com',NULL,'2017-09-12 09:27:39','2017-09-12 09:27:39',2,1,0,1,'NULL'),(92,'Junior C++ developer',68,'2','0000-00-00',1,'<p>Junior C++ Developer (Vinnitsa) We are looking for a C++ Developer who will take a part in a new Sweden project. Our client is a software development company that produces the software related for account management, account receivable, invoice purchasing, factoring and debt collection - all-in-one or standalone. Responsibilities: Requirements analysis and estimation of implementation Development of software with using of C++ and C# Preparation of SQL queries for required data fetching Requirements: Any financial industry experience as a big plus 1+ years&#39; experience in software engineering as a C++ developer 1+ years&#39; experience in Microsoft Visual Studio, Standard Template Library (STL) Experience desirable: SQL, C#, SVN or GIT or TFS (at least one of this) Upper Intermediate level of English</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-09-13 12:18:38','2017-09-13 12:19:20',5,1,0,1,'NULL'),(93,'Junior Java Developer',96,'2','0000-00-00',1,'<h3>Required skills:</h3>\r\n\r\n<p>&mdash;&nbsp;1+&nbsp;year of&nbsp;experience;&nbsp;<br />\r\n&mdash;&nbsp;Java, SQL, NoSQL, RESTful APIs, SOAP;&nbsp;<br />\r\n&mdash;&nbsp;Spring, Hibernate, JUnit, NoSQLUnit, DBUnit, JDBC;&nbsp;<br />\r\n&mdash;&nbsp;JSON, XML;&nbsp;<br />\r\n&mdash;&nbsp;MySQL, MongoDB;&nbsp;<br />\r\n&mdash;&nbsp;Tomcat, Nginx, Docker;&nbsp;<br />\r\n&mdash;&nbsp;Maven, Gradle;&nbsp;<br />\r\n&mdash;&nbsp;Jira, Git</p>\r\n\r\n<h3>We offer:</h3>\r\n\r\n<p>Competitive salary&nbsp;<br />\r\nCareer growth opportunities&nbsp;<br />\r\nWorking with young and super-friendly team&nbsp;<br />\r\nCozy office in&nbsp;the historic centre of&nbsp;the city&nbsp;<br />\r\nCorporate social events&nbsp;<br />\r\nAnnual paid vacation&nbsp;&mdash; 24&nbsp;working days&nbsp;<br />\r\nPaid sick leaves</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-09-16 08:13:17','2017-09-16 08:13:17',1000,2,0,1,'NULL'),(94,'Junior Front-end developer',97,'2','0000-00-00',300,'<p><strong>Что делать?</strong></p>\r\n\r\n<ul>\r\n	<li>Разработка сайтов полного цикла: сайты-визитки, корпоративные сайты, Landing Page, интернет-магазины.</li>\r\n	<li>Доработки по проектам.</li>\r\n	<li>Верстка и натяжка.</li>\r\n</ul>\r\n\r\n<p><strong>Кто нужен?</strong></p>\r\n\r\n<ul>\r\n	<li>Человек, который точно определился, что свяжет свою жизнь с веб-программированием.</li>\r\n	<li>Не для тех, кто только начал изучать программирование.</li>\r\n	<li>Опыт работы программистом не менее 1-го года.</li>\r\n	<li>Кто отлично владеет HTML5, CSS3, JavaScript (PHP, MySQL &ndash; это Ваш бонус).</li>\r\n	<li>Умеет работать с CMS (OpenCart, WordPress &ndash; обязательно, другие CMS &ndash; это Ваш бонус).</li>\r\n	<li>Для кого Responsive design &ndash; это must have.</li>\r\n	<li>Кто знает, как работать с Adobe Photoshop.</li>\r\n	<li>Кто умеет работать в режиме многозадачности, с большими объемами информации, с требовательными и не очень Заказчиками :)</li>\r\n</ul>\r\n\r\n<p><strong>Что мы даем?</strong></p>\r\n\r\n<ul>\r\n	<li>Сначала работа и оплата по проектно, чтоб мы могли определить уровень Ваших знаний. Ставится задача и сроки. Выполните быстрее &ndash; ок, только чтоб не страдали качество и Ваше здоровье.</li>\r\n	<li>Затем заработная плата: ставка + премиальные. Трудоустраиваем официально.</li>\r\n	<li>Возможность работать удаленно: можете работать дома, в кафе, в коворкинге. Все, что нам нужно &ndash; это выполненная качественно задача в срок.</li>\r\n	<li>Гибкий график.</li>\r\n</ul>\r\n\r\n<p><strong>Какие перспективы?</strong></p>\r\n\r\n<ul>\r\n	<li>Работа над интересными, перспективными проектами;</li>\r\n	<li>Достойная оплата труда;</li>\r\n	<li>Бонусная система поощрения по результатам работы (премиальные);</li>\r\n	<li>Карьерный рост: начинающий программист &ndash; уверенный &ndash; профессионал &ndash; гуру.</li>\r\n</ul>\r\n\r\n<p><strong><em>Будем рады талантливым людям, которые любят свою работу.</em></strong></p>\r\n\r\n<p>Ключевые навыки</p>\r\n\r\n<p>CMS</p>\r\n\r\n<p>Wordpress</p>\r\n\r\n<p>CSS</p>\r\n\r\n<p>3HTML</p>\r\n\r\n<p>5Adobe Photoshop</p>\r\n\r\n<p>Английский язык</p>\r\n\r\n<p>PHP</p>\r\n\r\n<p>CSS</p>\r\n\r\n<p>HTML</p>\r\n\r\n<p>Работа в команде</p>\r\n\r\n<p>CMS OpenCart</p>\r\n\r\n<p>JavaScript</p>\r\n\r\n<p>SQL</p>\r\n\r\n<p>Responsive Design</p>\r\n\r\n<h3>Тип занятости</h3>\r\n\r\n<p>Полная занятость,&nbsp;гибкий график</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-09-18 10:32:55','2017-09-18 10:34:31',700,2,0,1,'NULL'),(95,'IT-specialist',98,'2','0000-00-00',1,'<p>Working from our office you will be responsible for the planning, procurement, development, implementation, maintenance and daily support of company IT infrastructure.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We are seeking a dynamic professional with comprehensive IT expertise, who will establish and manage the IT function in the company including associated policies, processes, hardware and software. All tasks are fulfilled in very close cooperation with the company CFO,&nbsp; IT consultants, Division &amp; Corporate IT at our global head office in Vienna and in accordance with the Corporate Guidelines.</p>\r\n\r\n<p>Key accountabilities:</p>\r\n\r\n<ul>\r\n	<li>Administrate Client and Server systems</li>\r\n	<li>Ensuring uninterrupted functioning of IT systems at the factory (office and production)</li>\r\n	<li>Procurement, configuration and installation of new components (Hardware and Software)</li>\r\n	<li>Support business functions in installation and administration of the required applications</li>\r\n	<li>Troubleshooting in the areas of software and hardware</li>\r\n	<li>Participate in the development of the IT strategy in response to the company&rsquo;s needs and priorities together with the CFO and in alliance with the standards of Division &amp; Corporate IT.</li>\r\n	<li>Participate in the development and maintenance of corporate IT policies and standards</li>\r\n	<li>Participate in the procurement and update of appropriate technology with specific focus on automation within the manufacturing facilities as well as the functional departments aligned to corporate IT policies and standards</li>\r\n	<li>Manage local IT infrastructure projects und support global IT projects</li>\r\n	<li>Provide general support and advice to employees on all IT related matters</li>\r\n	<li>Support the transition of our existing ERP system to a new system (SAP).</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fundamental Requirements:</strong></p>\r\n\r\n<ul>\r\n	<li>5+ years of progressive experience in system administration roles, working within or managing a hardware/infrastructure environment</li>\r\n	<li>Knowledge of networking, storage, server and virtual technologies (strong knowledge of Windows-Client and Server systems (Windows 2000/XP/2003/Vista/2008/2012, Hyper-V, SQL-Server, Active Directory)</li>\r\n	<li>Experienced in LAN- and WAN- technologies. Experience in resolving issues in Layer 2 and 3 (DHCP, DNS, TCP/IP)</li>\r\n	<li>Proficient in English, both written and verbal</li>\r\n	<li>Degree in an IT related field</li>\r\n	<li>Strong people, project and time management skills</li>\r\n	<li>Optional: CISCO Catalyst knowledge (managing switches, VLANS)</li>\r\n	<li>Optional: Experience with factory automation (piloting), SAP MII and PLC&rsquo;s</li>\r\n</ul>\r\n','ita.in.ua@gmail.com',NULL,'2017-09-21 07:50:42','2017-09-21 07:50:42',10,1,0,1,'NULL'),(96,'Junior/Middle web программист',99,'2','0000-00-00',1,'<p><strong>Требования:</strong>&nbsp;Опыт от 1 года.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>PHP, mySQL, опыт работы с MVC фреймворками, создание API.</p>\r\n\r\n<p>Знания ООП, SQL.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Отдельно для фронтед разработчков необходимы знания CSS, JS, JQuery, MVC</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Обязателен английский не ниже честного Intermediate.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Обязанности:</strong></p>\r\n\r\n<p>Помощь в разработке различных веб проектов.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Условия работы:</strong></p>\r\n\r\n<p>Работа в офисе в г. Винница. Выходные, отпуск, больничные согласно КЗоТ.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-09-21 08:06:48','2017-09-21 08:06:48',21200,1,0,1,'NULL'),(97,'Junior QA',101,'9','0000-00-00',1,'<p>1.Тестування сайту</p>\r\n\r\n<p>2.Це не реальна вакансія</p>\r\n','fobihiy@p33.org',NULL,'2017-09-22 20:49:44','2017-09-22 22:25:53',5000,1,0,2,'NULL'),(98,'QA Engineer',104,'2','0000-00-00',1,'<h3>Хочешь получить уникальные навыки и&nbsp;опыт в&nbsp;тестировании нового продукта в&nbsp;большой компании? Хочешь работать на&nbsp;результат? Готов к&nbsp;самостоятельности? &mdash;&nbsp;Тогда, мы&nbsp;готовы с&nbsp;тобой сотрудничать!</h3>\r\n\r\n<p>Hotels24&nbsp;&mdash; это национальный лидер по&nbsp;бронированию отелей по&nbsp;всей Украине. В&nbsp;день мы&nbsp;обслуживанием больше 500 клиентов, и&nbsp;у&nbsp;тебя есть возможность быть частью большой компании.</p>\r\n\r\n<p>Сейчас нам нужен человек в&nbsp;команду, который:</p>\r\n\r\n<ul>\r\n	<li>понимает методологии разработки программного обеспечения;</li>\r\n	<li>уверенно владеет представлением о&nbsp;тестировании методом черного ящика;</li>\r\n	<li>умеет писать понятную тестовую документацию (тест-кейсы, тест-планы);</li>\r\n	<li>умеет работать с&nbsp;системами учета дефектов (YouTrack, Bugzilla);</li>\r\n	<li>знает, что такое жизненный цикл дефекта;</li>\r\n	<li>может работать с&nbsp;БД на&nbsp;уровне&nbsp;&mdash; прочитать данные из&nbsp;таблицы с&nbsp;фильтрами;</li>\r\n	<li>имеет общее представление о&nbsp;Web-технология, понимание для чего и&nbsp;где используется: xml, css, html, http, dns;</li>\r\n	<li>знает следующие методы проектирования тестов и&nbsp;умеет применять на&nbsp;практике: разбиение на&nbsp;классы эквивалентности, анализ граничных значений, таблица возможных решений.</li>\r\n</ul>\r\n\r\n<p>Большой плюс если у&nbsp;тебя есть знание Java, JUnit, Maven, Selenide, Rest Assured, Jenkins, селекоры CSS и&nbsp;XPath; опыт работы с&nbsp;Selenium WebDriver и&nbsp;навык автоматического тестирования.</p>\r\n\r\n<h3>В&nbsp;ваши обязанности будет входить:</h3>\r\n\r\n<ul>\r\n	<li>функциональное тестирование веб приложений;</li>\r\n	<li>регрессионное тестирование;</li>\r\n	<li>написание тестовой документации;</li>\r\n	<li>написание автотестов.</li>\r\n</ul>\r\n\r\n<h3><strong>В&nbsp;свою очередь мы&nbsp;предлагаем:</strong></h3>\r\n\r\n<ul>\r\n	<li>комфортные условия труда (пн&nbsp;&mdash; пт&nbsp;с&nbsp;9:00 до&nbsp;18:00);</li>\r\n	<li>З/п&nbsp;&mdash; определяется для каждого кандидата индивидуально, в&nbsp;зависимости от&nbsp;профессионализма.</li>\r\n	<li>работу в&nbsp;профессиональной команде;</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>работа в&nbsp;Scrum-команде;</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>молодой дружный коллектив.</li>\r\n</ul>\r\n\r\n<h3>ВАЖНО</h3>\r\n\r\n<p>Познакомившись с&nbsp;нами, твоя жизнь уже не&nbsp;будет прежней. Возможно, она полностью изменится. Готов&nbsp;ли ты к&nbsp;этому?</p>\r\n\r\n<p><strong>Если тебя не&nbsp;отпугнуло все, что ты&nbsp;прочитал выше, тогда напиши почему интересна эта вакансия и&nbsp;отправь свое резюме. Мы&nbsp;будем рады видеть тебя в&nbsp;нашей команде!</strong></p>\r\n','ita.in.ua@gmail.com',NULL,'2017-09-25 15:57:41','2017-09-25 15:57:41',5,1,0,1,'NULL'),(99,'Інженер-програміст',105,'2','0000-00-00',3200,'<p>Вимоги до кандидата: Вища освіта. Спеціальність: Програмне забезпечення систем.</p>\r\n\r\n<p>Стаж роботи від 3 до 5 років. Знання принципів роботи мереж. ІР адресація, статична і динамічна маршрутизація. Завдання та обов&rsquo;язки: Забезпечення інформаційної безпеки. Розробка стандартів і регламентів з інформаційної безпеки. Проведення аудитів. Налагоджування та управління підсистемами безпеки. Управління інцидентами інформаційної безпеки. Аналіз логів-файлів і журналів подій. Контроль нештатної активності внутрішніх користувачів. За детальною інформацією звертайтесь: Правобережний РЦЗ м.Вінниці, тел.+38(0432)55-16-88, +38(0432)55-44-93, +38(0432)55-44-95.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-09-26 07:25:18','2017-09-26 07:27:29',10000,1,0,1,'NULL'),(100,'Junior Web Developer',107,'2','0000-00-00',7500,'<p>Requirements: &bull; 1+ years experience in software development. &bull; Strong full-stack Javascript programming skills. &bull; Experience with Javascript frameworks (AngularJS, Backbone.js, Knockout.js, Node.js, etc.) &bull; Proficiency in an additional programing language, C #, Python, Ruby, Java, and / or PHP. &bull; Experience with SQL databases. &bull; Good programming skills in HTML / CSS are a plus. &bull; Dedication and discipline to work remotely from home. &bull; Good home computer and internet connection. &bull; Good English reading and writing skills.Please include information about your hobby programming projects in your CV, especially if you do not have commercial programming experience.This is a part-time or full-time position.Hourly rate range is $ 4- $ 7 / hr depends on skills and experience. Please apply online: scopicsoftware.recruiterbox.com/jobs/fk0fm ...Or send your CV in Russian to: jobs@scopicsoftware.com</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-09-28 08:51:38','2017-09-28 15:04:00',15000,1,0,1,'NULL'),(101,'Junior WEB розробник',108,'2','0000-00-00',3200,'<p><strong>Твої цілі :</strong></p>\r\n\r\n<ul>\r\n	<li>cтворення веб додатків (лендінги, сайти)</li>\r\n	<li>підтримка існуючих додатків (офіційний сайт, CRM)</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ми бачимо тебе:</strong></p>\r\n\r\n<ul>\r\n	<li>до 30 років, в/о, досвід від 1 року з адаптивною версткою</li>\r\n	<li>Знаєш та застосовуєш на практиці:&nbsp;<strong>html, css, PHP,&nbsp;</strong>bootstrap, jQuery, ajax; OOP, MVC, MySQL</li>\r\n	<li>Буде великим плюсом, якщо знаєш: framework&nbsp;<strong>Laravel,&nbsp;</strong>JS фреймворки (React, Angular, Vue, etc); less/sass; CMS (Wordpress),</li>\r\n	<li>Проактивний, націлений на результат та особистий розвиток</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Твої можливості:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>challenge:</strong>&nbsp;досягти мега результату, реалізувати твої ідеї та таланти, стати php програмістом</li>\r\n	<li><strong>прокачати skills:&nbsp;</strong>розвиток компетенцій та особистості</li>\r\n	<li><strong>гідний дохід</strong></li>\r\n	<li><strong>турбота про тебе:</strong>&nbsp;гідний дохід, lunch, work&amp;life, events, #inspiringteam, Go Green, #ЗОЖ</li>\r\n	<li><strong>локація:&nbsp;</strong>7 хв. від м. Видубичі у котеджному містечку &laquo;Коник&raquo;</li>\r\n</ul>\r\n','ita.in.ua@gmail.com',NULL,'2017-10-02 07:19:01','2017-10-02 07:19:01',10000,1,0,1,'NULL'),(102,'C++ Developer Internship ',109,'2','0000-00-00',1,'<p>Materialise is launching internship for 3 months on regular basis. &nbsp;You have a chance to take part in different research projects &nbsp;linked to Materialise Сore Сompetences: Software Development , Engineering and Additive Manufacturing. You will lead to success research project in scope of internship program by using bleeding edge technologies in medical, industrial production and 3D printing software domains.&nbsp;</p>\r\n\r\n<h3>If you</h3>\r\n\r\n<ul>\r\n	<li>Interested in research and algo skills development</li>\r\n	<li>Have С++ programming skills (at least any pet projects) or&nbsp; experience</li>\r\n	<li>Ready to work 4-6 (preferably 6) hours a day from home or office</li>\r\n</ul>\r\n\r\n<p>GitHub account is nice to have</p>\r\n\r\n<h3>You can get</h3>\r\n\r\n<ul>\r\n	<li>Experience in researching and algo programming</li>\r\n	<li>Opportunity to interact and to be guided with experienced researchers</li>\r\n	<li>Opportunity to start career with Materialise</li>\r\n</ul>\r\n','ita.in.ua@gmail.com',NULL,'2017-10-02 11:28:23','2017-10-04 14:39:05',2,1,0,1,'NULL'),(103,'Junior QA',110,'9','0000-00-00',6000,'<p>Хочеш отримати унікальні навички і досвід в тестуванні нового продукту у великій компанії? Хочеш працювати на результат? Готовий до самостійності? - Тоді, ми готові з тобою співпрацювати!</p>\r\n\r\n<p>Hotels24 - це національний лідер з бронювання готелів по всій Україні. В день ми обслуговуванням більше 500 клієнтів, і у тебе є можливість бути частиною великої компанії.</p>\r\n\r\n<p>Зараз нам потрібна людина в команду, яка:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>розуміє методології розробки програмного забезпечення;</p>\r\n	</li>\r\n	<li>\r\n	<p>впевнено володіє поданням про тестування методом чорного ящика;</p>\r\n	</li>\r\n	<li>\r\n	<p>вміє писати зрозумілу тестову документацію (тест-кейси, тест-плани);</p>\r\n	</li>\r\n	<li>\r\n	<p>вміє працювати з системами обліку дефектів (YouTrack, Bugzilla);</p>\r\n	</li>\r\n	<li>\r\n	<p>знає, що таке життєвий цикл дефекту;</p>\r\n	</li>\r\n	<li>\r\n	<p>може працювати з БД на рівні - прочитати дані з таблиці з фільтрами;</p>\r\n	</li>\r\n	<li>\r\n	<p>має загальне уявлення про Web-технологія, розуміння для чого і де використовується: xml, css, html, http, dns;</p>\r\n	</li>\r\n	<li>\r\n	<p>знає такі методи проектування тестів і вміє застосовувати на практиці: розбиття на класи еквівалентності, аналіз граничних значень, таблиця можливих рішень.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Великий плюс якщо у тебе є знання Java, JUnit, Maven, Selenide, Rest Assured, Jenkins, селекора CSS і XPath; досвід роботи з Selenium WebDriver і навик автоматичного тестування. У ваші обов&#39;язки буде входити: функціональне тестування веб додатків; регресійні тестування; написання тестової документації; написання Автотест. У свою чергу ми пропонуємо:<br />\r\n<br />\r\nУ ваші обов&#39;язки буде входити:</p>\r\n\r\n<p>функціональне тестування веб додатків; регресійні тестування;</p>\r\n\r\n<p>написання тестової документації; написання Автотест. У свою чергу ми пропонуємо:</p>\r\n\r\n<p>комфортні умови праці (пн - пт з 9:00 до 18:00);</p>\r\n\r\n<p>З / п - визначається для кожного кандидата індивідуально, залежно від професіоналізму. роботу в професійній команді;</p>\r\n\r\n<p>робота в Scrum-команді; молодий дружний колектив.</p>\r\n\r\n<p>ВАЖЛИВО Познайомившись з нами, твоє життя вже не буде колишньою. Можливо, вона повністю зміниться. Чи готовий ти до цього? Якщо тебе не відлякало все, що ти прочитав вище, тоді напиши чому цікава ця вакансія і відправ своє резюме. Ми будемо раді бачити тебе в нашій команді!</p>\r\n','anna.zamyatina3@gmail.com',NULL,'2017-10-02 20:14:37','2017-10-02 20:27:21',8000,1,0,1,'NULL'),(104,'Менеджер відділу турботи про клієнтів',110,'15','0000-00-00',5000,'<p>&nbsp;</p>\r\n\r\n<h1>Менеджер по роботі з клієнтами (call-центр)</h1>\r\n\r\n<h1>&nbsp;</h1>\r\n\r\n<p>Команда Hotels24.ua шукає людину, яка хоче навчитися продавати емоції. Hotels24.ua - це центр бронювання готелів по Україні та за кордоном. Ми - це більше 3 500 готелів і більше 10 000 задоволених клієнтів щомісяця!</p>\r\n\r\n<p>ХТО НАМ ПОТРІБЕН</p>\r\n\r\n<p>Наша команда розвиває відділ по роботі з клієнтами. Ми шукаємо амбітного, цілеспрямованого однодумця, з сильними вольовими якостями. Людину, яка поважає час інших і розуміє, що це - найдорожчий ресурс. Для кого зароблені гроші є головним показником хорошої роботи.</p>\r\n\r\n<p>І так, нам важливо, щоб у тебе було почуття гумору!</p>\r\n\r\n<p>ЩО ПОТРІБНО РОБИТИ?</p>\r\n\r\n<ul>\r\n	<li>приймати заявки від клієнтів по телефону;</li>\r\n	<li>шукати варіанти поселення;</li>\r\n	<li>бронювати готельні номери;</li>\r\n	<li>супроводжувати клієнта в телефонному режимі.</li>\r\n</ul>\r\n\r\n<p>​<br />\r\nМИ ГАРАНТУЄМО:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>високу заробітну плату (від 3000 грн);</li>\r\n	<li>затишний офіс;</li>\r\n	<li>ніяких холодних дзвінків (тільки теплі клієнти);</li>\r\n	<li>чай, кава і теплу атмосферу;</li>\r\n	<li>нематеріальні і матеріальні бонуси: хвилинки релаксу, вкусняхі, конкурси, премії;</li>\r\n	<li>постійне навчання від кращих співробітників.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ВАЖЛИВО</p>\r\n\r\n<p>Познайомившись з нами, твоє життя вже не буде колишньою. Можливо, вона повністю зміниться. Чи готовий ти до цього?</p>\r\n','anna.zamyatina3@gmail.com',NULL,'2017-10-02 20:34:58','2017-10-02 20:34:58',6000,1,0,1,'NULL'),(105,'Junior JavaScript Web Developer',112,'2','0000-00-00',1,'<p><strong>Required Skills</strong></p>\r\n\r\n<ul>\r\n	<li>Knowledge of&nbsp;Python, Django framework</li>\r\n	<li>Version control system: Git</li>\r\n	<li>CI: Jenkins</li>\r\n	<li>Basic knowledge of&nbsp;Docker</li>\r\n	<li>Good level of&nbsp;English</li>\r\n	<li>Strong analytical skills, multi-disciplinary approach to&nbsp;problem-solving, team player</li>\r\n</ul>\r\n\r\n<p><strong>Great pluses</strong></p>\r\n\r\n<ul>\r\n	<li>Good knowledge of&nbsp;JavaScript, HTML, CSS</li>\r\n	<li>Experience with&nbsp;JS test and coverage frameworks</li>\r\n	<li>Will be&nbsp;plus skills in&nbsp;React, Redux</li>\r\n	<li>Understanding Rest API</li>\r\n</ul>\r\n\r\n<p><strong>Main Responsibilities</strong></p>\r\n\r\n<ul>\r\n	<li>Developing application and writing unit-tests;</li>\r\n	<li>Taking part in&nbsp;Scrum process with local team;</li>\r\n	<li>Communication with other remote teams;</li>\r\n</ul>\r\n\r\n<p><strong>Employment Conditions</strong></p>\r\n\r\n<ul>\r\n	<li>Work in&nbsp;well-organized professional team;</li>\r\n	<li>Interesting and challenging tasks, opportunities for self-realization and career growth;</li>\r\n	<li>Corporate training programs, English language courses during working hours;</li>\r\n	<li>4 weeks of&nbsp;paid vacation, paid and sick leave;</li>\r\n	<li>Health Insurance;</li>\r\n	<li>Comfortable working conditions, office in&nbsp;the center of&nbsp;the city;</li>\r\n	<li>Convenient schedule.</li>\r\n</ul>\r\n','ita.in.ua@gmail.com',NULL,'2017-10-05 11:52:43','2017-10-05 11:52:43',5,1,0,1,'NULL'),(106,'Junior UI/UX Designer',113,'2','0000-00-00',1,'<p>В&nbsp;эстонское дизайн агенство на&nbsp;полную занятость нужен&nbsp;<strong>UI\\UX Designer</strong>. Нужно будет рисовать много интерфейсов под веб, делать прототипирование в&nbsp;AdobeXD и&nbsp;много всякого интересного. Данная вакансия подразумевает крайне тесную работу с&nbsp;ментором. Даже если у&nbsp;вас нет опыта работы в&nbsp;коммерческих проектах, но&nbsp;есть субъективно хорошие &laquo;работы в&nbsp;стол&raquo;, то&nbsp;смело откликайтесь.</p>\r\n\r\n<p>Очень желателен опыт в&nbsp;хотя&nbsp;бы в&nbsp;одном из&nbsp;нескольких перечисленных направлений (кроме, собственно,&nbsp;<strong>UI\\UX</strong>): Fine Arts \\ Digital Art \\ Exhibition Design \\ Illustration \\ Painting \\ Product Design \\ Storyboarding \\ Typography.</p>\r\n\r\n<h3>Условия:</h3>\r\n\r\n<ul>\r\n	<li>Уютный офис в&nbsp;районе ближнего центра.</li>\r\n	<li>Ментор, который научит делать очень хорошие работы и&nbsp;будет самым родным человеком на&nbsp;ближайший год.</li>\r\n	<li>Большое количество собственных продуктов, которые нужно будет дорабатывать вместе с&nbsp;ментором.</li>\r\n	<li>Поощрение собственных проектов.</li>\r\n	<li>Возможность работы с&nbsp;ведущими студиями из&nbsp;Эстонии \\ Швеции \\ Канады.</li>\r\n	<li>Есть возможность организовать мастерскую для занятий живописью.</li>\r\n</ul>\r\n\r\n<h3>Требования:</h3>\r\n\r\n<ul>\r\n	<li>Художественное образование (полное \\ не&nbsp;полное)&nbsp;<strong>будет плюсом</strong>.</li>\r\n	<li>Отличное знание&nbsp;PS \\ AI \\ Sketch. Большим плюсом будет опыт работы с&nbsp;AF на&nbsp;уровне простейшей анимации.</li>\r\n	<li>Наличие портфолио на&nbsp;Behance \\ Dribbble. Особое внимание к&nbsp;профилям с&nbsp;работами по&nbsp;сайтам и&nbsp;SaaS-продуктам. Портфолио с&nbsp;преобладающим количеством работ по&nbsp;мобильными интерфейсами рассмотрены не&nbsp;будут.</li>\r\n	<li>Грамотный письменный английский (часть команды понимает только английский и&nbsp;с&nbsp;ними точно придется общаться хотя&nbsp;бы из&nbsp;вежливости).</li>\r\n</ul>\r\n\r\n<p>Зарплата&nbsp;&mdash; по&nbsp;результатам собеседования. Собеседование только после просмотра портфолио и&nbsp;<strong>только&nbsp;</strong>на&nbsp;Behance \\ Dribbble. Портфолио, размещенное на&nbsp;других ресурсах просмотрено не&nbsp;будет.</p>\r\n\r\n<p>Для тех, кто дочитывает до&nbsp;конца. Если есть желание сразу поговорить с&nbsp;арт-директором на&nbsp;английском или&nbsp;же с&nbsp;менеджером на&nbsp;русском пишите на&nbsp;design-jobs[at]ester.co с&nbsp;темой &#39;Lviv Design Job&#39;. Такие заявки будут обрабатываться быстрее, чем с&nbsp;сайта.</p>\r\n\r\n<p>Для тех, кто не&nbsp;из&nbsp;Львова, но&nbsp;очень хочет попробовать начать свою карьеру с&nbsp;нами: пишите только на&nbsp;design-jobs[at]ester.co с&nbsp;темой &#39;Relocate me&#39;.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-10-11 10:20:58','2017-10-11 10:20:58',10000,1,0,1,'NULL'),(107,'HRM',114,'6','0000-00-00',10000,'<p>Компания <strong>&laquo;БаДМ&raquo;</strong>&nbsp;&mdash; крупный поставщик на&nbsp;украинском фармрынке:</p>\r\n\r\n<ul>\r\n	<li>23 лет на&nbsp;фармрынке Украины</li>\r\n	<li>10 региональных структурных подразделений по&nbsp;территории Украины badm.biz</li>\r\n	<li>70+ ІТ-специалистов</li>\r\n</ul>\r\n\r\n<p>приглашает на&nbsp;работу <strong>HR&nbsp;IT</strong></p>\r\n\r\n<p><strong>Нам Важно, чтобы Вы&nbsp;имели:</strong></p>\r\n\r\n<p>&bull; высшее образование (психология, управление персоналом);</p>\r\n\r\n<p>&bull; опыт работы от&nbsp;1 года в&nbsp;подборе IT-специалистов;</p>\r\n\r\n<p>&bull; знание каналов привлечения и&nbsp;методов удержания IT-специалистов; &mdash; коммуникабельность и&nbsp;активную жизненную позицию;</p>\r\n\r\n<p>&bull; природную пытливость и&nbsp;любознательность;</p>\r\n\r\n<p>&bull; личностную зрелость.</p>\r\n\r\n<p><strong>Будет плюсом</strong></p>\r\n\r\n<p>Дополнительное образования в&nbsp;сфере IT-HRM будет преимуществом.</p>\r\n\r\n<p>Если для Вас важен статус компании, уверенность в&nbsp;завтрашнем дне, интересные и&nbsp;сложные задачи&nbsp;&mdash; то &laquo;Ура&raquo;! Мы&nbsp;нашли друг друга)</p>\r\n\r\n<p><strong>Кроме выше сказанного:</strong></p>\r\n\r\n<p>&bull; все по&nbsp;КЗоТ;</p>\r\n\r\n<p>&bull; комфортный современный офис;</p>\r\n\r\n<p>&bull; конкурентная заработная плата;</p>\r\n\r\n<p>&bull; замечательный коллектив)</p>\r\n\r\n<p><strong>Обязанности:</strong></p>\r\n\r\n<p>&bull; подбор IT-специалистов;</p>\r\n\r\n<p>&bull; адаптация персонала;</p>\r\n\r\n<p>&bull; работа с&nbsp;микроклиматом в&nbsp;коллективе;</p>\r\n\r\n<p>&bull; организация корпоративных и&nbsp;командообразующий мероприятий;</p>\r\n\r\n<p>&bull; организация внутреннего обучения;</p>\r\n\r\n<p>&bull; работа с&nbsp;кадровым резервом.</p>\r\n\r\n<p>Контактное лицо: Шевченко Анна</p>\r\n','AASHEVCHENKO@badm.biz',NULL,'2017-10-20 13:12:05','2017-10-20 13:12:05',13000,1,0,1,'NULL'),(108,'Junior PHP-программист',115,'2','0000-00-00',1,'<p><strong>Наш PHP программист это:</strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Технический специалист, с&nbsp;желанием работать и&nbsp;развиваться в&nbsp;сфере веб-технологий.</p>\r\n	</li>\r\n	<li>\r\n	<p>Человек, который следит за&nbsp;тенденциями в&nbsp;мире программирования.</p>\r\n	</li>\r\n	<li>\r\n	<p>Без вредных привычек!</p>\r\n	</li>\r\n	<li>\r\n	<p>Наш php программист должен понимать разницу между зарабатывать зарплату и&nbsp;получать зарплату. Наш php программист&nbsp;&mdash; ЗАРАБАТЫВАЕТ свою зарплату и&nbsp;премии. Для нас это принципиально! Мы&nbsp;щедры на&nbsp;плюшки, но&nbsp;при качественном продукте!</p>\r\n	</li>\r\n	<li>\r\n	<p>Наш php программист&nbsp;&mdash; это человек, который переживает за&nbsp;конечный продукт&nbsp;&mdash; это означает, что php программист четко понимает, что он&nbsp;дает конечный ценный продукт клиенту и&nbsp;от&nbsp;его конечной работы будет зависеть УЙДЕТ&nbsp;ОТ НАС КЛИЕНТ УДОВЛЕТВОРЕННЫЙ ИЛИ НЕТ, что в&nbsp;дальнейшем повлияет на:</p>\r\n	</li>\r\n	<li>\r\n	<p>будет&nbsp;ли клиент работать с&nbsp;нами по&nbsp;продвижению своего сайта;</p>\r\n	</li>\r\n	<li>\r\n	<p>будет&nbsp;ли клиент рекомендовать нашу веб-студию своим знакомым и&nbsp;партнерам;</p>\r\n	</li>\r\n	<li>\r\n	<p>будет&nbsp;ли клиент отзываться о&nbsp;нашей студии положительно или отрицательно (в&nbsp;том числе письменные отзывы в&nbsp;интернете).</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>В&nbsp;звязи с&nbsp;этим наш php программист обязан переживать за&nbsp;качественный программный код, безопасность, функциональность и&nbsp;минимум багов.</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Наш php программист понимает, что продукт может быть ТОЛЬКО КАЧЕСТВЕННЫМ, минимум багов, потому как это&nbsp;&mdash; наше &laquo;лицо&raquo; и&nbsp;любой проект будет составной частью нашего портфолио, которое будут смотреть наши будущие клиенты и&nbsp;принимать решение работать с&nbsp;нами или нет.</p>\r\n	</li>\r\n	<li>\r\n	<p>Наш php программист умеет общаться с&nbsp;заказчиками.</p>\r\n	</li>\r\n	<li>\r\n	<p>Нормально реагирует на&nbsp;критику руководства, дизайнера и&nbsp;Projeсt Manager-а.</p>\r\n	</li>\r\n	<li>\r\n	<p>Умеет работать одновременно над несколькими проектами! Это ВАЖНО!</p>\r\n	</li>\r\n	<li>\r\n	<p>Наш php программист всегда старается закончить проект раньше срока (но&nbsp;не в&nbsp;ущерб другим проектам), за&nbsp;что всегда будет поощрен премиями и&nbsp;плюшками (при завершении проекта раньше отведенного на&nbsp;проект срока, php программист должен сообщить Projeсt Manager-у и&nbsp;указать на&nbsp;завершение проекта раньше срока с&nbsp;пометкой в&nbsp;CRM системе)</p>\r\n	</li>\r\n</ol>\r\n\r\n<p><strong>Условия:</strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Ставка + премии:</p>\r\n	</li>\r\n	<li>\r\n	<p>Выплата премии будет зависеть только от&nbsp;Вас!</p>\r\n	</li>\r\n	<li>\r\n	<p>Каким образом?</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>a. Вы&nbsp;стремитесь к&nbsp;профессиональному развитию (чтение проф. литературы, тематических статей, анализ работ иностранных программистов);</p>\r\n\r\n<p>b. Вы&nbsp;качественно программируете (наш php программист должен понимать, что с&nbsp;его кодом может работать другой программист, код должен быть чистый и&nbsp;понятный, присутствовать комменты на&nbsp;англ. языке);</p>\r\n\r\n<p>c. Вы&nbsp;программируете быстро, качественно и&nbsp;в&nbsp;срок. Приветствуется досрочное выполнение задания. При планировании времени на&nbsp;программирование мы&nbsp;закладываем время для Вашего профессионального развития.</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Небольшой штат, но&nbsp;максимально структурированное производство и&nbsp;налаженная коммуникация между отделами</p>\r\n	</li>\r\n	<li>\r\n	<p>Предоставляем комфортное рабочее место. У&nbsp;Вас будет: кабинет техотдела, свой ПК, по&nbsp;желанию два монитора, свой Стол и&nbsp;Стул</p>\r\n	</li>\r\n	<li>\r\n	<p>Рассматриваем в&nbsp;дальнейшем выделение помощника или равноценного php программиста при определенной загрузке</p>\r\n	</li>\r\n	<li>\r\n	<p>Имеем кухню с&nbsp;чайником, микроволновкой и&nbsp;посудой.</p>\r\n	</li>\r\n	<li>\r\n	<p>Офис на&nbsp;Харьковском шоссе.</p>\r\n	</li>\r\n	<li>\r\n	<p>Полный рабочий день: с&nbsp;8.00 -17.00</p>\r\n	</li>\r\n	<li>\r\n	<p>5 дней в&nbsp;неделю</p>\r\n	</li>\r\n</ol>\r\n\r\n<p><strong>Что будет делать Наш php программист, ОБЯЗАННОСТИ</strong>:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>PHP 5,3+</p>\r\n	</li>\r\n	<li>\r\n	<p>Mysql&nbsp;&mdash; построение запросов, парсеры, триггеры, оптимизация запросов</p>\r\n	</li>\r\n	<li>\r\n	<p>MVC, ООП и&nbsp;шаблонизаторы</p>\r\n	</li>\r\n	<li>\r\n	<p>JavaScript</p>\r\n	</li>\r\n	<li>\r\n	<p>JQuery</p>\r\n	</li>\r\n	<li>\r\n	<p>Ajax</p>\r\n	</li>\r\n	<li>\r\n	<p>проектирование баз данных</p>\r\n	</li>\r\n	<li>Kohana, Yii, Zend</li>\r\n	<li>Magento, Joomla, Webasyst, WordPress, Smarty</li>\r\n	<li>\r\n	<p>Взаимодействие с&nbsp;UI/UX разработчиком, html верстальщиком по&nbsp;вопросам адаптации вёрстки</p>\r\n	</li>\r\n	<li>Умение работать с&nbsp;SVN, git, коллективная и&nbsp;командная разработка</li>\r\n	<li>\r\n	<p>доработка кода по&nbsp;существующим проектам</p>\r\n	</li>\r\n	<li>\r\n	<p>Понимание принципов проектирования сайтов, умение разбираться в&nbsp;чужом коде</p>\r\n	</li>\r\n	<li>\r\n	<p>Поддержка существующих backend решений</p>\r\n	</li>\r\n	<li>\r\n	<p>Разработка новых модулей для существующих систем</p>\r\n	</li>\r\n	<li>\r\n	<p>Разработка новых модулей, плагинов и&nbsp;сервисов</p>\r\n	</li>\r\n	<li>API платежных систем, API Google, Яндекс, социальных сетей</li>\r\n</ul>\r\n\r\n<p><strong>Вы&nbsp;НЕ наш php программист если:</strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Делаете все от&nbsp;дизайна до&nbsp;программирования</p>\r\n	</li>\r\n	<li>\r\n	<p>У&nbsp;вас нет прямого опыта работы в&nbsp;сфере веб-программирования</p>\r\n	</li>\r\n	<li>\r\n	<p>Вам кажется, что Вы &laquo;звезда&raquo; во&nbsp;всех ее&nbsp;проявлениях. Вы&nbsp;все знаете, все можете. Вы&nbsp;считаете, что Вас недооценивают и&nbsp;соответственно не&nbsp;доплачивают за&nbsp;то, что Вы &laquo;звезда&raquo;</p>\r\n	</li>\r\n	<li>\r\n	<p>Вы&nbsp;не&nbsp;согласны с&nbsp;фразой &laquo;Наш php программист ЗАРАБАТЫВАЕТ зарплату, а&nbsp;не&nbsp;просто ее&nbsp;получает&raquo;.</p>\r\n	</li>\r\n</ol>\r\n','ita.in.ua@gmail.com',NULL,'2017-10-23 10:24:33','2017-10-23 10:24:33',14000,1,0,1,'NULL'),(109,'Junior QA Engineer',116,'2','0000-00-00',200,'<p>&#39;Dolphin App&#39; Kiev is&nbsp;looking for talented Junior&nbsp;QA Engineer to&nbsp;join the team. We&nbsp;create games for IOS, Android and WebGl platforms with &#39;Unity&#39; game engine.Requirements:</p>\r\n\r\n<ul>\r\n	<li>Run assigned test requests and identify game issues (bugs).</li>\r\n	<li>Enter accurate high-quality game issues based on&nbsp;department standards into bug tracking system.</li>\r\n	<li>Test and verify bug fixes.</li>\r\n	<li>\r\n	<p>Write Test cases for each project.</p>\r\n	</li>\r\n	<li>\r\n	<p>Investigate issues coming from Customers Support.</p>\r\n	</li>\r\n	<li>Provide thoughtful and professional feedback on&nbsp;gameplay related issues in&nbsp;both written and verbal form.</li>\r\n	<li>Assist in&nbsp;assessing and escalating game issues and concerns with product managers, Dev and&nbsp;QA managers.</li>\r\n	<li>Learn and apply testing and game industry terminology.</li>\r\n	<li>Learn and become fluent in&nbsp;the rules of&nbsp;each game and apply knowledge to&nbsp;testing.</li>\r\n	<li>Be&nbsp;a&nbsp;vigilant champion of&nbsp;ongoing build verification and acceptance.</li>\r\n	<li>Have the adaptability to&nbsp;frequently change testing focus in&nbsp;a&nbsp;fast-moving development environment.</li>\r\n	<li>Ability to&nbsp;create concise and accurate reproduction steps.</li>\r\n	<li>Strong attention to&nbsp;detail.</li>\r\n	<li>Availability to&nbsp;work forty or&nbsp;more hours per week including weekends and holidays, when required.</li>\r\n	<li>Ability to&nbsp;remain focused in&nbsp;a&nbsp;team-oriented environment.</li>\r\n	<li>Superior work ethic and the ability to&nbsp;work independently as&nbsp;required.</li>\r\n	<li>\r\n	<p>Intermediate level English (and higher) in&nbsp;both Writing and Speaking.</p>\r\n	</li>\r\n	<li>21 years of&nbsp;age or&nbsp;older.</li>\r\n</ul>\r\n','ita.in.ua@gmail.com',NULL,'2017-10-24 09:05:42','2017-10-24 09:07:34',400,2,0,1,'NULL'),(110,'Junior PHP Developer',117,'2','0000-00-00',6000,'<p><strong>В&nbsp;случае отсутствия опыта работы&nbsp;&mdash; требуется выполнение тестового задания</strong></p>\r\n\r\n<p>https://docs.google.com/document/d/1OGMCcTyvIAaVO8EI7TX57JKPAimZqGbBkc34GUpGUbg</p>\r\n\r\n<p><strong>Необходимые навыки:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Опыт работы PHP/MySQL;</strong></li>\r\n	<li>понимание принципов работы WEB (HTTP/REST API/DNS/etc&hellip;);</li>\r\n	<li>базовое знание SQL и&nbsp;умение писать запросы;</li>\r\n	<li>базовое владение HTML/CSS/JavaScript/jQuery;</li>\r\n	<li>базовое знание *nix;</li>\r\n	<li>базвоый опыт работы с&nbsp;git;</li>\r\n	<li>умение логически мыслить, быстро обучаться, решать нестандартные задачи;</li>\r\n</ul>\r\n\r\n<p><strong>Предлагаем:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>социальный пакет;</strong></li>\r\n	<li><strong>возможность гибкого графика или работы на&nbsp;неполный день для студентов;</strong></li>\r\n	<li>офис в&nbsp;центре города (Подол, м. Контрактовая);</li>\r\n	<li>достойную оплату труда;</li>\r\n	<li>интересные проекты и&nbsp;достойную команду;</li>\r\n	<li>работа только над собственными проектами&nbsp;&mdash; никакого аутсорсиннга;</li>\r\n	<li>выделение достаточного количества времени для качественной разработки и&nbsp;рефакторинга.</li>\r\n</ul>\r\n\r\n<p><strong>Обязанности</strong></p>\r\n\r\n<ul>\r\n	<li>Разработка SAAS сервиса облачной аналитики</li>\r\n</ul>\r\n','ita.in.ua@gmail.com',NULL,'2017-10-26 10:51:31','2017-10-26 10:51:31',12000,1,0,1,'NULL'),(111,'Android Trainee Developer',118,'2','0000-00-00',1,'<p><strong>GlobalLogic Ukraine</strong>&nbsp;is inviting a Android Trainee Developer to join its&nbsp;<strong>Lviv&nbsp;</strong>office.</p>\r\n\r\n<p><strong>We offer:</strong></p>\r\n\r\n<ul>\r\n	<li>Interesting and challenging work in a large and dynamically developing company</li>\r\n	<li>Exciting projects involving newest technologies</li>\r\n	<li>Professional development opportunities</li>\r\n	<li>Excellent compensation and benefits package, performance bonus program</li>\r\n	<li>Modern and comfortable office facilities</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Responsibilities:</strong></p>\r\n\r\n<ul>\r\n	<li>Developing new features</li>\r\n	<li>Communicating with via chat and verbally</li>\r\n	<li>Following high code standards</li>\r\n	<li>Following code review process</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Requirements:</strong></p>\r\n\r\n<ul>\r\n	<li>Smart, creative person</li>\r\n	<li>Strong theoretical knowledge in Java programming language</li>\r\n	<li>Android knowledge</li>\r\n	<li>Experience in developing Android applications would be an advantage</li>\r\n	<li>Understanding of OOP concepts</li>\r\n	<li>Intermediate Strong English</li>\r\n</ul>\r\n','ita.in.ua@gmail.com',NULL,'2017-10-28 07:29:17','2017-10-28 07:29:17',5,1,0,1,'NULL'),(112,'empty',119,'11','0000-00-00',1,'<p>Корпорація &laquo;ІСД&raquo; є однією з найбільших транснаціональних металургійних компаній з головним офісом в Україні, м. Київ.&nbsp; Корпорація &laquo;ІСД&raquo; найвідоміша світу в якості провідного виробника сталі у регіоні Центральної та Східної Європи. Виробничі та прокатні потужності Корпорації є стратегічно розташованими у краінах СНД та Євросоюзу, а продукція &laquo;ІСД&raquo; знаходить свого покупця на всіх основних світових ринках збуту.&nbsp; За результатами 2008 року Корпорація &laquo;ІСД&raquo; війшла до числа 40-ти найбільших виробників сталі у світі з показником більш ніж 10 млн.т. сталі на рік*. Корпорація є лідером в області технічного переоснащення металургійних комбінатів. Кожен з металургійних активів &laquo;ІСД&raquo; впроваджує низку найамбітніших програм реконструкції та розширення виробничих потужностей у сучасній індустрії. Загальний об&rsquo;єм інвестицій з 2005 до 2011 року складає 2,7 млрд. доларів США. В 2007 році &laquo;ІСД&raquo; досяг піку семирічного інвестиційного плану на своїх заводах, після внесення в модернізацію більше 1 млрд. доларів США.&nbsp;</p>\r\n','natalisnejka@gmail.com',NULL,'2017-10-28 15:15:31','2017-10-28 15:15:31',10000,1,0,1,'NULL'),(113,'Junior Manual QA Engineer for eToro',120,'2','0000-00-00',1,'<p>As&nbsp;a&nbsp;key member of&nbsp;the technology teams, you will help shape, in&nbsp;conjunction with the product team, an&nbsp;innovative, scalable and efficient product while working with talented teammates to&nbsp;bring the complex features and functions of&nbsp;eToro together into a&nbsp;discovery investing platform that simplifies the customer experience.</p>\r\n\r\n<p>eToro is&nbsp;a&nbsp;company growing and evolving every day, which strives that fun environment fuel people&rsquo;s creativity, inspire curiosity and drive passion to&nbsp;build eToro mobile into the audience leader for the investing experience.</p>\r\n\r\n<p><strong>Responsibilities</strong></p>\r\n\r\n<ul>\r\n	<li>Perform all testing activities required in&nbsp;project cycle</li>\r\n	<li>Analyzes project requirements</li>\r\n	<li>Test cases/checklists and other types of&nbsp;test documentation creation</li>\r\n	<li>Identify, report and track product defects</li>\r\n	<li>Estimate the required testing time</li>\r\n	<li>Test Summary reports preparation</li>\r\n</ul>\r\n\r\n<p><strong>Requirements</strong></p>\r\n\r\n<ul>\r\n	<li>Manual testing of&nbsp;web and mobile applications at&nbsp;least for one year</li>\r\n	<li>Experience in&nbsp;writing test scripts as&nbsp;well as&nbsp;execute them</li>\r\n	<li>Experience with Test requirements analysis</li>\r\n	<li>Test design and planning</li>\r\n	<li>SQL knowledge</li>\r\n	<li>English level&nbsp;&mdash; upper-intermediate</li>\r\n</ul>\r\n\r\n<p><strong>Desirable</strong></p>\r\n\r\n<ul>\r\n	<li>Experience in&nbsp;working with online payment providers (PayPal, Neteller, etc)</li>\r\n	<li>Knowledge and experience with the specific domain&nbsp;&mdash; payments</li>\r\n	<li>Financial background/knowledge</li>\r\n	<li>Computer science background</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in&nbsp;it&nbsp;for you?</strong></p>\r\n\r\n<ul>\r\n	<li>Being a&nbsp;part of&nbsp;developing our new and exciting social mobile and Web platforms!</li>\r\n	<li>You will have responsibility of&nbsp;apps that have more than 3 million users and growing tremendously fast!</li>\r\n	<li>Working with the latest technologies!</li>\r\n	<li>Joining the winning teams!</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Unique working environment where you communicate and work directly with the Client</li>\r\n	<li>Competitive salary</li>\r\n	<li>Exposure to&nbsp;cutting-edge technologies</li>\r\n	<li>Possibility to&nbsp;work in&nbsp;world-known and successful company</li>\r\n	<li>Long-term employment with 20 working-days paid vacation and other social benefits</li>\r\n	<li>State of&nbsp;the art, cool, centrally located offices with warm atmosphere which creates really good working conditions</li>\r\n</ul>\r\n\r\n<p><strong>Join Ciklum and &laquo;Cross the Borders&raquo; together with us!</strong></p>\r\n','ita.in.ua@gmail.com',NULL,'2017-10-30 08:27:56','2017-10-30 20:09:25',5,1,0,1,'NULL'),(114,'Junior QA Engineer',121,'2','0000-00-00',1,'<p>Компанія&nbsp;<strong>Forte Group&nbsp;</strong>запрошує на&nbsp;роботу&nbsp;<strong>Jr. Manual QA</strong>. У&nbsp;вас буде можливість брати участь у&nbsp;створенні нового і цікавого продукту, oтримувати практичний досвід кожен день, працювати у&nbsp;команді висококласних фахівців із США та Білорусії .</p>\r\n\r\n<p><strong>Щоденні обов&rsquo;язки:</strong></p>\r\n\r\n<ul>\r\n	<li>регресивне тестування мобільних та&nbsp;десктопних додатків</li>\r\n	<li>перевірка вимог на&nbsp;логічні помилки</li>\r\n	<li>клієнт-серверне тестування</li>\r\n	<li>кросбраузерне, кросплатформенне тестування</li>\r\n	<li>перформанс тестування</li>\r\n	<li>реєстрація багів</li>\r\n</ul>\r\n\r\n<p><strong>Вимоги до&nbsp;вакансії:</strong></p>\r\n\r\n<ul>\r\n	<li>Experience of&nbsp;web application testing including&nbsp;UI and System Testing in&nbsp;different browsers and on&nbsp;different OS</li>\r\n	<li>Hands-on experience in&nbsp;writing test cases, according to&nbsp;requirements, running test cases,reporting bugs in&nbsp;bug-tracking systems</li>\r\n	<li>Experience of&nbsp;working with bug-tracking tools (JIRA, BugZilla, ALM or&nbsp;Quality Center)</li>\r\n	<li>Understanding of&nbsp;OS X, Android, iOS on&nbsp;the level of&nbsp;user or&nbsp;admin</li>\r\n	<li>Good theoretical background of&nbsp;testing</li>\r\n	<li>Good English is&nbsp;mandatory</li>\r\n</ul>\r\n','ita.in.ua@gmail.com',NULL,'2017-10-31 10:44:34','2017-10-31 10:44:34',5,1,0,1,'NULL'),(115,'Trainee Front-End Developer',122,'2','0000-00-00',1,'<p>You need</p>\r\n\r\n<ul>\r\n	<li>Cross-browser HTML, CSS/LESS, OOP JavaScript&nbsp;&mdash; 1+&nbsp;years of&nbsp;experience</li>\r\n	<li>Skills in&nbsp;JavaScript and JQuery</li>\r\n	<li>Object Oriented Programming Basics</li>\r\n	<li>Web Programming Fundamentals</li>\r\n	<li>Comfortable with LAMP stack (Linux, Apache, MySQL, PHP)</li>\r\n	<li>Well versed with Javascript, CSS, HTML</li>\r\n	<li>Experience with web APIs</li>\r\n</ul>\r\n\r\n<p>Why us?</p>\r\n\r\n<p>Our Amsterdam-based client has developed and continues enhancing the world&rsquo;s leading digital banking solution that allows creating rich, interactive web portals and mobile applications. Our client&rsquo;s Banking as&nbsp;a&nbsp;Service platform comes with a&nbsp;complete set of&nbsp;integrated customer experience management functions, including: integrated content management, intelligent forms-based dialogs, secure application integration, cross device delivery, smart targeting, digital marketing tools, and integrated analytics.&nbsp;<br />\r\nIf&nbsp;you are a&nbsp;client of&nbsp;a&nbsp;major European bank, chances are you&rsquo;ve already used our client&rsquo;s platform. Now you have a&nbsp;great chance to&nbsp;contribute to&nbsp;its development and enhancement.<br />\r\nWe&nbsp;believe in&nbsp;Scrum, so, ideally, you have worked in&nbsp;an&nbsp;Agile environment before. We&rsquo;ve taken it&nbsp;a&nbsp;step further by&nbsp;moving to&nbsp;the Spotify model, letting&nbsp;us share knowledge more efficiently. We&nbsp;are a&nbsp;Dutch company, so&nbsp;multicultural and diverse, your positive attitude to&nbsp;your teammates, both local and remote, will be&nbsp;much appreciated. We&nbsp;believe that we&nbsp;have found the perfect work-life balance. We&nbsp;encourage individual personal growth beyond the office hours. Bring along your hobby, there is&nbsp;a&nbsp;big chance you will find a&nbsp;colleague to&nbsp;share it&nbsp;with. &nbsp; 9&nbsp;reasons to&nbsp;join&nbsp;us:</p>\r\n\r\n<ol>\r\n	<li>Frequent business trips to&nbsp;European countries;</li>\r\n	<li>Ability to&nbsp;create added value for yourself&nbsp;&mdash; We&nbsp;have specially equipped Levi9 laboratories (with 3D&nbsp;printers and other high-tech features) where you can work on&nbsp;your own startups or&nbsp;test any other crazy ideas;</li>\r\n	<li>Possibility to&nbsp;share knowledge on&nbsp;tech talks, meetups and conferences in&nbsp;different Levi locations and outside the company;</li>\r\n	<li>Your health support via compensation of&nbsp;sport activities, vacation policy and private medical insurance;</li>\r\n	<li>Financial and vacation support of&nbsp;your important life events (wedding, child birth etc.);</li>\r\n	<li>Democratic banking policy&nbsp;&mdash; you can cooperate with&nbsp;us through any legal Ukrainian bank you choose;</li>\r\n	<li>Work for industry leaders such as&nbsp;TomTom, Xerox, Swarco and others;</li>\r\n	<li>&ldquo;Save time&rdquo; principles. We&nbsp;promote Automation testing and innovation technologies to&nbsp;save the most precious resource&nbsp;&mdash; your time.</li>\r\n	<li>No&nbsp;micromanagement. We&nbsp;are free birds with clear understanding what the high performance&nbsp;is!</li>\r\n</ol>\r\n','ita.in.ua@gmail.com',NULL,'2017-11-06 10:55:05','2017-11-06 10:55:05',5,1,0,1,'NULL'),(116,'Junior/Trainee Software Engineer ( iOS | .Net | Android | Web | Ruby)',123,'2','0000-00-00',1,'<p>We are welcome to propose internship program in our company. This a good opportunity to get new knowledge and improve your skills in programing. If you are studying in the last years of university or just graduated - welcome to our trainee program.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>During this program you will:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>join amazing team and awesome fun environment</p>\r\n	</li>\r\n	<li>\r\n	<p>get new experience</p>\r\n	</li>\r\n	<li>\r\n	<p>learn from professionals</p>\r\n	</li>\r\n	<li>\r\n	<p>find place to start your career</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Primarily we are looking for .NET INTERNS. Basically we are always hiring .Net.</strong></p>\r\n\r\n<p><strong>Also we have following internship positions opened: Ruby, PHP, Web, iOS.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Requirements:</strong></p>\r\n\r\n<ol>\r\n	<li>Preferably students of 4-5 years or graduates of the last 2 year (Computer Science or similar)</li>\r\n	<li>Location - Preferably Lviv, Lviv region</li>\r\n	<li>Intermediate+ level of English</li>\r\n	<li>Strong analytics skills</li>\r\n	<li>Experience in one of the following:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>For .Net: MVC, WPF, Xamarin</li>\r\n	<li>For Java: Android or Java/JEE</li>\r\n	<li>iOS | Web | Ruby | PHP</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What we offer:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>interesting and challenging projects</p>\r\n	</li>\r\n	<li>\r\n	<p>comfortable office</p>\r\n	</li>\r\n	<li>\r\n	<p>professional development opportunities</p>\r\n	</li>\r\n	<li>\r\n	<p>friendly team of young IT professionals</p>\r\n	</li>\r\n	<li>\r\n	<p>flexible schedule</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Accelerate your career with Leobit!</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let&#39;s talk :)</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-11-09 13:03:31','2017-11-09 13:03:31',5,1,0,1,'NULL'),(117,'Junior ​​Java Script ​​Developer ​​(Trainee)',72,'2','0000-00-00',1,'<p>Requirements:</p>\r\n\r\n<p>The MEAN​stack: MongoDB, Express.js, Angular, Node.js. ● IT experience &mdash; 6+ months</p>\r\n\r\n<p>● Technical education (related to computer science) ● Understanding of OOP</p>\r\n\r\n<p>● Knowledge of basic pattern design</p>\r\n\r\n<p>● Good Algorithmic knowledge</p>\r\n\r\n<p>● Good theoretical knowledge of Databases</p>\r\n\r\n<p>● Understanding of the basic principles of networks</p>\r\n\r\n<p>● English Intermediate level or above It will be good if applicant has experience with Angular 2 and Nginx.</p>\r\n\r\n<p>We ​​offer:</p>\r\n\r\n<p>● Professional and career growth</p>\r\n\r\n<p>● Paid trainings, conferences</p>\r\n\r\n<p>● Paid vacations and sick leave</p>\r\n\r\n<p>● Friendly atmosphere</p>\r\n\r\n<p>● Flexible working schedule</p>\r\n\r\n<p>● Corporate and team building events, juices, cookies, fruits &amp; vegetables and much more&hellip;</p>\r\n\r\n<p>● Comfortable office</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-11-09 20:01:18','2017-11-10 11:54:04',5,1,0,1,'NULL'),(118,'hhjhjhgjjgf',124,'9','0000-00-00',200,'<p>тестова вакансія</p>\r\n','iraghuk@gmail.com',NULL,'2017-11-11 14:42:36','2017-11-11 16:04:10',300,1,0,1,'NULL'),(119,'Android Developer',124,'9','0000-00-00',123,'<p>jhkh</p>\r\n','iraghuk@gmail.com',NULL,'2017-11-11 17:23:54','2017-11-11 17:23:54',234,1,0,1,'NULL'),(120,'C++/QT INTERN',125,'2','0000-00-00',1,'<h2>PROJECT DESCRIPTION</h2>\r\n\r\n<p>Work for a core delivery team inside Luxoft Automotive Division to develop the new incumbent of a suite of products. These products are focused on the development and delivery of HMI for headunit and instrument cluster systems inside the automotive area. For being able to fulfill the customer expectations we need additional experienced C++ and QT developers. You will work in a challenging environment with intercultural and international teams where the company culture and language is a mix of German and English.</p>\r\n\r\n<hr />\r\n<h2>RESPONSIBILITIES</h2>\r\n\r\n<p>Work inside an intercultural team of many layers and competencies around software engineer, Architecture and development. The team is extended by Quality Engineering, Testing, Technical writers, Product Management.</p>\r\n\r\n<hr />\r\n<h2>SKILLS REQUIRED</h2>\r\n\r\n<p>Knowledge of C++ and QT, QML skills<br />\r\nGerman is very strong advantage<br />\r\nKnowing agile process is an advantage.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-11-13 07:29:12','2017-11-13 07:29:12',2,1,0,1,'NULL'),(121,'middle — senior .net developer',126,'2','0000-00-00',5,'<p>We are looking for professional who possesses a passion for pushing web technologies to the limits and will work with our team of talented developers to design and build the next generation of our web services. Skills Proven working experience in software development (middle &mdash; senior level) Working experience in ASP.Net web development Azure, TFS, git Debugging, profiling, monitoring tools Technologies and tools set: &bull; C# .net 4.x &bull; asp net mvc 5, asp net.core 1.1 &bull; EntityFramework 6.X &bull; MSSQL</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-11-15 10:35:02','2017-11-15 10:36:25',10,1,0,1,'NULL'),(122,'C# developer',127,'2','0000-00-00',1,'<p>&bull; Experience with XAML</p>\r\n\r\n<p>&bull; Experience with client development MVVM concept (WPF) Xamarin.Forms Experience</p>\r\n\r\n<p>&bull; Very good english speaking</p>\r\n\r\n<p>&bull;Good team work</p>\r\n\r\n<p>&bull;Degree in Computer Science or related discipline</p>\r\n\r\n<p>&bull;Passionate about mobile technologies and coding the right wayAdvantage:</p>\r\n\r\n<p>&bull; <a href=\"http://www.scrdairy.com/\" target=\"_blank\">http://www.scrdairy.com/</a> (200 employees, very strong Israeli high-tech company)</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-11-16 10:11:14','2017-11-16 10:11:14',5,1,0,1,'NULL'),(123,'Trainee QA Engineer',85,'2','0000-00-00',1,'<h3>Необхідні навички</h3>\r\n\r\n<p>Students of&nbsp;4-5&nbsp;years or&nbsp;university graduates with technical education in&nbsp;IT (Computer Science, Electrical Engineering or&nbsp;similar);<br />\r\nQA&nbsp;courses (will be&nbsp;an&nbsp;advantage);<br />\r\nKnowledge in&nbsp;QA domain, QA&nbsp;processes, Test management, Testing types, Testing techniques, Bug tracking tools, Version control systems;<br />\r\nWould be&nbsp;a&nbsp;plus any experience in&nbsp;web/mobile/desktop testing;<br />\r\nAt&nbsp;least Pre-Intermediate writing and reading English;<br />\r\nMust be&nbsp;a&nbsp;fast learner and able to&nbsp;perform independently in&nbsp;a&nbsp;dynamic environment.</p>\r\n\r\n<h3>Пропонуємо</h3>\r\n\r\n<p>Opportunity to&nbsp;get your first job in&nbsp;QA area;<br />\r\nFriendly and highly professional team;<br />\r\n24&nbsp;working days paid vacation;<br />\r\nMedical insurance and paid sick days;<br />\r\nFlexible schedule;<br />\r\nProfessional &amp;&nbsp;personal growth.</p>\r\n','ita.in.ua@gmail.com',NULL,'2017-11-18 09:30:37','2017-11-18 09:30:37',5,1,0,1,'NULL');
